i>\r\n				<li>\r\n					Nancy S</li>\r\n				<li>\r\n					Juanita Sanders</li>\r\n				<li>\r\n					Lisa Sater</li>\r\n\r\n				<li>\r\n					Nick Schouten</li>\r\n				<li>\r\n					Susan Scott</li>\r\n				<li>\r\n					Lynn Severy</li>\r\n				<li>\r\n					Shauna Shipley</li>\r\n				<li>\r\n					Cathy Singleton</li>\r\n				<li>\r\n					Lee Sledd</li>\r\n				<li>\r\n					Douglas Smith</li>\r\n				<li>\r\n					Thomas Smith</li>\r\n				<li>\r\n					Tom Smith</li>\r\n				<li>\r\n					Hubert Smith</li>\r\n				<li>\r\n					Stephan Soluerson</li>\r\n				<li>\r\n					Linda Spurell</li>\r\n				<li>\r\n					Jeffry Steele</li>\r\n				<li>\r\n					Cathy Steele</li>\r\n				<li>\r\n					Heidi Stephens</li>\r\n				<li>\r\n					Rees Stetson</li>\r\n				<li>\r\n					Rose Stevens</li>\r\n				<li>\r\n					Jessica Stone</li>\r\n				<li>\r\n					Waldo Stone</li>\r\n				<li>\r\n					Brad Thompson</li>\r\n				<li>\r\n					Anita Thompson</li>\r\n				<li>\r\n					Beth Thoms</li>\r\n				<li>\r\n					Daniel Thorenson</li>\r\n				<li>\r\n					Patti Turney</li>\r\n				<li>\r\n					Jessica Uhler</li>\r\n				<li>\r\n					Heather Valtee</li>\r\n				<li>\r\n					Kathy Vervalin</li>\r\n				<li>\r\n					Steve Webster</li>\r\n				<li>\r\n					Douglas White</li>\r\n				<li>\r\n					Deborah White</li>\r\n				<li>\r\n					Pat Wieth</li>\r\n				<li>\r\n					Alison Wiley</li>\r\n				<li>\r\n					Dianna Williams</li>\r\n				<li>\r\n					Ellenda Wulfestieg</li>\r\n				<li>\r\n					Rita Yantormi</li>\r\n				<li>\r\n					Sally York</li>\r\n\r\n			</ul>\r\n</div>\r\n			\r\n<div style="float: left; width: 100%">\r\n<p><i> In addition to our wonderful Puget Sound Farming community, we are also supported by the following organizations:</i> <p>\r\n\r\n<table cellspacing="15px" align="center" width="600px" border="0">\r\n<tr align="center">\r\n<td><img style="height:100px;" src="http://piercecountygleaningproject.org/images/pc.jpg"></td>\r\n</tr>\r\n<tr align="center">\r\n<td><img style="height:75px;" src="http://piercecountygleaningproject.org/images/slfc.jpg"></td>\r\n<td><img style="height:100px;" src="http://piercecountygleaningproject.org/images/efn.jpg"></td>\r\n<td><img style="height:100px;" src="http://piercecountygleaningproject.org/images/rfh.jpeg"></td>\r\n<td> </td>\r\n</tr>\r\n</table>\r\n</div>'),
('wishtxt', '<h3>Wish List</h3>'),
('teamtxt', '<html>\r\n<body>\r\n<h1>Our Team</h1>\r\n\r\n<h2>Harvest Pierce County Staff <h2>\r\n\r\n<h3> Mason Durfee</h3>\r\n<div><img style="float:left; width:100px; margin:10px" src="C:\\Users\\masond\\Desktop\\BIO\\PCD_website.jpg"> \r\n\r\n<p> Mason joined the Gleaning Project in July of 2015. A graduate of the University of Vermont, they have worked on farms in the Northeast and Northwest, and studied sustainable agriculture in Oaxaca, Mexico. Mason supports the Gleaning Project and fruit tree education workshops. Mason loves Bosc pears and when they are not blissfully harvesting food, they enjoy cooking, gardening, and teaching kids about both.<br>  </p>\r\n</div>\r\n<p>\r\n<p>\r\n'),
('FAQtxt', '<h3>Frequently Asked Questions</h3>\r\n<p><strong>Where does the Gleaning Project Harvest?</strong></p>\r\n<p>\r\nWe primarily harvest from farms in the Puyallup/Orting valley and pick fruit trees in Tacoma, Parkland, Summit/Waller, Stielacoom, Lakewood, Gig Harbor, and the Puyallup/Sumner/Bonney Lake Area. \r\n</p>\r\n<p>\r\n<strong>Where does the food go?</strong></p>\r\n<p>For farms harvests, volunteers are allowed to take serving of produce home if the farmer allows it - the rest is donated to area food banks near the harvest site. </p>\r\n<p>\r\nAt least 50% of the food from fruit tree harvests is donated, with the other 50% divided between the volunteer harvesters and the homeowner (25% for each).\r\n</p>\r\n<p>\r\nAlthough we try to donate to the most local food bank to our harvest sites, this is often difficult due to the variance in open hours, capacity,  and desire to accept fresh produce. Gleaned produce is often spread across multiple food banks around the county. If you know of a food bank or community organization in need, let us know so we can put them on our <a href="www.piercecountygleaningproject.org/donate"> Where to Donate</a> brochure.\r\n</p>\r\n<p><strong>When do you harvest?</strong></p>\r\n<p>\r\nOur harvest season generally runs from June-November, however, we have sporadic harvests throughout the winter and spring as well!</p>\r\n<p>\r\nOur harvest days and times are largely based on the availability of our wonderful volunteer harvest coordinators and farmer/homeowner schedules. Even if we don''t have a harvest that fits your schedule one week, check back again in another week or two and we might have something that works for you! We do try to keep our harvests the same day and time every week for each geographic fruit tree area. \r\n</p>\r\n\r\n<p><strong> Can I bring my kids?</strong></p>\r\n<p> Most gleaning events are family friendly unless otherwise stated. We love having kids around and exposing them to the food system. If you are registering for an event and your kid is under 18 years please only register for yourself. We ask that  you only register for ONE volunteers space to make sure we have enough capable hands to complete the harvest. Lastly, when you arrive at the harvest please ask the Harvest Leaders for a Youth Liability Waiver so you may complete one for your child.</p>\r\n\r\n<p><strong>Why don''t I see the address listed for a harvest?</strong></p>\r\n<p>The address for a glean will be emailed to you after you are registered. If you are on the waitlist, you will not receive the address unless a spot opens up. If you are registered and do not receive an email please email ReneeMe@piercecountycd.org or MasonD@piercecountycd.org</p>\r\n\r\n<p><strong>What if I signed up for a harvest I cannot attend?</strong></p>\r\n<p> Please UNREGISTER yourself by finding the harvest confirmation email, and clicking the "unregister" link. If you have trouble, email mattp@piercecountycd.org.</p? \r\n'),
('contacttxt', '<h3>Harvest Pierce County''s Gleaning Project contact information</h3>\r\n<blockquote>\r\n<p>Primary contacts: \r\n<blockquote>\r\nMason Durfee, Program Specialist <a href="mailto:masond@piercecountycd.org">masond@piercecountycd.org</a></p>\r\nRenee Meschi, Program Specialist <a href="mailto:reneeme@piercecountycd.org">reneeme@piercecountcd.org</a></p>\r\n<p>Office phone number: (253) 278-6215</p>\r\n<p>Mailing address:</p>\r\n<p class="indent">Harvest Pierce County''s Gleaning Project c/o Pierce Conservation District<br />\r\n<p>5430 66th Ave E, Puyallup, WA 98371</p>\r\n<p>Our physical address is:</p>\r\n501 S I St, Tacoma, WA, 98405 <br />\r\n</p>\r\n<p>Webmaster email address: <a href="mailto:piercecty@gleanweb.org">piercecty@gleanweb.org</a>.</p>\r\n<p>Other contact information: </p>\r\n<p>Our office location can be a little tricky to find. We are in the brick building next to the basketball courts in Wright Park. Please see the following as a reference:</p>\r\n\r\n<p><a href="https://mapsengine.google.com/map/edit?mid=zYUtF7zvR2W0.keaUC8QbmheM">Harvest Pierce County Office Location Map</a></p>\r\n\r\n<p>\r\nYou are welcome to drop by during regular business hours - however please call the number above to make sure staff is around! Due to the nature of our work we are often away from the office. </p>\r\n</blockquote>'),
('resourcestxt', 'Resources text goes here'),
('hometxt', '\r\n<h4>What is Gleaning?</h4>\r\n<p>Gleaning is the ancient practice of collecting leftover produce after commercial harvest. For centuries field gleaning has been a valuable resource to people in poverty. Many formal gleaning programs like Harvest Pierce Countyâ€™s Gleaning Project have been established to help meet the growing need for food assistance, minimize waste, and build community.</p? \r\n\r\n<p><i><center> Sign up for our monthly newsletter and/or weekly harvest updates!</i></p>\r\n\r\n<input type=button onClick="parent.location=''http://eepurl.com/Yfbbf''" value=''Email subscriptions''></input></center>\r\n'),
('volunteertxt', '<h1>Volunteer with the Gleaning Project!</h1>\r\n<h4><span style="color: #000000;">Do you like local healthy produce? Volunteering with the Gleaning Project is a fantastic way to build community, stop food waste, learn some new skills, share the wonders of healthy produce with your neighbors.</span></h4>\r\n\r\n<p><center><img src="http://piercecountygleaningproject.org/images/volunteer_panel.jpg"></center> </p>\r\n\r\n<p><h2><strong>Volunteer Harvester</strong></h2></p>\r\n\r\n<p style="text-align: left;"><span style="color: #333333;">Volunteer Harvesters are the backbone of the Gleaning Project. Our harvesters  glean from farms and fruit trees from June to October.  Harvest opportunities are usually between 2-4 hours and involve picking food, learning appropriate harvest techniques, and hanging outside with some awesome people. As a volunteer harvester, you can register for gleans as the come up, there is no weekly requirement. However, we will have weekly opportunities for both fruit gleans and farm gleans throughout the summer. Check out our <a title="Upcoming Events" href="http://www.piercecountygleaningproject.org/harvestlist.php">Upcoming Harvests</span></a> page to see what is available!</span></p>\r\n\r\n<p style="text-align:left; padding-left: 60px;"><strong>Farm Gleans</strong> - Farm Gleans are a great way to visit a local farm, connect with a farmer, and experience the idyllic landscape of rural Pierce County. Harvesting is family friendly - bringing your kids to a local farm is an awesome way to connect them to there food source and show them how food gets to there plate! Volunteers get to take home at least 1 serving of the gleaned produce home! </p>\r\n\r\n<p style="padding-left: 60px;"><strong> Fruit Gleans - </strong>Fruit gleans are an awesome way to meet your neighbors and experience the urban orchard of Greater Tacoma. 50% of the fruit is donated to food banks and feed sites across pierce county, the rest is divided between the homeowner and the volunteers. Volunteers take home at least 25% of the gleaned fruit! \r\n<p><h2><b>Neighborhood Harvest Leader</b></h2></p>\r\n<p>\r\nNeighborhood Harvest Leaders are the point person leading volunteers on urban fruit harvests and organizing logistics like food bank drop off and record keeping.  Coordinators ideally commit to the entire harvest season (July-mid October) and to leading a weekly harvest on a consistent day. They receive training in the beginning of the season and are offered a small stipend and mileage reimbursement for their commitment. Harvesting equipment and a vehicle (if needed) is provided to all coordinators. This is the perfect opportunity for folks who want to be harvesting regularly and who want to make more of a commitment to the program. For more information and a full position description email masonD@piercecountycd.org or call (253) 278-6215. </p>\r\n\r\n<p><h2><b>Neighborhood Fruit Scout</h2></b></p>\r\n<p>Neighborhood Fruit Scouts are volunteers who commit to registering new fruit trees for gleaning and checking on registered fruit trees to make sure they are healthy and ripe for picking!  This is a great independent volunteer opportunity. Whether you like to walk, bike, or have a car to get around, fruit scouts are an important part to making sure that healthy fruit gets harvested. Fruit Scouts ideally commit to the entire season (July-mid October) and to visiting trees on a consistent day to report and assess tree health. Scouts are a bridge to homeowners providing information on gleaning and pest management resources. Fruit Scouts receive training in the beginning of the season and are offered also a small stipend and mileage reimbursement. For more information and a full position description email masonD@piercecountycd.org or call (253) 278-6215. </p>\r\n\r\n\r\n<p><i><center> Sign up for our monthly newsletter and/or weekly harvest updates!</i></p>\r\n\r\n<input type=button onClick="parent.location=''http://eepurl.com/Yfbbf''" value=''Email subscriptions''></input></center>\r\n\r\n\r\n<p><b>Visiting  Harvest Pierce County</b></p>\r\n<p>\r\nOur office location can be a little tricky to find. We are in the brick building next to the basketball courts in Wright Park. Please see the following as a reference:</p>\r\n\r\n<p><a href="https://mapsengine.google.com/map/edit?mid=zYUtF7zvR2W0.keaUC8QbmheM">Harvest Pierce County Office Location Map</a></p>\r\n\r\n<p>\r\nYou are welcome to drop by during regular business hours - however please call the number above to make sure staff is around! Due to the nature of our work we are often away from the office. </p>'),
('termstxt', '<center><h3>Terms of Participation</h3></center>\r\nThank you for volunteering with Harvest Pierce County, your time and effort make our communities a better place to live! Please read the following volunteer agreement carefully. \r\n<ul>\r\n<li>The goal of the Harvest Pierce County is to reduce hunger, food waste, and build community. I will conduct myself in a manner consistent with that goal while attending Harvest Pierce County sponsored events.\r\n<br />\r\n<li>When I sign up for events, I will check off the boxes indicating that I have read and agree to the terms of the Term of Participation and Waiver of Liability. Once I arrive at the harvest event, I will complete a Volunteer Agreement and Liability Waiver before I begin volunteering.\r\n<li>	I will be punctual in arriving at Harvest Pierce County Events.\r\n<li>	I will not bring firearms, fireworks, illegal drugs, or alcohol to Harvest Pierce County Events\r\n<li>	I understand that Harvest Pierce County Gleaning events are conducted on private property that the owner has granted Harvest Pierce County permission to enter and harvest. I will conduct myself in a manner that is respectful of the ownerâ€™s property at all times.\r\n<li>	I will be respectful of other participants, staff, and landowners at Harvest Pierce County events.\r\n<li>	I will listen to, and follow the rules of, the orientation about the harvest given by staff or the harvest leader.\r\n<li>	I will follow all directions given to me by the staff, harvest leader, or designated assistants.\r\n<li>	I will not sell any portion of produce received at a Harvest Pierce County Event. \r\n<li>	I understand that Harvest Pierce County reserves the right to deny me entry or require me to leave and event, or remove me from the registration list if I do not follow these Terms of Participation.\r\n</ul>\r\n</p<div>'),
('backyardinfotxt', '<p style="text-align: left;" align="center">The Gleaning Project is a volunteer program of Harvest Pierce County and the Pierce Conservation District that reduces food waste by harvesting unsalable produce from local farms and residential fruit trees. The bounty is then donated to local food banks increasing access, availability, and awareness of healthy produce to underserved populations in Pierce County. The gleaning Project is always looking to partner with residential fruit tree owners\r\n<div>\r\n<h3>Benefits</h3>\r\n</div>\r\n<p>\r\n<ul>\r\n<li><b>Get food to those in need</b>:  We donate at least 50% harvested and fruit to the emergency food system. The rest of the fruit is divided equally between the homeowner and volunteer harvesters! </li>\r\n</ul>\r\n<ul>\r\n<li><b>Mess</b>: Fruit tree''s can get messy! If you don''t harvest all the fruit on your tree, the fruit will drop, rot, smell, and attract pests. Whenever gleaning volunteers are called to harvest, we harvest all fruit within reach (we use ladders and extended pickers) and pick up the ground fall as well to leave your property nice and clean after we leave!\r\n</ul>\r\n<ul>\r\n<li><b>Simplicity:</b> Gleaning volunteers can work with your schedule. Whether you need rejected produce culled, a whole pallet picked up, or multiple fields harvested with 30 volunteers, we will work with you to find the easiest way to remove your excess. The coordinator can check also check in via phone or email throughout the season at the farmer''s convenience.</li>\r\n</ul>\r\n<ul>\r\n	<li><b>No Liability:</b> Homeowners that work with the Gleaning Project are not liable for potential damage from their crop or to volunteers. Produce donated through the Gleaning Project is covered by the <i>Emerson Good Samaritan Food Donation Act</i> and volunteers are covered by Pierce Conservation District insurance.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><b>Tax Write Off</ins></b>: All Homeowners receive a donation receipt which can be used as a tax write off at $1.50 for each pound of fruit donated (a typical harvest is 100-250 pounds).</li>\r\n</ul>\r\n<div>\r\n<h3>Contact Us Today!</h3>\r\n</div>\r\n<p align="center"><a class="button" style="width:200px;font-weight:bold;" href="site_registration.php">Register your Crop Online</a></p>\r\n<p align="center">If you have any questions or would like to register your fruit tree over the phone, contact Emiily Garafolo: </b></p>\r\n<p align="center"><b>Email: <a href="mailto:EmilyG@piercecountycd.org">EmilyG@piercecountycd.org</a><br><br>Phone:253-278-6215</b></p>    \r\n'),
('farminfotxt', '<p style="text-align: left;" align="center">The Gleaning Project is a volunteer program of Harvest Pierce County and the Pierce Conservation District that reduces food waste by harvesting unsalable produce from local farms and residential fruit trees. The bounty is then donated to local food banks increasing access, availability, and awareness of healthy produce to underserved populations in Pierce County. The Gleaning Project continues to grow and is now looking to partner with more farms for the 2014 season.</p>\r\n\r\n<div>\r\n<h3>Benefits</h3>\r\n</div>\r\n<b>Our number one priority is to support local farmers and the Pierce County agricultural community</b>. We want our local farms to thrive and succeed by selling all produce - volunteers only step in to harvest or cull produce farmers cannot sell or use. Working with the Gleaning Project can <b>clear a field for an additional planting, harvest excess to allow for additional fruiting (as with squash and beans), or cut the amount of residual organic material tilled under. </b>Additionally,<b> all produce is donated into the emergency food system</b>. We know how hard farmers work, and we do our best to support our partners and make the donation process easy and mutually beneficial.\r\n<ul>\r\n	<li><b><i>Simplicity:</i></b> Gleaning volunteers can work with your schedule. Whether you need rejected produce culled, a whole pallet picked up, or multiple fields harvested with 30 volunteers, we will work with you to find the easiest way to remove your excess. The coordinator can check also check in via phone or email throughout the season at the farmer''s convenience.</li>\r\n</ul>\r\n<ul>\r\n	<li><b><i>No Liability:</i></b> Farmers that work with the Gleaning Project are not liable for potential damage from their crop or to volunteers. Produce donated through the Gleaning Project is covered by the <i>Emerson Good Samaritan Food Donation Act</i> and volunteers are covered by Pierce Conservation District insurance.</li>\r\n</ul>\r\n<ul>\r\n	<li><b><i>Public Outreach</i>: </b>We encourage volunteers and community members to support our partner farms. Hosting gleaning events on your farm strengthens community connections and visibility. Partners are also marketed at all gleaning events, in outreach materials, and news articles.</li>\r\n</ul>\r\n<ul>\r\n	<li><b><i>Get food to those in need</i></b>:  We donate all harvested and culled produce to the emergency food system. If a farmer is willing, we like to allow volunteers to take home one serving of produce each to taste what they harvested!   </del></ins></li>\r\n</ul>\r\n<ul>\r\n	<li><b><i>Tax Write Off</ins></i></b>: All farmers receive a donation receipt which can be used as a tax write off.</li>\r\n</ul>\r\n<div>\r\n<h3>Contact Us Today!</h3>\r\n</div>\r\n<p align="center">If you are interested in working with the Gleaning Project<b>, contact Matt Price (gleaning coordinator):</b></p>\r\n<p align="center"><b>Email: MattP@piercecountycd.org<br><br>Phone:253-282-8910</b></p>    \r\n<p align="center"><a class="button" style="width:200px;font-weight:bold;" href="http://firstharvest.org/crop_registration.php">Register your Crop Online</a></p>\r\n\r\n<b>Thank you to our Partner Farms:</b>\r\n\r\n<b><i>Duris Cucumber Farms, Filbert Acres, Little Eorthe, Mother Earth Farm, Picha Farms, Sanford Farm, Scholz Farm, Tahoma Farms, Terry''s Berries, and Zestful Gardens. </i></b>'),
('coveragetxt', '<h3>For Farmers and Homeowners</h3>\r\n <p>Harvest Pierce County''s Gleaning Project  unites farmers, health advocates, food providers, backyard gardeners and community volunteers together to harvest and donate produce gleanings into our local food system. </p>\r\n <p>We properly train, supervise and hold liability coverage for all volunteers who glean with us. </p>\r\n <p>The Federal Bill Emerson Good Samaritan Food Donation Act:  On October 1, 1996, President Clinton signed this act to encourage donation of food and grocery products to non-profit organizations for distribution to individuals in need. This law: </p>\r\n <div style="margin-left:2em"><p>- Protects you from liability when you donate to a non-profit organization; </p>\r\n <p>- Protects you from civil and criminal liability should the product donated in good faith later cause harm to the recipient; </p>\r\n <p>- Standardizes donor liability exposure. You or your legal counsel do not need to investigate liability laws in 50 states; and </p>\r\n <p>- Sets a floor of "gross negligence" or intentional misconduct for persons who donate grocery products.  According to the new law, gross negligence is defined as "voluntary and conscious conduct by a person with knowledge (at the time of conduct) that the conduct is likely to be harmful to the health or well-being of another person." </p>\r\n </div>\r\n <p>For more information:  <a class="button" style="width:150px; font-weight:bold;" href="http://feedingamerica.org">Feeding America</a></p>\r\n <p>Â </p>'),
('waivertxt', '<p>By checking off this agreement/liability waiver, I agree to indemnify and hold the landowners, Pierce Conservation District, Harvest Pierce County, its employees, other volunteers, and any other third party for whom I am performing volunteer services, harmless from and against any liability, claim, injury, or costs arising from or resulting from my work as a volunteer.  Furthermore, I acknowledge that there are potential hazards associated with Harvest Pierce County and I agree to exercise common sense and follow all safety precautions to avoid accident and injury.</p>');
