(256, 99, 320, 360, NULL, '2015-10-01', '09:30:00', NULL, 'option', '08:45:00', 5, NULL, 115, 115, 115, 2, 'No', 'EFN', 'This is a unique harvest opportunity. We will be harvesting at the Korean Women''s Association Orchard in Roy, WA. These a well cared for apple trees by orchard managers, Sok and Sun Dang. This orchard is a cooperation with the Emergency Food Network (EFN) in Lakewood, WA. EFN will help distribute the harvest bounty to food banks and shelters across the county. \r\n\r\nLunch will be provided, but if you are vegetarian or have gluten intolerance or other dietary needs, we suggest bringing a sack lunch. \r\n\r\nCarpooling available from the south end of Wright Park in Tacoma, by the lion statues, at 8:45am. \r\n\r\nIf you are driving yourself, please park by the storage unit that you will see after entering the property''s fenceline. \r\n\r\nSorry, no kids for this harvest. ', 'This is a unique harvest opportunity. We will be harvesting at the Korean Women''s Association Orchard in Roy, WA. These a well cared for apple trees by orchard managers, Sok and Sun Dang. This orchard is a cooperation with the Emergency Food Network (EFN) in Lakewood, WA. EFN will help distribute the harvest bounty to food banks and shelters across the county. \r\n\r\nLunch will be provided, but if you are vegetarian or have gluten intolerance or other dietary needs, we suggest bringing a sack lunch. \r\n\r\nCarpooling available from the south end of Wright Park in Tacoma, by the lion statues, a 8:45am. \r\n\r\nIf you are driving yourself, please park by the storage unit that you will see after entering the property''s fenceline. \r\n\r\nSorry, no kids for this harvest. ', 'Yes', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, 115, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
