(275, 210, 320, NULL, NULL, '2015-12-02', '13:30:00', '1.5', 'option', '00:00:00', 0, NULL, 1565, 1565, 1565, 4, 'No', 'Orting/Sumner Food Banks, Guadalupe, St.Leos', 'Come help us pick up pre-harvested potatoes and squash at Tahoma Farms! There will be pre-boxed potatoes to pack in the van, and we will also sort and pack squash into bins. Bring warm gloves for sorting and bags to take home a serving of food! We''ll have water and rubber work gloves available. ', NULL, 'No', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 64, 65, 88, 1500, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
(276, 99, 360, 320, NULL, '2016-02-27', '13:00:00', '4.0', 'option', '12:00:00', 5, NULL, 0, 0, NULL, 20, 'No', NULL, 'This is a unique opportunity to learn about orchard management, and to put newly learned fruit tree skills into practice. We will be winter pruning and setting up spaces for mason bees at the Korean Women''s Association Orchard in Roy, WA. \r\n\r\nThese apple trees are well cared for by orchard managers, Sok and Sun Dang, but are suffering problems due to the way they were originally planted years ago. Usually, this orchard produces 5,000lbs of fruit, but this year it only produced 115lbs. This is the first Work & Learn party in a series of four, and each will address a different piece of a comprehensive plan of getting this orchard back on track. This orchard is a cooperation with the Emergency Food Network (EFN) and the Korean Women''s Association (KWA). The fruit goes to support the low-income families living around the orchard, as well as EFN''s broader network of food banks.  \r\n\r\nCarpooling available from the south end of Wright Park in Tacoma, by the lion statues, at 12pm. We have about', 'This is a unique opportunity to learn about orchard management, and to put newly learned fruit tree skills into practice. We will be winter pruning and setting up spaces for mason bees at the Korean Women''s Association Orchard in Roy, WA. \r\n\r\nThese apple trees are well cared for by orchard managers, Sok and Sun Dang, but are suffering problems due to the way they were originally planted years ago. Usually, this orchard produces 5,000lbs of fruit, but this year it only produced 115lbs. This is the first Work & Learn party in a series of four, and each will address a different piece of a comprehensive plan of getting this orchard back on track. This orchard is a cooperation with the Emergency Food Network (EFN) and the Korean Women''s Association (KWA). The fruit goes to support the low-income families living around the orchard, as well as EFN''s broader network of food banks.  \r\n\r\nCarpooling available from the south end of Wright Park in Tacoma, by the lion statues, at 12pm. We have about seven spaces available in the Harvest Pierce County van, so please specify if you need a ride. If you prefer to drive yourself and have space in your car, please consider selecting to offer a space for another volunteer to ride with you as you register. \r\n\r\nIf you are driving yourself, please park by the storage unit that you will see after entering the property''s fenceline. \r\n\r\nBe sure to bring water and snacks for yourself, if you need. ', 'Yes', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 45, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
(277, 63, 360, 320, NULL, '2016-03-10', '10:00:00', '3.0', 'none', '00:00:00', 0, NULL, 0, 0, NULL, 4, 'No', NULL, 'The Hilltop House Orchard is a teaching orchard; there is a small stand of apple, pear, and plum trees that need winter pruning. Though there will be some guidance, this is not led by an arborist. We will supply tools, but feel free to bring your own if you have them. \r\nThis orchard is so close to our Harvest Pierce County office, there will be no carpool offered.', NULL, 'Yes', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 45, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
