(281, 116, 320, NULL, NULL, '2016-03-15', '09:30:00', '3.0', 'none', '00:00:00', 0, NULL, 1450, 1450, 1450, 12, 'No', 'Rescue Mission/St.Leos', 'Join us for the first farm glean of 2016 at Wild Hare Farm! We''ll be out in the fields digging parsnips, so come prepared with footwear and clothing that will keep you warm and dry. We have extra pairs of gloves, but if you have your own pair please bring them with you. Please note that gloves are particularly important for this harvest because handling the stems and foliage of parsnips can  cause a skin rash for some people if the skin is exposed to sunlight after handling.There are at least a thousand pounds of parsnips available and the plan is to harvest as many as we can to share with the emergency food system. Bring bags to take a portion home for your family!', NULL, 'Yes', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 89, 1450, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
(279, 266, 360, 371, NULL, '2016-03-20', '13:00:00', '3.0', 'option', '12:30:00', 5, NULL, 0, 0, NULL, 15, 'No', NULL, 'The Swan Creek Park Food Forest is a 1-acre forest garden next to Tacoma''s Salishan neighborhood, nestled in Swan Creek Park. We will be pruning apple trees both young and old. If you have tools you like to use, please bring them! Otherwise we will be able to supply hand tools and loppers. See you there! ', 'Call 253.278.4820 if you have any trouble finding the forest. ', 'No', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 45, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
(282, 99, 360, NULL, NULL, '2016-03-19', '14:00:00', '3.0', 'option', '13:00:00', 5, NULL, 0, 0, NULL, 20, 'No', NULL, 'This is a unique opportunity to learn about orchard management, and to put newly learned fruit tree skills into practice. We will be practicing the pruning skills we learned last time by finishing up our winter pruning, as well as setting up spaces for mason bees including mason bee houses, flowering plants for them to feed on, and mud troughs for them to build nests with.  \r\n\r\nSite history: These apple trees are well cared for by orchard managers, Sok and Sun Dang, but are suffering problems due to the way they were originally planted years ago. Usually, this orchard produces 5,000lbs of fruit, but this year it only produced 115lbs. This is the first Work & Learn party in a series of four, and each will address a different piece of a comprehensive plan of getting this orchard back on track. This orchard is a cooperation with the Emergency Food Network (EFN) and the Korean Women''s Association (KWA). The fruit goes to support the low-income families living around the orchard, as well as', 'This is a unique opportunity to learn about orchard management, and to put newly learned fruit tree skills into practice. We will be practicing the pruning skills we learned last time by finishing up our winter pruning, as well as setting up spaces for mason bees including mason bee houses, flowering plants for them to feed on, and mud troughs for them to build nests with.  \r\n\r\nThese apple trees are well cared for by orchard managers, Sok and Sun Dang, but are suffering problems due to the way they were originally planted years ago. Usually, this orchard produces 5,000lbs of fruit, but this year it only produced 115lbs. This is the first Work & Learn party in a series of four, and each will address a different piece of a comprehensive plan of getting this orchard back on track. This orchard is a cooperation with the Emergency Food Network (EFN) and the Korean Women''s Association (KWA). The fruit goes to support the low-income families living around the orchard, as well as EFN''s broader network of food banks.  \r\n\r\nCarpooling available from the south end of Wright Park in Tacoma, by the lion statues, at 1pm. \r\nIf you are driving yourself, please park by the storage unit that you will see after entering the property''s fenceline. \r\n', 'Yes', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 45, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
