(285, 99, 360, NULL, NULL, '2016-05-14', '10:00:00', '3.0', 'option', '09:00:00', 5, NULL, 0, 0, NULL, 20, 'No', NULL, 'This is a unique opportunity to learn about orchard management, and to put newly learned fruit tree skills into practice. We will be checking up on the 7 trees we planted during the last work party, looking and new growth since we last pruned, and working on pest prevention.   \r\n\r\nSite history: These apple trees are well cared for by orchard managers, Sok and Sun Dang, but are suffering problems due to the way they were originally planted years ago. Usually, this orchard produces 5,000lbs of fruit, but this year it only produced 115lbs. This is the first Work & Learn party in a series of four, and each will address a different piece of a comprehensive plan of getting this orchard back on track. This orchard is a cooperation with the Emergency Food Network (EFN) and the Korean Women''s Association (KWA). The fruit goes to support the low-income families living around the orchard, as well as', 'This is a unique opportunity to learn about orchard management, and to put newly learned fruit tree skills into practice. We will be checking up on the 7 trees we planted during the last work party, looking and new growth since we last pruned, and working on pest prevention.  \r\n\r\nThese apple trees are well cared for by orchard managers, Sok and Sun Dang, but are suffering problems due to the way they were originally planted years ago. Usually, this orchard produces 5,000lbs of fruit, but this year it only produced 115lbs. This is the first Work & Learn party in a series of four, and each will address a different piece of a comprehensive plan of getting this orchard back on track. This orchard is a cooperation with the Emergency Food Network (EFN) and the Korean Women''s Association (KWA). The fruit goes to support the low-income families living around the orchard, as well as EFN''s broader network of food banks.  \r\n\r\nCarpooling available from the south end of Wright Park in Tacoma, by the lion statues, at 9am. \r\nIf you are driving yourself, please park by the storage unit that you will see after entering the property''s fenceline. \r\n', 'Yes', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 45, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
(286, 273, 305, NULL, NULL, '2016-06-15', '15:00:00', '2.0', 'none', '00:00:00', 0, NULL, 15, 15, 15, 6, 'No', 'Center for Food Preservation Arts', 'This cherry tree in the Eastside of Tacoma is ready to be picked and so we are scheduling a harvest a bit more last minute that we usually like to. Fruit is coming on early this year! If you can make it and have a vehicle that can fit it, please consider bringing an extra ladder. We''ll pick what is ripe and folks will be invited to take home a portion of the harvest. ', NULL, 'Yes', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 29, 15, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
(287, 272, 360, NULL, NULL, '2016-06-22', '12:00:00', '2.0', 'option', '11:30:00', 5, NULL, 40, 40, 40, 5, 'No', 'New Phoebe House, Hope Home', 'This is a practice glean for those interested in becoming a Harvest Leader this season. We will walk through the steps of gleaning a cherry tree, deliver the fruit to a food bank, then enter the harvest information on the computer together afterward. ', NULL, 'No', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 29, 40, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
(416, 202, 320, NULL, NULL, '2016-10-03', '09:00:00', '3.0', 'option', '08:00:00', 5, NULL, 894, 894, 894, 20, 'No', 'St.Leo''s Food Connection', 'There were more green beans than we could pick on one harvest so this is Round 2! Scholz  Farm in Puyallup has a bumper crop of green beans and we have been invited to glean what we can from 8 rows. This will be a great donation into the emergency food system, and volunteers will get to take home a portion as well, so bring some bags with you to collect your share! It is predicted to be a warm, sunny morning so dress accordingly and bring a water bottle. We''ll be out in a field picking so boots or sturdy shoes are recommended.', 'If you need to carpool please note that our meet up spot is in front of the Wright Park lion statues on 6th/S.Yakima. There are 3 spots in the staff vehicle and you will need to arrive by 8am sharp to carpool with staff to Scholz Farm. If all three spaces are filled but there are additional drivers available, the Harvest Leader will connect you by email so that you can coordinate a ride.\r\n\r\nPlease put the following address in your GPS: 14310 128th Street East, Puyallup, WA 98374. You will see the Scholz Farm sign on your left as you approach the driveway to address above, as well as a wooden Harvest Pierce County sign in front of the driveway. Pull in and park by the barn in the back. We will gather nearby and then head to the field where the green beans are. Please aim to arrive on time and stay for the duration of the harvest. If you are late to the event or need to leave early, you will need to contact Mason (253-468-3749) to let them know. This is to ensure that we have enough pickers to get the glean done! Thanks for understanding.', 'Yes', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 37, 894, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
(289, 16, 360, NULL, NULL, '2016-07-09', '09:00:00', '3.0', 'none', '00:00:00', 0, NULL, 40, 40, 40, 10, 'No', 'Village Keepers', 'We will be working and learning how to better care for our fruit trees during the summer with corrective pruning. This will be under the guidance of Master Arborist Pamela Draper. Bring tools if you have them; tools will be provided if you don''t. We also recommend bringing water, gloves, and sunglasses or goggles to prevent getting debris in your eyes while we prune! ', NULL, 'Yes', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 45, 40, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
(290, 277, 68, NULL, NULL, '2016-06-27', '10:00:00', '2.0', 'option', '09:30:00', 5, NULL, 15, 15, 15, 3, 'No', NULL, 'This is a green apple tree in East Tacoma that is bursting with fruit. For the pickers: Please note that some may be too small to harvest, but given the apple variety, we know that if we don''t catch the bigger, ripe apples we may miss the opportunity to get fruit from this tree. We will likely donate half the harvest to the mobile food bank at the Bethlehem Lutheran Church and harvesters should bring bags if they would like to take home a portion of the harvest.', 'There is a carpool option for this harvest, and 3 seats are available in our vehicle. Please meet at the lion statues in front of Wright Park in Tacoma to carpool.', 'No', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, 15, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0);
