(322, 34, 320, NULL, NULL, '2016-08-02', '09:00:00', '3.0', 'option', '08:30:00', 5, NULL, 326, 326, 326, 8, 'No', 'KWA/Family Resource Center/Hope Home/New Pheobe ', 'Come check out Early Bird Farm, a beautiful farm right outside Tacoma. We''ll be gleaning beets, chard, and green beans. Bring plenty of water and sunscreen since we will be out at the farm harvesting for a few hours. Please bring your own bags if you would like to take home a portion of the harvest.\r\n\r\nThough for farm gleans we donate nearly all of the harvest to the food banks, volunteers can take home 1-2 family-sized serving.\r\n\r\nIf you wish to carpool, meet at the lion statues on the south side of Wright Park in Tacoma at 9am.\r\n\r\nIf you choose to drive yourself, please park next to the red barn at Early Bird Farm. \r\n\r\nBe sure and bring some rags to help wash off the beets after they are harvested!', 'For farm gleans we donate nearly all of the harvest to the food banks, volunteers can take home 1-2 family-sized serving.\r\n\r\nIf you wish to carpool, meet at the lion statues on the south side of Wright Park in Tacoma at 9am.\r\n\r\nIf you choose to drive yourself, please park next to the red barn at Early Bird Farm. \r\n\r\nBe sure and bring some rags to help wash off the beets after they are harvested!', 'Yes', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 77, 80, 93, 96, 37, 150, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
