(331, 116, 320, NULL, NULL, '2016-08-01', '14:00:00', '1.0', 'none', '00:00:00', 0, NULL, 350, 350, 350, 0, 'No', 'Eatonville/Village Keepers/', 'Join us for the first farm glean of 2016 at Wild Hare Farm! We''ll be out in the fields digging parsnips, so come prepared with footwear and clothing that will keep you warm and dry. We have extra pairs of gloves, but if you have your own pair please bring them with you. Please note that gloves are particularly important for this harvest because handling the stems and foliage of parsnips can  cause a skin rash for some people if the skin is exposed to sunlight after handling.There are at least a thousand pounds of parsnips available and the plan is to harvest as many as we can to share with the emergency food system. Bring bags to take a portion home for your family!', NULL, 'Yes', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 79, 350, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
