(413, 99, 360, NULL, NULL, '2016-10-01', '13:00:00', '2.0', 'option', '12:00:00', 5, NULL, 6325, 6325, 6325, 20, 'No', 'Emergency Food Network', 'This is a unique harvest opportunity. We will be harvesting at the Korean Women''s Association Orchard in Roy, WA. These a well cared for apple trees by orchard manager Simon Lee. This orchard is a cooperation with the Emergency Food Network (EFN) in Lakewood, WA. EFN will help distribute the harvest bounty to food banks and shelters across the county. Snacks and hot cider will be provided, but if you are vegetarian or have gluten intolerance or other dietary needs, we suggest bringing a sack lunch. Carpooling available from the south end of Wright Park in Tacoma, by the lion statues, at 12pm. If you are driving yourself, please park by the storage unit that you will see after entering the property''s fenceline. \r\n\r\nSite history: These apple trees are well cared for by orchard managers, Simon Lee, but are suffering problems due to the way they were originally planted years ago. This orchard is a cooperation with the Emergency Food Network (EFN) and the Korean Women''s Association (KWA). T', 'Thank you for volunteering for this gleaning project!\r\n\r\nCarpool option with the Harvest Leader is available for 3 seats. If these spots fill up, your Harvest Leader will contact you if there is room in another volunteer''s vehicle.If you indicate that you need to carpool, please meet by the lions statues on the 6th avenue side of Wright Park.', 'Yes', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, 6325, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
