(440, 216, 320, NULL, NULL, '2016-11-04', '09:00:00', '3.0', 'none', '00:00:00', 0, NULL, 0, 0, 0, 10, 'No', NULL, '*THIS WAS A WORK PARTY EVENT AND THEREFORE TOTAL POUNDS WERE NOT RECORDED*Greetings gleaners! The Veggie Co-op farm is currently experiencing a drop off in volunteer support and so we are calling in some reinforcements to help put the farm to bed! At the end of the work party you will be able to take home a share of produce from the farm.\r\n\r\nWhat to expect: We will have a work party rain or shine and perform a mixture of activities on the farm including pulling weeds, plants and harvesting produce.\r\n\r\nWhat to bring: Water bottle, clothing layers, and shoes that you don''t mind getting muddy!', 'There is no carpool option for this event. Please meet us at the FPSD Farm (Veggie Co-op) at 9516 Waller Road E, Tacoma, WA, 98446 at 9am for the start of the work party. There is ample parking onsite or on Waller Rd E. The work party will go until 12 noon and each volunteer will receive the following in their produce share: collards, kale, tomatoes, peppers, corn, tomatillos, greens mix,\r\nlettuce mix, beets, chard, carrots, cilantro, broccoli, winter squash.\r\n', 'No', 'closed', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 44, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
(441, 34, 320, NULL, NULL, '2016-11-09', '13:00:00', '3.0', 'option', '12:30:00', 5, NULL, 411, 411, 411, 8, 'No', 'St. Leo''s Food Connection', 'Early Bird Farm has invited us to glean carrots from their fields. We will glean storage varieties that will last for a few months in storage and will be an incredible donation to the emergency food system. Others are fresh harvest varieties that have a 1-2 week shelf life. Volunteers will help pick and wash the carrots, and should anticipate getting a little bit muddy on the farm, so dress appropriately! Bring your own bags if you would like to take home a portion of the harvest.\r\n\r\n', 'If you wish to carpool, meet at the lion statues on the south side of Wright Park in Tacoma at 12:30pm. If you are carpooling with staff you will be asked to help with dropping off donations before returning to Wright Park.\r\n\r\nIf you choose to drive yourself, please park on the grass on the side of the road in front of the farm, or if these spaces are full, by the red barn beyond the driveway.\r\n', 'Yes', 'closed', NULL, NULL, 'No', NULL, 'Field', NULL, NULL, NULL, NULL, NULL, NULL, 28, 407, 89, 4, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0),
