(445, 392, 502, NULL, NULL, '2016-12-16', '13:00:00', '2.0', 'option', '12:30:00', 5, NULL, 0, 0, NULL, 5, 'No', NULL, 'Come glean persimmon fruit from a tree at a site near University Place! There are only about 100 or so persimmons on this tree and so be aware that this will be a shorter harvest event. We will donate a portion of the fruit but also bring your own bags to bring some home. We''ll keep an eye on the weather in case of snow but in order to catch this fruit we will likely pick rain or shine--so come prepared with warm clothes and perhaps a hot drink to sip on!', 'There is a carpool option available for this harvest and there are 2 open seats in the staff vehicle. Please meet us at the lion statues in front of Wright Park on 6th Ave at 12:30pm to carpool.', 'No', 'open', NULL, NULL, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 49, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, 0);
