(119, 113, 4, NULL, NULL, 4, '2014-10-22', '14:00:00', '3 hours', 1800, 1800, 15, 'No', '0000-00-00', 'Rescue Mission, ST. Leos', 'We are harvesting sweet corn from Picha Farms again this year. The field is located on 50th Ave E/Gloyd Weyat Road (off River Road). Please park on the side of the road, however parking is limited - carpool when possible! Volunteers will get to take a portion home as well!\r\n<p>\r\n<b>Carpool</b>: From St. Leos Food Connection (1323 Yakima Ave) Parking Lot at 1:40pm', NULL, 'No', 'closed', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'No', NULL),
