(121, 116, 4, NULL, NULL, 4, '2014-11-05', '10:00:00', '3 hours', 3600, 3600, 16, 'No', '0000-00-00', 'Rescue Mission, St. Leos, Puyallup Food Bank, ', 'Join us for a super fun fall harvest of Spaghetti Squash and Pumpkins at Terry''s Berries! Please note - the harvest will begin at a site outside of downtown Puyallup, not on the main farm-site. Address and directions will be emailed soon! Please call Matt at 253-272-6215 if you have any questions!', 'Join us for a super fun Fall harvest of Spaghetti Squash and Pumpkins at Terry''s Berries. Please note - the harvest will begin at a site outside of downtown Puyallup, not on the main farm-site. Address and directions will be emailed soon!', 'No', 'closed', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'No', NULL),
(122, 117, 51, NULL, NULL, 51, '2014-11-18', '10:00:00', '2 hours', 150, 200, 4, 'No', '0000-00-00', 'International House- Salishan/KWA', 'This is our first and last Persimmon harvest of the season! Please bring bags if you would like to take fruit home. Carpooling available from Harvest Pierce County office in Wright Park (501 S.I Street) leaving at 9:40 am. Please meet in front of the brick building in the South end of the pakr.', NULL, 'Yes', 'closed', '2014-11-18', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'No', NULL),
(123, 118, 4, NULL, NULL, NULL, '2014-12-18', '10:00:00', '3 hours', NULL, NULL, 10, 'No', '0000-00-00', NULL, 'Join us for one last harvest of 2014! We will be harvesting Sunchokes/Jerusalem Artichokes from Four Elements Farm in Orting!\r\n\r\nWe will carpool from St. Leos Food Connection (1323 Yakima Ave) in Tacoma, leaving at 9:25. Please bring rain gear and extra strudy shoes!', 'Join us for one last harvest of 2014! We will be harvesting Sunchokes/Jerusalem Artichokes from Four Elements Farm in Orting!\r\n\r\n<b>Carpool/b>: We will carpool from St. Leos Food Connection (1323 Yakima Ave) in Tacoma, leaving at 9:25. Please bring rain gear and extra sturdy shoes!', 'No', 'closed', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'No', NULL);
