(164, 'Manza', NULL, NULL, 'Pears &amp; Cherries', NULL, 'owner', NULL, NULL, 'No', '01-01', 'No', NULL, 'No', NULL, 'Pat Manza', '253-882-6963', 'pjmanza@harbornet.com', NULL, NULL, NULL, NULL, NULL, NULL, '1526 S. Ventura Dr.', 'Tacoma', 'WA', '98465', '1526 S. Ventura Dr.', 'Tacoma', 'WA', '98465', NULL, ' ', NULL, '47.2457', '-122.5419', NULL, NULL, 'Yes', '2015-07-08'),
(4, 'Munoz', 'Backyard', NULL, 'Pears', '1 tree', 'owner', NULL, '10', NULL, '08-24', 'Yes', 'It has dark spots', 'No', NULL, 'Annette Munoz', '253-905-7747', 'Queenanne9@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '3344 N Shirley St', 'Tacoma', 'WA', '98407', '3344 N Shirley St', 'Tacoma', 'WA', '98407', NULL, 'Newspaper', 'The pears may not be pretty, but they make great pear sauce (like apple sauce).  Tree is in the back part of the backyard (west) by the wood fence.  Enter at chainlink fence, gate to left of garage; driveway is on Shirley St. \r\n\r\nI also will have 6 nice lettuce plants and 6 Tuscan kale plants (organic grown) to harvest from the rsised bed, by June 15!', '47.2795', '-122.5109', 'Backyard', NULL, 'Yes', '2014-05-29'),
(5, 'Little', NULL, 'Sumner/Orting', 'Mixed crops', NULL, 'owner', NULL, NULL, NULL, '08-20', 'No', NULL, 'No', NULL, 'Canyon Little', NULL, 'canyon.little@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '15208 102nd St E', 'Puyallup', 'WA', '98374', '15208 102nd St E', 'Puyallup', 'WA', '98374', NULL, ' ', 'You can pull over and park next to the red barn.', '47.1633', '-122.2277', NULL, NULL, 'Yes', '2014-06-02'),
(6, 'Boice', 'Back/side yard', 'North End Tacoma', 'Cherries, Plums', '1', 'owner', NULL, '0', 'Yes', '06-26', 'No', NULL, 'No', NULL, 'Angi Boice', '206-550-0358', 'wallenar@hotmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '3324 N 19th Street', 'Tacoma', 'WA', '98406', '3324 N 19th Street', 'Tacoma', 'WA', '98406', NULL, NULL, 'Dogs but will be kept inside. Very beautiful tree', '47.2661', '-122.4808', 'Backyard', NULL, 'Yes', '2014-06-24'),
(7, 'Appleseed', 'Backyard', 'South Tacoma', 'Apple Tree', '2', 'owner', NULL, '15', 'Yes', '07-28', 'No', NULL, 'No', NULL, 'Johnny Appleseed', '253-253-2532', 'jonny.appleseed@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '123 Cherry Lane', 'Tacoma', 'WA', '98405', '123 Cherry Lane', 'Tacoma', 'WA', '98405', NULL, 'Friend', 'Dogs on property', '0.0000', '0.0000', 'Backyard', NULL, 'Yes', '2014-06-24'),
(8, 'Calchina', 'Backyard ', NULL, 'Cherries', '3 trees', 'owner', NULL, '40', NULL, '07-6', 'No', NULL, 'No', NULL, 'Darcy Calchina', '541-561-5928', 'calchina01@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '10524 40th Avenue East', 'Tacoma', 'WA', '98446', '10524 40th Avenue East', 'Tacoma', 'WA', '98446', NULL, 'Friend', '3 tall trees, bring as many 8ft ladders as there are people. A little under-ripe, but good quality Rainier and pie cherries. Not a ton this year, would like updates on Fruit Tree Stewards. ', '47.1600', '-122.3764', 'Backyard', NULL, 'Yes', '2014-06-25'),
(10, 'Garnett', 'back yard ', 'North End Tacoma', 'Cherries', '1 tree', 'owner', NULL, '30', NULL, '06-27', 'No', 'none', 'No', NULL, 'Julia Garnett', '253.753.6394', 'julia.garnett@comcast.net', NULL, NULL, NULL, NULL, NULL, NULL, '2618 N Puget Sound Ave', 'Tacoma', 'WA', '98407', '2618 N Puget Sound Ave', 'Tacoma', 'WA', '98407', NULL, 'Other', 'Very abundant tree, 3-4 people a good number to harvest. Small backyard with slightly challenging ladder placement. Bring 3 of the tallest orchard ladders. Fruit was a little overripe, but ripe date is now updated.', '47.2717', '-122.4830', 'Backyard', NULL, 'Yes', '2014-06-30'),
(9, 'Eugenio', 'backyard', NULL, 'Cherries ', '1 big tree', 'owner', NULL, '8', NULL, '07-03', 'No', NULL, 'No', NULL, 'Anne Eugenio', '2535073461', 'eugenio_anne@yahoo.com', NULL, '2535073461', NULL, NULL, NULL, NULL, '10923 130th St Ct E', 'Puyallup', 'WA', '98374', '10923 130th St Ct E', 'Puyallup', 'WA', '98374', NULL, 'Other', 'We have dogs, so keep the gates closed!', '47.1379', '-122.2826', 'Backyard', NULL, 'Yes', '2014-06-26'),
