(27, 'Miller', 'side yard ', 'East Tacoma', 'Transparent Apple', '2 trees', 'owner', NULL, '30', 'Yes', '07-29', 'No', NULL, 'No', NULL, 'Katherine Miller', '2532736393', 'katmillertacoma@comcast.net', NULL, '4253138298', NULL, NULL, NULL, NULL, '9702 40th avenue east', 'tacoma', 'wa', '98446', '9702 40th avenue east', 'tacoma', 'WA', '98446', NULL, 'Friend', 'Facing house the trees are on the left side of the house visible from the street. Transparent is ripe now judging by the number on the ground. The other tree is a different variety but I think it is ripe now too.  Transparent tree is probably 16 20 feet tall and the other tree is double that size.   ', '47.1688', '-122.3764', 'Backyard', NULL, 'Yes', '2014-07-17'),
