(107, 'Wynne', 'backyard', NULL, 'cherries, peaches', '4 trees', 'owner', NULL, '7', NULL, '08-03', 'No', NULL, 'No', NULL, 'Steve Wynne', '2535350691', 'swynne1366@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '2319 156th St Ct E', 'Tacoma', 'WA', '98445', '2319 156th St Ct E', 'Tacoma', 'WA', '98445', NULL, 'Other', 'The trees were on the property before we purchased and we are not well versed in how to care for them.  I am interested in learning how to best maintain them and identify/resolve any issues the trees.  Our cherry and peach trees had a great crop this summer and we did have a bit more than we needed.  With proper care I imagine the yields would have been great enough to allow us to donate too.', '47.1149', '-122.3974', 'Backyard', NULL, 'Yes', '2014-09-26'),
