(235, 'Anderson', '1.5 acres', 'East Tacoma', 'Grafted apples, pears, kiwi (nov), Plums, Fig, Peach, Cherry, ', '71 trees total', 'owner', NULL, '10-15ft for all', 'No', '01-01', 'No', 'Just some worms', 'No', NULL, 'Bret', '253-625-1037', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '5410 44th Ave E', 'Tacoma', 'WA', '98443', '5410 44th Ave E', 'Tacoma', 'WA', '98443', NULL, 'Web search', 'This is essentially a mini-orchard on .25 acre of land. An official tree count needs to be taken, but there are many apple trees that are bearing fruit as well as smaller grafted trees. The majority of trees are apple,but there is also 1 Asian Pear, 1 Cherry, 1 Peach, 2 Italian Plum, 2 Fig, Hearty Kiwis, concord grapes, and a huge Kiwi ''tree'' that is ready after the first frost. This property was inherited by two brothers in June 2015 after their father, a former member of the Western Cascade Fruit Society, passed away. The trees planted by their Grandfather are on the adjacent property and the neighbors would need to give permission. They are committed to keeping the orchard healthy and want to be involved in other ways such as with our education program. Warning: Beware of dog poop in the front of the orchard!\r\nThe Andersons own and are willing for harvested to use 4 ladders. ', '47.2087', '-122.3722', 'Backyard', NULL, 'Yes', '2015-08-17');
