(337, 'Delong Elementary School- Tacoma', 'in school garden', NULL, 'carrots, onions, basil, tomatoes, green and yellow beans, trombino summer squash, peppers, eggplant, kale', '30-60 pounds', 'other', NULL, NULL, 'Yes', '08-01', 'No', NULL, 'No', NULL, 'Emily Bosh And Danielle Harrington (alternative Number)', '253-459-4049', 'emilybosh@yahoo.com ', NULL, '253-798-3256', NULL, NULL, NULL, NULL, '4901 S 14th St', 'Tacoma', 'WA', '98405', '4901 S 14th St', 'Tacoma', 'WA', '98405', NULL, 'Friend', 'The garden is on the S. 12th Street side of the school by the track.  If you contact Emily Bosh or Danielle Harrington, we have a key to let gleaners into the fenced in track area where the garden resides.  Emily is a Delong parent overseeing the watering of the garden.  There is easily enough food to harvest once a week until September.  A harvest occurred today (8/12) and 50 lbs was brought to St. Leos.  The produce needs to go to St. Leo''s per the TSD contract. It cannot go to any other food bank.  There may be one other school garden (Edison) that can also be gleaned (tomatoes and peppers).  Danielle will be checking this school next week.', '47.2492', '-122.5020', 'Pickup', NULL, 'Yes', '2016-08-12'),
