(480, 'Masaryk', 'side yard', NULL, 'oranges', '1 tree', 'landlord', NULL, 'No', NULL, NULL, NULL, NULL, '09-02', 'No', NULL, 'No', NULL, 'Becky Masaryk', '(805) 459-9408', 'beckslo@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '5430 Fresno', 'Atascadero', 'CA', '93422', '320 Luneta Drive', 'San Luis Obispo', 'CA', '93405', NULL, ' ', 'Becky is the homeowner of this property where Carolyn and Andy gleaned in June 2013.  Becky lives in Atascadero and is the owner of the property and rents out the home to tenants.  She has okay-ed for us to pick the fruit from the Valencia orange tree whenever it is ripe.  Be sure to knock on the tenant''s door to let them know who we are and what we''re doing.  ', '35.2916', '-120.6791', 'Backyard', NULL, 'Yes'),
