(273, 'Cavaletto Ranch', NULL, 'Nipomo', 'citrus', NULL, 'owner', ' ', 'Yes', 'Cavaletto Ranch', NULL, '10', '1', '10-25', 'No', NULL, 'Yes', NULL, 'Mike & Mary Lou Cavaletto Ranch', '805-471-3689', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '902 N. Thompson Ave.', 'Nipomo', 'CA', '93444', '902 N. Thompson Ave.', 'Nipomo', 'CA', '93444', NULL, ' ', 'GleanSLO has a connection with Mike & Mary Lou Cavaletto through their grandson, Jack Moore, who attended MCP.  In the winter of 2012, he asked his grandparents if they would allow a group of MCP student volunteers to come out for a glean.  In 2013 we had 2 gleans: one in May with MCP students and one in June with community volunteers.  \r\n\r\nJeanine has spoken with Laurie Moore, Mike''s daughter/Jack''s mom, to coordinate the gleans.  Her cell number is 805-235-4469.  She usually checks in with Mike to make sure the proposed date and time works with his crew''s schedule.', '35.0634', '-120.4984', 'Farm', NULL, 'Yes'),
(274, 'Creekside Farms', NULL, NULL, 'apples', NULL, 'owner', ' ', 'No', NULL, NULL, NULL, NULL, '11-25', 'No', NULL, 'No', NULL, 'Edward & Donna Creekside Farms', '235-5812', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1691 See Canyon Road', 'San Luis Obispo', 'CA', '93405', '1691 See Canyon Road', 'San Luis Obispo', 'CA', '93405', NULL, ' ', 'Edward and Donna Evenson are the owners. Gate code for the property is 2775. There is a very narrow bridge at the entrance to the property. Small box truck is ideal. Check in with owners before at the carport farm stand before beginning to pick.', '35.2085', '-120.7131', 'Farm', NULL, 'Yes'),
