(282, 'Ocean Front Farms', NULL, NULL, 'brussel sprouts', NULL, 'owner', ' ', NULL, NULL, NULL, NULL, NULL, '01-01', 'No', NULL, 'No', NULL, 'Jayme Gamble Ocean Front Farms', '805-896-6712', 'jayme.offllc@gmail.com', NULL, '805-343-7855', NULL, NULL, NULL, NULL, 'P.O. Box 267', 'Guadalupe', 'CA', '93434', '2170 Thornberry Place', 'Guadalupe', 'CA', NULL, NULL, ' ', 'Notes from Phil Henry who introduced Carolyn and Jeanine to Jayme: His name is Jayme Gamble, he is the owner of Ocean Front Farms, and is one of the principals of Beachside Produce Company. He drives a brown colored Chevrolet Crew Cab pickup truck. (Mud colored this morning)  His cell phone is (805) 896-6712, and his office number is 343-7855.\r\n\r\nPhil''s notes with directions: From the cemetery at Highway One and Main Street it is 2.2 miles to the "Bruss. Sprout Field" which is adjacent to the road.  You''ll notice that after you have gone past all of the homes and the park on the North side of Main Street you will have made a turn to the right, then a turn to the left, then you will surely see the house set back (about 0.3 mile) along the farm road going off of Main Street. ', '34.9757', '-120.5918', 'Farm', NULL, 'Yes'),
(283, 'Hisasue', NULL, 'Los Osos', 'apples', NULL, 'owner', ' ', 'No', NULL, NULL, NULL, NULL, '10-10', 'No', NULL, 'No', NULL, 'Carole Hisasue', NULL, 'hisasuemail@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '2837 Clark Valley Road', 'Los Osos', 'CA', '93402', '2837 Clark Valley Road', 'Los Osos', 'CA', '93402', NULL, ' ', 'Carole (Karou) Hisasue', '35.2883', '-120.8052', 'Backyard', NULL, 'Yes'),
(284, 'Johnson', NULL, NULL, 'oranges', NULL, 'owner', ' ', NULL, NULL, NULL, NULL, NULL, '10-23', 'No', NULL, 'No', NULL, 'Deborah & Douglas Johnson', '(805) 440-9444', 'deborahlee1978@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '326 Helroy Road', 'Arroyo Grande', 'CA', '93420', '326 Helroy Road', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'Valencia oranges, lemons, plums \r\n\r\nDirections from Debbie: Los Berros to Pomeroy. Proceed about 2 miles after the big left turn (15mph). Then it''s another 1/4 mile on the left hand side and turn.\r\n326 Helroy Rd.  Our property is on the right hand side.  When you see lemon trees stop.  This first gate we would like the gleaners to use.  We will try to have a sign on the fence so you will know. (NOTES FROM Carolyn: for the first glean, we used the first gate, for the subsequent gleans, she let us go through her main gate. There is a barn on the property and we had gleaners park to the right of the barn in the open field. ', '35.0683', '-120.5352', 'Backyard', NULL, 'Yes'),
