(286, 'Frederick- Clamshell Farms', NULL, 'Nipomo', 'citrus', '8 acres', 'owner', ' ', NULL, NULL, NULL, '15', '2', '02-18', 'No', NULL, 'Yes', NULL, 'Gary and Jacqueline Frederick- Clamshell Farms', '(805) 264-1302', 'jvflaw@aol.com', NULL, '(805) 264-1303', NULL, NULL, NULL, NULL, '650 Clamshell Mountain Way', 'Nipomo', 'CA', '93444', 'Grade Mountain Way', 'Nipomo', 'CA', '93444', NULL, 'Friend', 'Jacqueline''s phone number is listed second\r\n\r\nthere are many months of different kinds of citrus, February through June.  This contact was originally brought to us through Phil Henry. Rob Coghill, former Oceano warehouse manager and Carolyn Eicher made a site visit in 2011.', '35.0630', '-120.4599', 'Farm', NULL, 'Yes'),
(287, 'Hearst Castle', NULL, NULL, 'oranges', '120 trees', 'owner', ' ', 'Yes', ' Hearst Castle', NULL, NULL, NULL, '11-19', 'No', NULL, 'No', NULL, 'Hearst Castle', '(805) 927-2090', 'ctakahashi@hearstcastle.com', NULL, '(805) 712-4833', NULL, NULL, NULL, NULL, '750 Hearst Castle Road, Attn: Grounds Dept', 'San Simeon', 'CA', '94352', '750 Hearst Castle Rd', 'San Simeon', 'CA', NULL, NULL, NULL, 'As of Dec 2014: When picking up...a driver should pull in the main entrance past the museum into the adminstration office parking lot. Call Jeremiah (805-712-4833) once upon arrival and he will meet the driver to show them where to go.  \r\n\r\nmailing address and for reports, send to:\r\nHearst Castle\r\nAttn. Grounds Dept.\r\n750 Hearst Castle Rd.\r\nSan Simeon, CA. 94352\r\n \r\nChristine Takahashi\r\nSupervising Groundskeeper II\r\n(2012) Christine Takahashi is the Supervisor Groundskeeper. She is our main contact there.\r\nHearst Castle\r\nCalifornia State Parks\r\nctakahashi@hearstcastle.com\r\n(805) 927-2090\r\n(805) 927-2019 (fax)\r\n(805) 712-4826 (cell)', '35.6855', '-121.1688', 'Pickup', NULL, 'Yes'),
