(289, 'Trapp', 'back and side yard', NULL, 'citrus', '3 trees', 'owner', NULL, 'Yes', 'Molly Trapp', 'Yes', '20', '6', '03-08', 'No', NULL, 'No', NULL, 'Molly Trapp', '805-458-4391', 'mollytrapp@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '1637 Southwood Dr.', 'San Luis Obispo', 'CA', '93401', '1637 Southwood Dr.', 'San Luis Obispo', 'CA', '93401', NULL, 'Neighbor', '2014 Update for city-wide fruit drive--You guys gleaned our trees last year. It shocked them a bit to have ALL the fruit taken off so we would like about a third left on. Our neighbor (Elaine Bonnini) that we share a side fence with would like her trees partially gleaned as well. She has orange as well as some grapefruit. You can use our side gate to access the backyard. Our neighbors tree you can glean from our yard or you can use her side walkway. We should be home that day. ', '35.2647', '-120.6332', 'Backyard', NULL, 'Yes'),
