(304, 'Promega Bioscience', NULL, NULL, 'oranges', '1 tree', 'other', NULL, 'Yes', 'April Hooey Promega Bioscience', NULL, '20', '6', '03-08', 'No', NULL, 'No', NULL, 'April Hooey Promega Bioscience', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '277 Granada Dr.', 'San Luis Obispo', 'CA', '93401', '277 Granada Dr.', 'San Luis Obispo', 'CA', '93401', NULL, ' ', 'The tree is on the back corner of the office building. Take a right into the driveway and pull around, the tree is on your left.', '35.2507', '-120.6662', 'Backyard', NULL, 'Yes'),
(305, 'Broadhurst', NULL, NULL, 'avocados', NULL, 'owner', NULL, 'Yes', 'Dragon Springs Farm', NULL, NULL, NULL, '08-11', 'No', NULL, 'No', NULL, 'Mike & Carol Broadhurst', '(805) 924-1260', 'mdbroadhurst@att.net', NULL, NULL, NULL, NULL, NULL, NULL, '6115 Santa Rosa Creek Road', 'Cambria', 'CA', '93428', '6115 Santa Rosa Creek Road', 'Cambria', 'CA', '93428', NULL, 'Other', 'Please look up directions ahead of time as there is no cell phone coverage at this site and spotty GPS coverage. \r\n\r\nInformation from Chuck:\r\n\r\nGeneral directions from Google maps are included below. Please look up directions ahead of time as there is NO CELL PHONE COVERAGE at this site and spotty GPS coverage. \r\n<br/>\r\n<br/>\r\nHere are detailed direction to the Dragon Spring Ranch\r\n<br/>\r\n<br/>\r\nTake Hwy 1 north (if coming from the south) and get off on Main Street which is the first exit in Cambria. At the stop light follow Main St. to the right which winds down to valley floor approximately 1 mile. \r\n<br/>\r\nYou will cross a small bridge over Santa Rosa Creek and turn RIGHT onto Santa Rosa Creek Road, passing Coast Union High School in 1/2 mile. It is rural road that narrows as you travel with several blind curves and some single car passage ways.\r\n<br/>\r\n<br/>\r\nApproximately 4 1/2 miles down Santa Rosa Creek Road is Dragon Spring Ranch tucked on the right side of the road. We will have the GleanSLO sign at the driveway and place to turn in. The 1/2 mile driveway has a  metal bridge over the small creek and turns into a dirt road. Continue straight ahead going up through citrus trees to the second house.  \r\n<br/>\r\n<br/>\r\n\r\nPlease note there are no restrooms at this site. Please wear a long sleeved shirt as a layer, recommended by the farmers, and wear sturdy shoes. We will have harvest bags to use. Let me know if you have questions. Thank you so much!', '35.5786', '-121.0043', 'Farm', NULL, 'Yes'),
(306, 'Tierra Nueva Cohousing Homeowners Assn', 'Amongst the homes', NULL, 'avocados', '6-10 trees', 'owner', NULL, 'Yes', 'Stephanie Ricceri Tierra Nueva Cohousing Homeowners Assn', 'Yes', '35', '15', '04-10', 'No', NULL, 'No', NULL, 'Stephanie Ricceri Tierra Nueva Cohousing Homeowners Assn', '805 550 4093', 'Stephanie_kr@hotmail.com', NULL, '805 720-2655', NULL, NULL, NULL, NULL, '1750 Tierra Nueva Lane', 'Oceano', 'CA', '93445', '1750 Tierra Nueva Lane', 'Oceano', 'CA', '93445', NULL, 'Other', 'The trees are located at a co-housing development in Oceano. We have Zutano, Jim and some Bacon variety Avocado''s ready to pick. We have one orchard ladder and one telescoping harvesting pole on site. As I said the trees are in amongst the homes but harvesting is accessible, none inside fencing for instance.\r\n\r\nScouting notes from Chuck Asmus: Just scouted the site. 90 avo. trees, 7varieties?, note all ready for harvest. Stephenie Ricceri will give us a map of the complex with the variety that is ready for harvest marked or highlighted such as the map for the Cee Cayon (Bob-mgr). She will give the map to my wife at Rutiz farmstand or call my house when ready. She has one pole picker with extension and a 10ft? fruit picking ladder for use on site (give notice). Within 2 miles of Oceano warehouse. Parking for 4-5 cars on Christmas Tree Place just before entering the complex. Not sure where to park the harvest truck. She would like some advanced notice of scheduling so she can alert renters in the complex of strangers pillaging their avo. trees. Having ladders and extending pole pickers with baskets and clipper on the end is necessary. Can we borrow extra somehow/somewhere? I could return them local (Fredrick farm). This could be a long term friendship.', '35.1010', '-120.5971', 'Backyard', NULL, 'Yes'),
(307, 'Moran', NULL, NULL, 'oranges and lemons', '20 trees', 'owner', NULL, 'Yes', 'Kia Moran', NULL, NULL, NULL, '08-28', 'No', NULL, 'No', NULL, 'Kia Moran', '805-459-0976', 'kiamoran@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '265 Broken Arrow Rd', 'Nipomo', 'CA', '93444', '265 Broken Arrow Rd', 'Nipomo', 'CA', '93444', NULL, ' ', 'PREFERS TO COMMUNICATE OVER THE PHONE RATHER THAN EMAIL. SHE IS OKAY WITH US PRINTING PHOTOS AND WE CAN REFER TO THEM AS THE MORAN FAMILY. Property was at the end of Broken  Arrow Rd, which looks like a driveway except for numerous mailboxes. The street sign was obscured by oak tree traveling northwest on Rim Rock Rd. It is more visible if you come the other direction. 20 Trees are mostly manageable from the ground. Bring ten foot fruit picking ladder and two more 8ft and 6ft. Picking will go fast as trees are neat and trimmed. Two additional lemon trees included by owner. Driveway splits going in, send gleaners to left fork to park on the circular road around small tree behind barn/garage. Pick all fruit except the tall one closest house which we will pick around top on (see Chuck) all the rest our ours. Try to pile bad fruit in middle rows to be picked up by owner with tractor. Please notify owner of any damage to irrigation system. I didn''t ask the owner about bathroom. Previous Glean w/John got about 1100lbs. I think they would be interested in a See Canyon type commitment if you are so interested. I didn''t say any thing.  About five people should do it. Husband''s name is Jess and black labish dog''s name is Lady.\r\n ', '35.0801', '-120.5162', 'Backyard', NULL, 'Yes'),
