(312, 'Gabrisch', NULL, NULL, 'citrus', NULL, 'owner', NULL, 'Yes', 'Larry Gabrisch', NULL, NULL, NULL, '04-11', 'No', NULL, 'No', NULL, 'Larry Gabrisch', '(805) 234-1422', 'lgabrisch@kcbx.net', NULL, NULL, NULL, NULL, NULL, NULL, '5290 Orcutt Road', 'San Luis Obispo', 'CA', '93401', '5290 Orcutt Road', 'San Luis Obispo', 'CA', '93401', NULL, ' ', 'Info input by Carolyn (gathered info from email). Carolyn will scout property.\r\n\r\n2 orange, about 12 foot high each\r\n2 grapefruit, 10 foot\r\n3 lemon, one 6 foot, two 10 foot\r\n1 tangelo, 15 foot with a lot of fruit\r\n\r\n\r\n5290 Orcutt Road. Broad to Tank Farm to Orcutt.\r\nPast Orcutt Road Cellars on right, past Avocado on left.\r\nTurn left at multiple mailboxes marking long driveway.\r\n(If you see Righetti Road or Balleyana Winery you''ve gone too far)\r\nGo up to very top of long driveway, passing some homes.\r\nWe have white fencing around entrance.\r\nPark at end and you will see the trees.\r\n', '35.2363', '-120.5980', 'Backyard', NULL, 'Yes'),
(313, 'Peterson', 'Side yard', NULL, 'tangelos', '1 tree', 'owner', NULL, NULL, NULL, NULL, '15', '3', '08-20', 'No', NULL, 'No', NULL, 'Max & Donna Peterson', '931-0434', 'maxpeterson@charter.net', NULL, NULL, NULL, NULL, NULL, NULL, '340 Apricot St', 'Nipomo', 'CA', '93444', '340 Apricot St', 'Nipomo', 'CA', '93444', NULL, 'Newspaper', NULL, '35.0245', '-120.4916', 'Backyard', NULL, 'Yes'),
(314, 'Barr', NULL, NULL, 'oranges', 'two trees', 'owner', NULL, 'Yes', 'Georgia Barr', 'Yes', '25', '2', '04-15', 'Yes', 'mildew on outside', 'No', NULL, 'Georgia Barr', '805-473-8839', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1119 N. Thompson Ave.', 'Nipomo', 'CA', NULL, '1119 N. Thompson Ave.', 'Nipomo', 'CA', '93444', NULL, 'SLO Food Bank', 'There are two orange trees, one navel which is ripe in April, and one valencia which is ripe in June.  She asked us to pick the navels off the top half of the tree that are our of arm''s reach.  We can pick all of the valencia, but they weren''t ready the first time we went.  We will need to go back in June to pick the second harvest. Her property has a closed gate, so when a leader arrives call her and she''ll let you in if it hasn''t already been opened.\r\n\r\n', '35.0687', '-120.5053', 'Backyard', NULL, 'Yes'),
