(316, 'Hill', 'side yard, terraced', NULL, 'avocados', '100 trees', 'owner', NULL, NULL, NULL, NULL, '5', '1', '04-18', 'No', NULL, 'No', NULL, 'Donna Hill', '(805) 547-1927', 'donnarh4@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '1899 Paseo de Caballo', 'San Luis Obispo', 'CA', '93405', '1899 Paseo de Caballo', 'San Luis Obispo', 'CA', '93405', NULL, 'Newspaper', 'The property is terraced. The first two rows are left for the property owner. Remaining 4 rows can be dedicated to GleanSLO for 2013. Probably best if there is a farm cart or utility cart for crates to be loaded into as the property is quite long, going along the side of a terraced property. There is a gate code (6001) which the leader will need for entry on to the property. The volunteers will need to meet the leader outside the gate and then all follow the leader who uses the gate code. The exit is different from the entrance, back on to highway one. ', '35.3128', '-120.6915', 'Backyard', NULL, 'Yes'),
(317, 'Nally', 'side yard', NULL, 'oranges', 'one tree', 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '04-12', 'No', NULL, 'No', NULL, 'Chris & Daneal Nally', '805-550-6430', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '205 S Mason Street', 'Arroyo Grande', 'CA', '93420', '205 S Mason Street', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'Pick all the oranges.  Do not pick the lemons.', '35.1228', '-120.5752', 'Backyard', NULL, 'Yes'),
