(320, 'Castle', 'backyard', NULL, 'lemons', 'one tree', 'owner', NULL, 'Yes', 'Marge & Roger Castle', NULL, '10', NULL, '12-01', 'No', NULL, 'No', NULL, 'Marge & Roger Castle', '805-235-8477(C)', NULL, NULL, '805-528-2349(H)', NULL, NULL, NULL, NULL, '3164 Glenn St.', 'Los Osos', 'CA', '93402', '2164 Glenn St.', 'Los Osos', 'CA', '93402', NULL, 'Other', 'This is a Meyer lemon tree.  There are dogs, but shouldn''t be outside unless owner is home.  Tree is in backyard and it is okay for gleaner to enter before they are home from work.  Be sure to knock on door first.  May need pole picker and/or ladder.mmPlease leave some fruit at the bottom of the tree for the homeowners. ', '35.3114', '-120.8574', 'Backyard', NULL, 'Yes'),
