(323, 'Bonjour', 'Next to driveway', NULL, 'lemons', '2 trees', 'other', NULL, NULL, NULL, NULL, '20', '6', '12-02', 'No', NULL, 'No', NULL, 'Mr. & Mrs. Richard Bonjour', '805-489-5653', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '228 S. Mason', 'Arroyo Grande', 'CA', '93420', '228 S. Mason', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Submitted by Vince Petrie.  I met the owner today 11/27/13.  He agreed to let us pick his lemons on Monday 12/2/13.  I''ll need an 8ft ladder.\r\n\r\nHarvest must be in the morning starting around 9am before owner goes to work.', '35.1218', '-120.5750', 'Backyard', NULL, 'Yes'),
(324, 'SLO Creek Farms Festival', NULL, 'SLO Creek Farms', 'Festival', NULL, 'owner', NULL, 'Yes', 'SLO Creek Farms Apple Blossom Festival', NULL, NULL, NULL, '10-12', 'No', NULL, 'No', NULL, 'SLO Creek Farms Festival', '702-808-7126', 'slocreekfarms@live.com', NULL, NULL, NULL, NULL, NULL, NULL, '6455 Monte Rd', 'San Luis Obispo', 'CA', '93401', '6455 Monte Rd', 'San Luis Obispo', 'CA', '93401', NULL, ' ', 'Entered by Jeanine--This is an event co-sponsored by GleanSLO.  There will be many activities, live music, food, and fundraiser for GleanSLO.', '35.1983', '-120.6962', 'Farm', NULL, 'Yes'),
(325, 'Bhat', 'Backyard', NULL, 'citrus', '2 large trees', 'other', NULL, 'No', NULL, NULL, '25', '5', '04-19', 'No', NULL, 'No', NULL, 'Dr. Jyoti Bhat', '805-473-2130', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '143 S. Mason St', 'Arroyo Grande', 'CA', '93420', '143 S. Mason St', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Jeanine called on 4/17/14 to find out if fruit is ready to harvest...still needs a month or two.  Stephanie will call us when it''s ready.  This referral submitted by Vince Petrie. There are an Orange & Grapefruit trees. I showed this to Chuck on 4/12 after our harvest in the Village.  Easy access thru gate.  We''ll need ladders.  This is a dentist office.  Call the receptionist, Stephanie, to schedule the harvest 473-2130.  Take as much fruit as we can get.  ', '35.1232', '-120.5753', 'Backyard', NULL, 'Yes'),
(326, 'Mills', 'Backyard', NULL, 'citrus', '5 trees', 'other', NULL, NULL, NULL, NULL, '25', '3', '04-25', 'No', NULL, 'No', NULL, 'Wayne Mills', '805-481-3495', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '502 Via Barranca', 'Arroyo Grande', 'CA', '93420', '502 Via Barranca', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'This referral submitted by Vince Petrie.  Site is just off Tally Ho Rd 1/2 mile from my house.  There is one orange tree in front yard next to driveway and 4 other trees in backyard - orange, grapefruit, lemon and tangelo.  We can pick some from each tree, but the owner would like to keep enough for himself and to share with neighbors.  Owner travels so call to schedule harvest.  Owner must be home during harvest.  We''ll need ladders. ', '35.1284', '-120.5767', 'Backyard', NULL, 'Yes'),
(327, 'Wahl', 'Side yard', NULL, 'lemons', '1 tree', 'other', NULL, NULL, NULL, NULL, '8', '2', '04-19', 'No', NULL, 'No', NULL, 'Eric & Leona Wahl', '805-474-1789', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '135 Tally Ho Rd', 'Arroyo Grande', 'CA', '93420', '135 Tally Ho Rd', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'This referral submitted by Vince Petrie.  Site is down the street from my house.  One small lemon tree in side yard behind fence.  Owner will pick the lemons and leave them in a box on their front porch. Call owner after 6 pm to schedule harvest.  No ladder needed.  Owner has dogs.  Also possible Fuji apple, plum and kiwi donation later in season.  ', '35.1278', '-120.5768', 'Backyard', NULL, 'Yes'),
(328, 'Rowley', 'front yard', NULL, 'citrus', '2 trees', 'owner', NULL, NULL, NULL, NULL, '10', '2', '04-12', 'No', NULL, 'No', NULL, 'Debbie Rowley', '805-489-1502', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '187 Tally Ho Rd', 'Arroyo Grande', 'CA', '93420', '187 Tally Ho Rd', 'Arroyo Grande', 'CA', '93420', NULL, 'Neighbor', 'Entered by Jeanine: Referred to GleanSLO by Vince Petrie. One medium Meyer lemon and one medium grapefruit trees.  Leave some fruit for the homeowner.', '35.1292', '-120.5756', 'Backyard', NULL, 'Yes'),
(329, 'Local Donor', NULL, NULL, 'assorted', NULL, 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '08-29', NULL, NULL, NULL, NULL, 'Unknown Local Donor', '805-481-4652', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1820 Railroad St.', 'Oceano', 'CA', '93445', NULL, NULL, 'Local Donations dropped off at the Oceano Warehouse.', NULL, NULL, 'Backyard', NULL, 'Yes'),
(330, 'Jones', 'Backyard', NULL, 'apples', '2 trees', 'other', NULL, NULL, NULL, NULL, '10', '5', '07-10', 'No', NULL, 'No', NULL, 'Diondra Jones', NULL, 'littledjones@hotmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '474 Henderson Avenue', 'San Luis Obispo', 'Ca', '93405', '474 Henderson Avenue', 'San Luis Obispo', 'CA', '93405', NULL, 'Flyer', '2 Apple trees located in back/side yard, Lemon tree in front yard/walkway.  Lemon Tree ripe/grows year round, Apple Trees not ripe until Late July or Early August. (NOTE: These were all registered as one crop but have been separated into #330 and #331)', '35.2926', '-120.6503', 'Backyard', NULL, 'Yes'),
(331, 'Jones', 'front yard', NULL, 'lemons', '1 tree', 'other', NULL, NULL, NULL, NULL, '10', '5', '05-07', 'No', NULL, 'No', NULL, 'Diondra Jones', NULL, 'littledjones@hotmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '474 Henderson Avenue', 'San Luis Obispo', 'Ca', '93405', '474 Henderson Avenue', 'San Luis Obispo', 'CA', '93405', NULL, 'Flyer', '2 Apple trees located in back/side yard, Lemon tree in front yard/walkway. Lemon Tree ripe/grows year round, Apple Trees not ripe until Late July or Early August. (NOTE: These were all registered as one crop but have been separated into #330 and #331)', '35.2926', '-120.6503', 'Backyard', NULL, 'Yes'),
(332, 'Burns', 'Backyard', NULL, 'lemons', '1 tree', 'other', NULL, NULL, NULL, NULL, '20', '5', '04-25', 'No', NULL, 'No', NULL, 'Nancy Burns', '805-235-0628', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '500 Ide St', 'Arroyo Grande', 'CA', '93420', '500 Ide St', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Referred by Vince Petrie.  Call daughter Julie to schedule harvest - 235-0628.  Ladder needed for 1 medium lemon tree.', '35.1230', '-120.5731', 'Backyard', NULL, 'Yes'),
(333, 'Williamson', 'Side yard', NULL, 'oranges', '1 tree', 'owner', NULL, NULL, NULL, NULL, '30', '5', '04-25', 'No', NULL, 'No', NULL, 'Louise Williamson', '805-540-0040', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '253 Tally Ho Rd', 'Arroyo Grande', 'CA', '93420', '253 Tally Ho Rd', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Referred by Vince Petrie.  1 large orange tree in side yard behind fence.  We''ll need ladders and pole pickers.  Leave some fruit for owner.  Call owner to schedule harvest.  Owner will have apples and avocados later in season.  ', '35.1308', '-120.5741', 'Backyard', NULL, 'Yes'),
(334, 'Ikeda Brothers', NULL, 'Arroyo Grande', 'lettuce', NULL, 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '04-27', 'No', NULL, 'Yes', NULL, 'Tom Ikeda Brothers', '805-471-2526', 'maslin1@msn.com', NULL, NULL, NULL, NULL, NULL, NULL, 'P.O. Box 518', 'Oceano', 'CA', '93475', '642 Branch Mill Rd.', 'Arroyo Grande', 'CA', '93420', NULL, ' ', NULL, '35.1384', '-120.5382', 'Farm', NULL, 'Yes'),
(335, 'Ward', NULL, 'Avila ', 'tangerines', '30 trees', 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '05-09', 'No', NULL, 'No', NULL, 'Ken & Ebbie Ward', '805 235-9522', 'ehp@charter.net', NULL, NULL, NULL, NULL, NULL, NULL, '1520 Apple Orchard Lane', 'San Luis Obispo', 'CA', '93405', '1520 Apple Orchard Lane', 'San Luis Obispo', 'CA', '93405', NULL, ' ', '2/3/14 update--Jeanine spoke with Ken and he reported that the trees were undernourished this year so they didn''t produce very many fruit.  He is going to fertilize and prune the trees this month and hopes to have a full-size crop in the spring of 2015.  He will be sure to get in touch with us when that time comes. \r\n\r\nClementine tangerines. All the same variety (40 trees). Tight-skinned fruit, small. Will need 2-3 orchard ladders to get to the top of the trees. The bottom row is very sloped and folks may need to sit on ground to pick from the bottom of the tree and on the House side, this row is quite steep to access. All other trees very easy to reach, more level ground.\r\n\r\nSloped yard. Two side gates that need to be unlocked. stairs on each side made from railroad ties with a path made of decomposed granite. Fewer stairs on right gate which is the gate we used in May 2013. Easy parking at the end of his driveway as it''s a dead end. (We had 10 people there for 2nd glean and since people carpooled, we had 6 cars.)', '35.1894', '-120.7170', 'Backyard', NULL, 'Yes'),
(336, 'Laubmeier', NULL, 'Oceano', 'avocados', '6 trees', 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '05-14', 'No', NULL, 'No', NULL, 'Holger Laubmeier', '805-489-6864 H', NULL, NULL, '805-218-3546 C', NULL, NULL, NULL, NULL, '1698 Tierra Nueva Lane', 'Oceano', 'CA', '93445', '1698 Tierra Nueva Lane', 'Oceano', 'CA', '93445', NULL, ' ', 'Entered by Jeanine Lacore.  We can pick the Bacon, Jim, Zutano, Pinkerton varieties. DO NOT PICK THE HAAS AVOCADOS.\r\nThe owner will be there when we glean. The trees are similar to Stephanie Ricceri''s trees but have been pruned at least once, not recently. No houses to work around, ground is gently sloping and covered with mulch. Two small dogs, which should not be let out of fenced area. Owner tentative about having to many people, but still willing. Lots of ladder and pole picker work but also a few lower. Estimated to be about 7-8 banana boxes. He has a 12 ft ladder and a pole picker for use. We should bring the other orchard ladders and pole pickers.', '35.1006', '-120.5962', 'Backyard', NULL, 'Yes'),
(337, 'Cal Poly Hort/Crop Science', NULL, NULL, 'citrus', NULL, 'owner', NULL, 'Yes', ' Cal Poly Hort/Crop Science', NULL, NULL, NULL, '10-13', 'No', NULL, 'No', NULL, 'Cal Poly Hort/Crop Science', '(805) 975-3228', 'alleentex@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '1 Grand Avenue, Bldg 17, Crops Unit', 'San Luis Obispo', 'CA', '93407', 'Crops Unit, Highland and Mt. Bishop', 'San Luis Obispo', 'CA', '93405', NULL, 'GleanSLO web site', NULL, '35.2828', '-120.6596', 'Farm', NULL, 'Yes'),
(338, 'Rogers', NULL, NULL, 'strawberries', '2 acres', 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '05-13', 'No', NULL, 'No', 'organic fields', 'Michael Rogers', '(805) 481-8025', 'a.progressive@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '1446 Pomeroy', 'Arroyo Grande', 'CA', NULL, '1446 Pomeroy', 'Arroyo Grande', 'CA', NULL, NULL, ' ', 'there are 3 dogs on the property. parking can be on both sides of the street on Pomeroy. Berry baskets, clamshells, boxes needed. For volunteers, suggest they bring: small produce bag, plastic baskets, or small Tupperware container for personnel use, small bucket if they want all bad ones for canning. No clippers needed.\r\n\r\nDirections from Chuck- 101 exit Los Berros go west turn on Pomeroy rd ( only one way to go) .7 mi. on left. If you exit 101 at Willow rd go west, turn rt on Pomeroy rd about .8 mi on rt.\r\nRusty gate chained at entrance of long driveway, house is up behind strawberry field. I didn''t see a house number on mailbox. Park along street by strawberry field off the road. Farm type flatbed truck partly obscuring field. There is a chain link stand alone gate with small doorway width space for entering to the field. He has three dogs roaming, they will eat berries. Hopefully we can get him to pin up dogs while their.', '35.0659', '-120.5303', 'Farm', NULL, 'Yes'),
(339, 'Ikeda Brothers', NULL, NULL, 'lettuce', NULL, 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '05-11', 'No', NULL, 'Yes', NULL, 'Tom Ikeda Brothers', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '9280 Mountain View Rd', 'Arroyo Grande', 'CA', '93420', NULL, ' ', NULL, '35.0829', '-120.5896', 'Farm', NULL, 'Yes'),
(340, 'Pepper Creek Family Farm', 'in the greenhouse', NULL, 'lettuce', NULL, 'owner', NULL, 'No', NULL, NULL, NULL, NULL, '09-16', 'No', NULL, 'No', NULL, 'Eric Boyd Pepper Creek Family Farm', '(805) 878-8910', 'emboyd913@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '1477 Marloma', 'Arroyo Grande', 'CA', '93420', '1477 Marloma Lane', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'Peppercreek Family Farm. They sell at farmer''s markets, Morro Bay, downtown SLO, to restaurants, etc.  They are a hydroponic greenhouse with greens, lettuce, bok choy, etc. ', '35.1344', '-120.5241', 'Farm', NULL, 'Yes');
