(342, 'Brill', 'Backyard', NULL, 'oranges', '1 tree', 'other', NULL, NULL, NULL, NULL, '30', '5', '05-17', 'No', NULL, 'No', NULL, 'Candy Brill', '805-202-9903', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '310 Whiteley', 'Arroyo Grande', 'CA', '93420', '310 Whiteley', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Referred by Vince Petrie.  1 Valencia orange tree in backyard.  Call owner to schedule the harvest.  Tall ladders will be needed.', '35.1218', '-120.5736', 'Backyard', NULL, 'Yes'),
(343, NULL, 'Side yard', NULL, 'oranges and clementines', '2 trees', 'renter', NULL, 'No', NULL, NULL, '30', '5', '05-19', 'No', NULL, 'No', NULL, 'Michelle', '805-801-3746', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '326 Short', 'Arroyo Grande', 'CA', '93420', '326 Short', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Referred by Vince Petrie.  This is a rental unit.  Call tenant, Michelle to schedule harvest.  Ladders will be needed.  Give some of the harvest to the tenant.', '35.1203', '-120.5748', 'Backyard', NULL, 'Yes'),
(345, 'Ritchie', 'In the backyard', 'Arroyo Grande', 'citrus', '2 trees', 'owner', NULL, 'No', NULL, NULL, '12', '2', '08-12', 'No', NULL, 'No', NULL, 'Pastor Reynolds Ritchie', '805-574-9501', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '571 South Traffic Way Ext.', 'Arroyo Grande', 'CA', NULL, '571 South Traffic Way', 'Arroyo Grande', 'CA', '93420', NULL, 'SLO Food Bank', 'Entered by Jeanine Lacore.  Homeowner will be home to help show the volunteers around.  He would like a few of the blood oranges left on the tree.\r\n\r\nChuck''s notes 8/12/14: His grapefruit tree is truly about 7ft tall but the 8ft ladder helped me get the fruit in the top middle. The whole tree looked like it was drying up. The fruit was falling off in my hand as I tried to pick. His 10-12 ft blood orange tree and reg orange tree had very little fruit left in the top middle.', '35.1186', '-120.5907', 'Backyard', NULL, 'Yes'),
(346, 'Cetti', 'Side yard', NULL, 'oranges and tangerines', '2 trees', 'owner', NULL, 'Yes', 'Connie Cetti', NULL, '25', '4', '03-27', 'No', NULL, 'No', NULL, 'Connie Cetti', '805-489-3624', 'ckcetti@yahoo.com', NULL, '805-680-8996', NULL, NULL, NULL, NULL, '200 Nelson', 'Arroyo Grande', 'CA', '93420', '200 Nelson', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Referred by Vince.  Call owner to schedule.  She would like volunteers to harvest during NON-business hours.  Need 2 people with ladders and pole pickers.  This location is a business, Green Vase Antiques.', '35.1224', '-120.5761', 'Backyard', NULL, 'Yes'),
(347, 'Faucette', 'north side', NULL, 'loquats and avocados', '1 tree', 'owner', NULL, 'Yes', 'Gary Faucette', NULL, '30', '4', '05-05', 'No', NULL, 'No', NULL, 'Gary Faucette', '805-544-3308', 'gfaucette@charter.net', NULL, '805-451-2618', NULL, NULL, NULL, NULL, '1508 Mill Street', 'San Luis Obispo', 'ca', '93401', '1508 Mill Street', 'San Luis Obispo', 'CA', '93401', NULL, 'Web search', 'Our parking lot is off California. We are on the corner of California and Mill.\r\nIt is my office and my wife''s office. Her name is Terri Quinn, Ph.D.\r\n\r\nlook up loquat on internet - there are medicinal properties in fruit and leaves\r\n\r\nLadders are needed for this glean. Clippers are also needed to cut the branches that hold clusters of the fruit. Then the fruit can be cut off the clusters into small berry baskets or cardboard flats such as what we use for peaches ("strawberry trays")...\r\n\r\n', '35.2879', '-120.6559', 'Backyard', NULL, 'Yes'),
(348, 'Antoon', NULL, NULL, 'pears', '3 trees', 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '08-14', 'No', NULL, 'No', NULL, 'Anne Antoon', '(805) 226-8313', 'anne.antoon@att.net', NULL, NULL, NULL, NULL, NULL, NULL, '6760 Cabernet Place (off Branch, off Hwy 46/ Union', 'Paso Robles', 'CA', '93446', '6760 Cabernet Place (off Branch, off Hwy 46/ Union', 'Paso Robles', 'CA', '93446', NULL, ' ', 'ladders needed for picking, but owner does have an orchard ladder and additional ladder. Would like help thinning the pear trees.', '35.6323', '-120.6642', 'Backyard', NULL, 'Yes'),
(349, 'Johnson', 'E. side of property', 'Arroyo Grande', 'plums', '15 Trees', 'owner', NULL, NULL, NULL, NULL, '10', '5', '06-30', 'No', NULL, 'No', NULL, 'Deborah & Douglas Johnson', '805-440-9444', 'deborahlee1978@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '326 Helroy', 'Arroyo Grande', 'CA', '93420', '326 Helroy', 'Arroyo Grande', 'CA', '93420', NULL, 'Other', 'These are Santa Rosa variety plums.  The trees start ripening around first of the month and they all fall to the ground by the next month.  So the harvest is fast.  We would like to have 2 trees to ourselves and friends but you are welcome to the rest.  They are sweet and wonderful!\r\n\r\nNotes from Chuck who checked out site on 7/7/13:  I went to 326 helroy today. I didn''t see Doug or Debbie(first house on driveway). I did meet their neighbor (second house). 15 trees are large but still have some fruit accessible from the ground, most of the fruit is higher. Ladders are the preffered tool, conventional ladders will also work as the ground is pretty flat and hard. Some of the fruit will be higher than ladders will reach, a lot of fruit on trees and ground. Fruit is approx. same size as Cee Cyn and Valley street but mostly riper. Helroy is less than 1/4mi closer to Los Berros Rd. from where the organic strawberry glean was, on the north west side of Pomeroy.', '35.0683', '-120.5352', 'Backyard', NULL, 'Yes'),
(350, 'Avila & Sons Farm', NULL, NULL, 'stone fruit', NULL, 'owner', NULL, 'Yes', 'Avila & Sons Farm', NULL, NULL, NULL, '10-16', 'No', NULL, 'No', NULL, 'David Avila & Sons Farm', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '13391 Fargo Ave.', 'Hanford', 'CA', '93230', 'Thursday Farmers Market', 'San Luis Obispo', 'CA', NULL, NULL, ' ', NULL, '35.2828', '-120.6596', 'Market', NULL, 'Yes'),
(351, 'Broadhurst', NULL, NULL, 'blueberries', '500 bushes', 'owner', NULL, 'Yes', 'Dragon Springs Farm', NULL, NULL, NULL, '06-17', 'No', NULL, 'No', NULL, 'Mike & Carol Broadhurst', '(805) 924-1260', 'mdbroadhurst@att.net', NULL, NULL, NULL, NULL, NULL, NULL, '6115 Santa Rosa Creek Road', 'Cambria', 'CA', '93428', '6115 Santa Rosa Creek Road', 'Cambria', 'CA', '93428', NULL, 'SLO Food Bank', 'up to 10 volunteers, parking outside gate. buckets can be borrowed from farm site.', '35.5786', '-121.0043', 'Farm', NULL, 'Yes'),
(352, 'Ritter', 'front of property', 'South of SLO', 'stone fruit', '12', 'owner', NULL, NULL, NULL, NULL, '10', NULL, '06-28', 'No', NULL, 'No', NULL, 'Shirley Scott (son Ritter', '775-771-1564', 'shirlritter@gmail.com', NULL, '805-305-1032', NULL, NULL, NULL, NULL, 'P.O. box 9', 'Avila Beach', 'CA', '93424', '6550 Avila Valley Dr.', 'San Luis Obispo', 'CA', '93405', NULL, ' ', 'Entered by Jeanine Lacore.  Organically grown plums and nectarines, may have some blemishes. First driveway on the right, orchard is located at the front of the property.  Call before coming to scout and Shirley will meet at the orchard.  Also, has other fruit: peaches, apples, asian pears, that may be donated later in the season.  Will contact us as soon as she knows.', '35.1932', '-120.7098', 'Farm', NULL, 'Yes'),
(353, 'Masaryk', 'backyard', 'SLO', 'plum, apricot, and loquat', '3 trees', 'owner', NULL, 'No', NULL, 'Yes', NULL, NULL, '06-29', 'No', NULL, 'No', NULL, 'Becky Masaryk', '(805) 459-9408', 'beckslo@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '5430 Fresno', 'Atascadero', 'CA', '93422', '320 Luneta Drive', 'San Luis Obispo', 'CA', '93405', NULL, ' ', 'Becky is the homeowner of this property where Carolyn and Andy gleaned in June 2013. This house is very close to Carolyn''s house on the other side of Foothill and down the street from another homeowner on Luneta (Loper family) who donated plums and oranges that they picked.\r\n\r\nBecky is moving to Atascadero and will rent out the home to tenants. She would like us to contact her end of May/early June 2015 to inquire about the loquat, apricot, plum trees, along with her Valencia orange tree\r\n\r\nLoquat and orange on sloped side yard without fence, and plum tree in backyard. The tree is on an extremely sloped hill but part of the fruit can be accessed off the back deck. The apricot tree is at bottom of hill in backyard. When Carolyn and Andy gleaned in July 2013, the apricot''s fruit had already dropped.', '35.2914', '-120.6792', 'Backyard', NULL, 'Yes'),
(354, 'Loper', 'backyard', NULL, 'oranges', '3 trees total', 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '06-30', 'No', NULL, 'No', NULL, 'Bill & Kathy- jackie Loper', '(805) 543-7408', 'wklop@charter.net', NULL, NULL, NULL, NULL, NULL, NULL, '266 Luneta ', 'San Luis Obispo', 'CA', '93405', '266 Luneta', 'San Luis Obispo', 'CA', '93405', NULL, 'Other', 'Daughter Jackie Loper picks the oranges and either she will call or have her mother, Kathy call. They also have a plum tree that they pick for donations. Carolyn has done 3 pickups at this property. They do not want a receipt but we weigh the fruit, donate locally and then write up a donor receipt for Mildred to input.', '35.2915', '-120.6814', 'Pickup', NULL, 'Yes'),
(355, 'Local Donor', NULL, NULL, 'assorted', NULL, 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '08-15', 'No', NULL, 'No', NULL, 'Unknown Local Donor', '(805) 481-4652', 'gleanslo@slofoodbank.org', NULL, NULL, NULL, NULL, NULL, NULL, '2212 Golden Hills Road', 'Paso Robles', 'CA', '93446', '2212 Golden Hills Road', 'Paso Robles', 'CA', '93446', NULL, ' ', 'Local donations dropped off at the Paso Robles Food Bank warehouse.', '40.6563', '-122.3185', 'Backyard', NULL, 'Yes'),
(356, 'Rutiz Farms', NULL, 'Arroyo Grande', 'assorted', NULL, 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '01-01', 'No', NULL, 'No', NULL, 'Jerry Rutiz Farms', '8054810626', 'rutizfarms@sbcglobal.net ', NULL, NULL, NULL, NULL, NULL, NULL, '1075 the pike', 'Arroyo Grande', 'CA', NULL, '1075 The Pike', 'Arroyo Grande', 'CA', NULL, NULL, ' ', 'vegetables, pesticide free', '0.0000', '0.0000', 'Farm', NULL, 'Yes'),
(357, 'Castro', 'Backyard', 'Arroyo Grande', 'plums', '2 trees', 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '07-19', 'No', NULL, 'No', NULL, 'Mary Castro', '805-489-7372', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '504 Ide St', 'Arroyo Grande', 'CA', '93420', '504 Ide St', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Submitted by Vince Petrie who spoke directly with Mary''s daughter Diana who answered the door.  Plums are ready NOW.  Owner wants us to harvest ASAP.  She asked if we could come Monday July 8th at 11am.  Carolyn''s notes: I left a message on the voicemail to try and confirm a time when we could go to harvest as Vince was willing to lead the harvest. I did not receive a phone call back. I asked Vince about it and he did not directly meet the homeowner, Mary. He said the daughter seemed fairly interested, but perhaps the owner herself wasn''t? Jeanine, if you''d like to call back...or have Vince stop by again? \r\n\r\nThe owner also has citrus trees.', '35.1233', '-120.5730', 'Backyard', NULL, 'Yes'),
(358, 'Dean', 'Front yard', NULL, 'oranges', '1 tree', 'owner', NULL, NULL, NULL, NULL, '25', NULL, '01-01', 'No', NULL, 'No', NULL, 'Mike Dean', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, '303 E Cherry St', 'Arroyo Grande', 'CA', '93420', '303 E Cherry St', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Submitted by Vince Petrie.  This is a navel orange tree.  I forgot to get owner''s phone #.  We can schedule this harvest on same day as another one in AG and just drop by.', '35.1200', '-120.5729', 'Backyard', NULL, 'Yes'),
(359, 'Gullickson', 'Backyard', NULL, 'oranges', '1 tree', 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '07-08', 'No', NULL, 'No', NULL, 'Don Gullickson', '805-489-6774', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '513 E Cherry', 'Arroyo Grande', 'CA', '93420', '513 E Cherry', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Submitted by Vince Petrie.  Can possibly schedule this on same day as other harvests in AG.  The owner ended up picking the orange tree himself and is leaving the fruit in a pail that he''d like back once we transfer the fruit to a box or bag. He also picked banana squash for donation. Vince will swing by and pick up the produce. Owner does not want a receipt.', '35.1212', '-120.5710', 'Pickup', NULL, 'Yes'),
(360, 'Espinoza', 'Backyard', NULL, 'oranges and avocados', '3 or 4 trees', 'landlord', NULL, 'No', NULL, NULL, NULL, NULL, '01-01', 'No', NULL, 'No', NULL, 'Dorian Espinoza', '805-868-3433', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '125 Nelson St', 'Arroyo Grande', 'CA', '93420', '125 Nelson St', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Submitted by Vince Petrie.  Donor requested early afternoon harvest.  Dogs on property.  Need 4 or 5 volunteers for this one.', '35.1224', '-120.5774', 'Backyard', NULL, 'Yes'),
(361, 'Draly', 'apple in front yard', NULL, 'apples', '3-4 trees', 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '07-15', 'No', NULL, 'No', NULL, 'Faye Draly', '805 434-0615', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1020 Santa Rita Road', 'Templeton', 'CA', '93465', '1020 Santa Rita Road', 'Templeton', 'CA', '93465', NULL, 'Friend', 'I golden delicious tree is ripe in July, other apples later in the season, 1 pear tree ripe early Oct/Nov. Carolyn''s notes: I received a voicemail on the GleanSLO phone about this residence. The owner would like us to stay in touch with her as she has a few fruit trees, all ripe at different times.  I created the crop donation while on the phone with her. I then followed up with Dennis Lanes to see if he would scout the property which he did. The apple tree is in the front yard, at the edge of a fence with a slightly sloped yard. A ladder is needed. The pear will be ready this fall (Oct?). Perhaps another harvest should be created for Oct? and then see if Dennis could scout the property or keep in touch?', '35.5430', '-120.7233', 'Backyard', NULL, 'Yes'),
(362, 'Lechuga', 'field', 'Paso Robles', 'corn', NULL, 'owner', NULL, 'Yes', 'CA Natural Sweet Corn', NULL, NULL, NULL, '11-08', 'No', NULL, 'No', NULL, 'Steve Lechuga', '(805) 235-6942', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '5382 Monterey Road', 'Paso Robles', 'CA', '93446', '2627 Adobe Road', 'Paso Robles', 'CA', '93446', NULL, ' ', 'found out about GleanSLO through farmers market. They farm organically, but aren''t certified, though all seed used is organic. The farm name is California Natural Sweet Corn. Steve did not want us to contact him through an email address and prefer phone contact instead. He was going to check out everything through the property owner. Carolyn first spoke with Steve on 7/11/13. Notes from Chuck: The field (717 Marquita Ave. off Ramada Drive) is 624 ft. long (3 1/4 football fields) with 1900 seeds planted per row. We are to harvest ears that are 6 inches or less by feeling the inside length of ear. We are to do 24 rows. There are 2-3 ears per stalk. He already wants a return visit within 10 days for a second harvest.', '35.5497', '-120.7060', 'Farm', NULL, 'Yes'),
(363, 'Whitridge', NULL, NULL, 'plums', '1 tree', 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '07-13', 'No', NULL, 'No', NULL, 'Dawn Whitridge', '(805) 434-0680', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1305 Bennett Way', 'Templeton', 'CA', NULL, '1305 Bennett Way', 'Templeton', 'CA', NULL, NULL, ' ', 'This is a Santa Rosa variety plum tree.  \r\n\r\nTrader Joe''s  (Rossi) next turn after Trader Joe''s on the left side. Backyard with gate locked. Pretty flat ground near the lawn. Ladders needed but she does have one and could leave it out for gleaners to use. ', '35.5390', '-120.7176', 'Backyard', NULL, 'Yes'),
(364, 'Gulino', 'backyard ', NULL, 'plums', NULL, 'owner', NULL, NULL, NULL, NULL, '15', '10', '06-27', 'No', NULL, 'No', NULL, 'Rick & Sara Gulino', '(805) 540-9677', 'RickG@pshhc.org', NULL, NULL, NULL, NULL, NULL, NULL, '819 Turquoise Drive', 'Arroyo Grande', 'CA', '93420', '819 Turquoise Drive', 'Arroyo Grande', 'CA', '93420', NULL, 'Other', 'Dog can be left inside. Ground is flat. Plum tree hangs over garage. Ladders are needed. ', '35.1044', '-120.5844', 'Backyard', NULL, 'Yes'),
(365, 'Thorne', 'Backyard', NULL, 'oranges', '1 trees', 'owner', NULL, 'No', NULL, NULL, '30', '8', '07-14', 'No', NULL, 'No', NULL, 'Kara Thorne', '559-392-1134', 'karajune12@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '512 Allen St', 'Arroyo Grande', 'CA', '93420', '512 Allen St', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Update: Kara and her husband are moving out of this property on 7/15/14, but will give our information to the property manager.  \r\n\r\nReferred by Vince Petrie.  2 Trees: one orange and one apricot.  Only the orange tree has fruit.  Need ladders.  Owner prefers a Monday or Friday glean but other days will work.  Leave some fruit for owner.  Owner also wants a receipt.  ', '35.1218', '-120.5710', 'Backyard', NULL, 'Yes'),
(366, 'Lee', 'backyard', NULL, 'peaches', '1 tree', 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '07-19', 'No', NULL, 'No', NULL, 'Marsha Lee', '556-5905', 'm.sauld2007@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '333 Mesquite Lane', 'Arroyo Grande', 'CA', '93420', '333 Mesquite Lane', 'Arroyo Grande', 'CA', '93420', NULL, 'Friend', 'Enter through the side gate, peach tree will be on obvious as you enter the backyard.  The homeowner would like volunteers to come late morning, early afternoon.  ', '35.1325', '-120.5799', 'Backyard', NULL, 'Yes'),
(367, 'Wow Day Of Service #1', NULL, NULL, 'Service Project', NULL, 'other', NULL, NULL, NULL, NULL, NULL, NULL, '09-19', 'No', NULL, 'No', NULL, 'Wow Day Of Service #1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'San Luis Obispo', 'CA', NULL, NULL, 'San Luis Obispo', 'CA', NULL, NULL, ' ', 'PROJECT REQUIREMENTS:\r\n??? Required number of volunteers must remain flexible.\r\n??? Volunteers should be able to make a noticeable impact in 2-4 hours of service (service window may include volunteer travel time)\r\n??? Projects should contribute to the environment or well-being of the community.\r\n??? Water for volunteers and any tools or equipment needed should be provided by the agency.\r\n??? Agencies must provide proof of liability insurance for the event.', '35.2828', '-120.6596', ' ', NULL, 'Yes'),
(368, 'Make A Difference Day', NULL, NULL, 'Service Project', NULL, 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '10-26', 'No', NULL, 'No', NULL, 'Make A Difference Day', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, ' ', 'PROJECT REQUIREMENTS:\r\n??? Required number of volunteers must remain flexible.\r\n??? Volunteers should be able to make a noticeable impact in 2-4 hours of service (service window may include volunteer travel time)\r\n??? Projects should contribute to the environment or well-being of the community.\r\n??? Water for volunteers and any tools or equipment needed should be provided by the agency.\r\n??? Agencies must provide proof of liability insurance for the event.', NULL, NULL, ' ', NULL, 'Yes'),
(369, 'Wolcott', 'backyard', NULL, 'oranges', '1 tree', 'owner', NULL, 'No', NULL, 'Yes', '15', NULL, '08-08', 'No', NULL, 'No', NULL, 'Barbara Wolcott', ' 805-543-5240', 'Sanlobooks@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '663 Pismo', 'San Luis Obispo', 'CA', '94301', '663 Pismo', 'San Luis Obispo', 'CA', '94301', NULL, ' ', 'Entered by Jeanine Lacore. Seedless Valencia oranges.  Need 2 volunteers with ladders and pole-pickers.  The tree is well pruned and is mostly accessible from underneath.  Ripe by July.  Very sweet and juicy! Volunteers can park on the street. \r\n\r\nHere''s the email she sent the Food Bank: I have an orange tree with a nice crop on it of ripe fruit.  Do have any gleaner willing to pick it for your distribution?  I am in my eighties and can''t do it myself, but would like to see the fruit put to good use.  She would like to be there to meet whom ever is picking and will let us into the backyard.', '35.2761', '-120.6630', 'Backyard', NULL, 'Yes'),
(370, 'Hofman', 'backyard', NULL, 'plums', '1 tree', 'owner', NULL, 'No', NULL, NULL, '25', '8', '07-03', 'No', NULL, 'No', NULL, 'Jim & Susan Hofman', '805-541-0185', 'sjhofman@att.net', NULL, NULL, NULL, NULL, NULL, NULL, '225 LaCanada', 'San Luis Obispo', NULL, '93405', '225 LaCanada Drive', 'San Luis Obispo', NULL, '93405', NULL, 'Newspaper', 'Entered by Jeanine Lacore.  This is a Greengage variety of plums.  Branches were loaded!  To the point of breaking.  Made sure to mention thinning the fruit in the spring to help relieve some of the weight and help the remaining fruit grow larger.  Needed 3-4 volunteers with at least 2-3 ladders.  A lot of fruit accessible from the ground, but it is a tall tree.  Perfectly ripe the last week of July.\r\n\r\nOwner does not need to be home when volunteers glean.  Enter backyard through the gate on the right side of the home.  No need to knock.  Susan is sometimes home, but you are free to come and get it anytime.  No pets.\r\nYou gleaned last year.\r\n\r\nMost is ripe, but some will need another week or so.', '35.2956', '-120.6787', 'Backyard', NULL, 'Yes'),
(371, 'Conner', 'top of driveway', NULL, 'stone fruit', '3 trees', 'owner', NULL, NULL, NULL, NULL, '10', '1', '07-20', 'No', NULL, 'No', NULL, 'Dianne Conner', '805 550 7483', 'floggingwally1@gmail.com', NULL, '805 458 1747', NULL, NULL, NULL, NULL, '2072 Royal Way', 'San Luis Obispo', 'Ca', '93405', '2072 Royal Way', 'San Luis Obispo', 'CA', '93405', NULL, 'Neighbor', 'There are pluots, plums and nectarines. \r\n\r\nCome in through the front orchard gate - dogs will bark and don''t enter the gate to the back yard!  lots of fruit on the ground and in the tree - organic and delicious\r\n\r\nEntered by Jeanine: Should be harvested sooner next year.  Much of the plums were on the ground. Need one ladder to reach the fruit on the plum tree.  Ground is mostly flat, has some terraced steps near the plum tree which make it difficult to maneuver.  Pluot and nectarine trees are reachable by standing or stepping on a crate.  Delicious!', '35.2576', '-120.7029', 'Backyard', NULL, 'Yes'),
(372, 'Veggie Rescue', NULL, NULL, 'assorted', NULL, 'other', 'Coordinator of Veggie Rescue gleaning pr', NULL, NULL, NULL, NULL, NULL, '04-26', 'No', NULL, 'No', NULL, 'Terry Delaney Veggie Rescue', '805-403-8589', 'terry.delaney@marineharvest.com', NULL, NULL, NULL, NULL, NULL, NULL, 'PO Box 1651', 'Santa Ynez', 'CA', '93406', NULL, 'Santa Ynez', 'CA', NULL, NULL, 'Other urban harvesting group', 'Entered by Jeanine Lacore: Terry has contacted GleanSLO when Veggie Rescue has an over-abundance of a crop and would like to share with the SLO County Food Bank.  We will make arrangements for a drop off, pick up or exchange.', '34.6144', '-120.0799', 'Pickup', NULL, 'Yes'),
(373, 'Ikeda Brothers', NULL, NULL, 'citrus', NULL, 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '08-10', 'No', NULL, 'No', NULL, 'Tom Ikeda Brothers', '(805) 471-2526', 'tikeda59@gmail.com', NULL, '(805) 489-2526', NULL, NULL, NULL, NULL, 'P.O. Box 518', 'Oceano', 'CA', '93475', '3243 Lopez Dr', 'Arroyo Grande', 'CA', '93420', NULL, ' ', NULL, '35.1817', '-120.5185', 'Farm', NULL, 'Yes'),
(374, 'Consier-Faulkner', 'backyard', 'Paso Robles', 'nectarines', '1 tree', 'owner', NULL, NULL, NULL, NULL, '15', NULL, '08-21', 'No', NULL, 'No', NULL, 'Doris Consier-Faulkner', '805-434-3092', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '117 Via Robles Drive', 'Paso Robles', 'CA', '93446', NULL, 'SLO Food Bank', 'Doris'' home is located in the Los Robles Mobile Home Estates.  Her house has a long ramp in the front with a carport on the side. Approx directions: Take Main Street exit and if going north on Hwy 101, take this exit but go LEFT over the over pass. You will turn RIGHT on the frontage road, THEATRE DRIVE. you will pass an orchard on your left, a Butane Company, a housing development and then you''ll see the Mobile Home estates called Los Robles. This street is Via Robles Drive. Follow this road close to the end of the path. She is on the left side, #117, and you''ll see a large 100 foot pine tree on her property, her carport, her house number on the mailbox. She''ll have her blue Chevy Astro Van parked in the driveway. A ladder is needed for the nectarine tree. ', NULL, NULL, 'Backyard', NULL, 'Yes'),
(375, 'Dehaeseleer', 'backyard', NULL, 'plums', '1 tree', 'owner', NULL, NULL, NULL, NULL, '12', NULL, '08-22', 'No', NULL, 'No', NULL, 'Gerald (jake) Dehaeseleer', '805-434-0160', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1045 Herdsman Way', 'Templeton', 'CA', '93465', '1045 Herdsman Way', 'Templeton', 'CA', '93465', NULL, 'SLO Food Bank', 'Entered by Jeanine Lacore.  Jake is in his 80s, can no longer pick the fruit.  He has multiple fruit trees on his property: apple, plum, apricot, walnut that he would like to donate. The tree is in the backyard which can be accessed through a gate.  Will need a ladder, but the ground is on a slope. ', '35.5744', '-120.7143', 'Backyard', NULL, 'Yes'),
(376, 'Fishman', NULL, NULL, 'avocados', '25-50 lbs', 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '08-21', 'No', NULL, 'Yes', NULL, 'Larry Fishman', '805-995-0007', 'fishman.investments@gmail.com', NULL, '805-995-0006', NULL, NULL, NULL, NULL, '1860 Cottontail Creek Road', 'Cayucos', 'CA', '93430', '1860 Cottontail Creek Road', 'Cayucos', 'CA', '93430', NULL, 'Web search', 'The crop has been picked already and we do not want it to go to waste. Please contact me and let me know if you will take it. Thank you!', '35.4884', '-120.8787', 'Pickup', NULL, 'Yes'),
(377, 'Samuel', NULL, NULL, 'assorted', '~40 trees', 'owner', NULL, 'No', NULL, NULL, '12', NULL, '10-10', 'No', NULL, 'No', NULL, 'David & Carol Samuel', '805-423-0811 C', 'davidasamuel@yahoo.com', NULL, '805-423-2422 D', NULL, NULL, NULL, NULL, 'P.O. Box 4378', 'Paso Robles', 'CA', '93447', '6380 Vista De Robles Place', 'Paso Robles', 'CA', '93446', NULL, 'SLO Food Bank', 'Entered by Jeanine.  David & Carol at one point sold fruit under the name "Orchard Hill Ranch" but are now retired and would like to start donating the fruit to the Food Bank.  They have pears, apples, figs, pomegranates, walnuts, persimmons, grapes, peaches, nectarines and apricots.  Sounds like there will be fruit to harvest almost year-round.   ', '35.6120', '-120.5761', 'Backyard', NULL, 'Yes'),
(378, 'Harlow', 'back orchard', NULL, 'apples', '5 trees', 'owner', NULL, 'Yes', 'Harlow Family Orchard', NULL, '12', NULL, '10-30', 'Yes', 'some bugs', 'No', NULL, 'Carol Harlow', '805-434-2522 H', 'seb92438@gmail.com', NULL, '805-550-5189 C', NULL, NULL, NULL, NULL, '3575 Cloudy Meadow Rd', 'Templeton', 'CA', '93465', '3575 Cloudy Meadow Rd', 'Templeton', 'CA', '93465', NULL, 'Newspaper', 'Entered by Jeanine.\r\n\r\n(2)Fuji, (2)Gala, (1)Granny Smith.  Owns 2 orchard ladders.  Also, has persimmon and fig trees.\r\n\r\nCarol lives in Hidden Valley Ranch, off of 46-W.  Volunteers will need to call Carol on arrival and get a gate code to enter into the property.  She will meet volunteers to show them where the orchard and trees are located on her property.', '35.5344', '-120.7802', 'Backyard', NULL, 'Yes'),
(379, 'Stark', 'front of property', NULL, 'citrus', '5-10 trees', 'owner', NULL, NULL, NULL, 'Yes', '15', '3', '08-11', 'No', NULL, 'No', NULL, 'Jiordana Stark', '(805) 459-8848', 'jior8848@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '1505 Tiffany Ranch Road', 'Arroyo Grande', 'CA', '93420', '1505 Tiffany Ranch Road', 'Arroyo Grande', 'CA', '93420', NULL, 'Friend', 'Jiordana is a friend of Carolyn''s husband, Andy. We''ve been picking citrus at Jiordana and John''s house since we started in 2010... Jiordana''s notes about parking which you should confirm with each harvest: "Depending on number of vehicles, you can park to the left & right of the driveway just inside the front gate. And/or drive further up & take the driveway to the barn & park there. Either place gives you good access to the orchard. "', '35.1906', '-120.5667', 'Backyard', NULL, 'Yes'),
(380, 'Raitt', 'front yard', NULL, 'pluots', '1 tree', 'owner', NULL, NULL, NULL, NULL, '15', NULL, '09-03', 'No', NULL, 'No', NULL, 'Chloe Raitt', '805-423-1911 C', 'craitt@charter.net', NULL, '805-466-5862', NULL, NULL, NULL, NULL, '2160 Monterey Road', 'Atascadero', 'CA', '93422', '2160 Monterey Road', 'Atascadero', 'CA', '93422', NULL, 'Newspaper', 'Entered by Jeanine.  Chloe has one pluot tree.  Some fruit is accessible by standing on the ground, some is accessible by ladder.  She has orchard ladder, which volunteers can use.  When volunteers arrive they should knock on the front door to let the homeowners know they''ve arrived.  Chloe will show volunteers the tree, ladder and other info needed.', '35.5105', '-120.7051', 'Backyard', NULL, 'Yes'),
(381, 'FirstFruits Farm', 'south side', 'South SLO/Edna Valley', 'kale', '2 acres', 'other', 'Ken and Judi Peet', 'Yes', 'Darin Laity, FirstFruits Farm', NULL, '3', '1', '11-07', 'Yes', NULL, 'No', NULL, 'Darin Laity FirstFruits Farm', '805-234-7686', 'darin.laity@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '835 Serpa Ranch Rd', 'San Luis Obispo', 'CA', '93401', '835 Serpa Ranch Rd', 'San Luis Obispo', 'CA', '93401', NULL, 'GleanSLO volunteer', 'This is Firstfruits Farm, a non-profit, volunteer-run farm operation that provides fresh, organically grown fruits and vegetables to the Food Bank and several other outlets in the community of SLO.  We are always in need of additional farm help to harvest and maintain the farm operations.  This is our first year in operation and we''re still developing our organization.  Our primary harvest days are Wednesdays and Saturday mornings, and the harvest is supervised by one of our farm managers.  We would love to have your help for the rest of this season and beyond!', '35.2267', '-120.6417', 'Farm', NULL, 'Yes'),
(382, 'Rice', 'back yard at entranc', NULL, 'pears', 'about 30 pears', 'owner', NULL, NULL, NULL, NULL, '10', '4', '09-03', 'No', NULL, 'No', NULL, 'Laura Rice', '5450642', 'laura12252@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '1176 Pismo St', 'SLO', 'ca', '93401', '1176 Pismo St', 'SLO', 'CA', '93401', NULL, 'Other', 'I saw a sign for glean slo in someone''s yard and the pears are ready now. I can pick them if you will pick them up or tell me where to deliver.', '35.2807', '-120.6561', 'Backyard', NULL, 'Yes'),
(383, 'Miller', 'front, left of gate', NULL, 'assorted', '1/8 acre ', 'renter', NULL, NULL, NULL, NULL, NULL, NULL, '09-15', 'No', NULL, 'No', NULL, 'Jen Miller', '805-503-9860', 'jen.miller.ed@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '425 O''Connor Way ', 'SLO', 'CA', '93405', '425 O''Connor Way', 'SLO', 'CA', '93405', NULL, 'Friend', 'renter needs to be at property, gated entrance, dog', '35.2897', '-120.7162', 'Backyard', NULL, 'Yes'),
(384, 'Levesque', 'front yard', NULL, 'oranges', '1 tree', 'owner', NULL, NULL, NULL, NULL, '10', '5', '09-07', 'No', 'unknown', 'No', NULL, 'Carolyn Levesque', '805 489-9770', 'carolynalevesque@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '620 Victoria Way', 'Arroyo Grande', 'Ca', '93420', '620 Victoria Way', 'Arroyo Grande', 'CA', '93420', NULL, 'Other', 'You may take Meyer lemons from the tree in the front too.  They are very few navel oranges, but take them if you wish.  The tree w/the most is the valencia orange - please take all that look good.  I will leave a fruit picker [pole w/a metal "basket" on the end] for your use to get ones higher up in the tree. I''ve never used a ladder to pick the oranges.  They are either in reach by hand or w/my fruit picker [metal basket on a pole]\r\n\r\nI heard about you on NPR, I believe.\r\n\r\nDo you have any flyers or business cards?  This whole division over here has numerous orange trees and I bet some of these neighbors would also like to have their oranges picked - as I see them just falling on the ground like mine.  I''d be willing to take a flyer around to them and tell them about your program.', '35.1083', '-120.5983', 'Backyard', NULL, 'Yes'),
(385, 'Pier 46', NULL, NULL, 'seafood', NULL, 'other', NULL, NULL, NULL, NULL, NULL, NULL, '08-04', 'No', NULL, 'No', NULL, 'Eric Gonzales Pier 46', '805-434-1950', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1131 Rossi Rd', 'Templeton', 'CA', '93465', '1131 Rossi Rd', 'Templeton', 'CA', '93465', NULL, 'GleanSLO volunteer', 'Gail Mcnichols Oliver made this connection with Eric Gonzales and Gail picks up from the restaurant and takes it to the food bank. ', '35.5413', '-120.7157', 'Pickup', NULL, 'Yes'),
(386, 'Forage', NULL, NULL, 'pears', '~50 trees', 'owner', NULL, NULL, NULL, NULL, '15', '3', '09-12', 'No', NULL, 'No', NULL, 'Dr. James Forage', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '3365 See Canyon Road', 'San Luis Obispo', 'CA', NULL, NULL, ' ', 'Entered by Jeanine Lacore.  ', '35.2295', '-120.7435', 'Backyard', NULL, 'Yes'),
(388, 'Branch Mill Organic Farm', NULL, NULL, 'assorted', '10 acres', 'owner', NULL, 'Yes', 'Ruth Madocks Branch Mill Organic Farm', NULL, NULL, NULL, '01-10', 'No', NULL, 'No', 'certified organic', 'Ruth Madocks Branch Mill Organic Farm', '805-481-9205', 'rmadocks@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '2815 Branch Mill Road', 'Arroyo Grande', 'CA', '93420', '2815 Branch Mill Road', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Entered by Jeanine: Pull in the driveway, drive straight in, pass the greenhouses on the left, Ruth will probably be picking in the back field or working in the garage/workshop.\r\n\r\nP.S. Ruth is interested in creating a co-op/educational outreach structure with her organic farm in the next year or so.  Can we connect her with any people or groups that are doing this type of work?', '35.1506', '-120.5306', 'Pickup', NULL, 'Yes'),
(389, 'Suttle', 'back of house', NULL, 'lemons', 'one tree', 'owner', NULL, 'Yes', 'Joan Suttle', NULL, '10', '0', '05-23', 'No', NULL, 'No', NULL, 'Joan Suttle', '805-215-0995', 'joan.faubertsuttle@gmail.com', NULL, '805-215-9869', NULL, NULL, NULL, NULL, '173 Baker Ave', 'Shell Beach', 'CA', '93449', '173 Baker Ave', 'Shell Beach', 'CA', '93449', NULL, 'Newspaper', '"We need volunteers to pick the fruit."\r\n\r\nOwners don''t need to be home when a volunteer comes to pick, but would like to be notified ahead of time. Will need one 8 ft ladder and one volunteer.  The house is on the corner of Baker and Seacliff.  There is a gate on the Baker side of the street, light blue gate.  Enter here, the tree is right inside the gate. ', '35.1592', '-120.6835', 'Backyard', NULL, 'Yes'),
(390, 'Ikeda Brothers', NULL, NULL, 'kale', NULL, 'owner', NULL, NULL, NULL, NULL, '3', '1', '08-02', 'No', NULL, 'Yes', NULL, 'Tom Ikeda Brothers', '805-471-2526', 'maslin1@msn.com', NULL, NULL, NULL, NULL, NULL, NULL, 'P.O. Box 518', 'Oceano', 'CA', '93445', '2691 Produce Place', 'Arroyo Grande', 'CA', '93420', NULL, 'Other', 'entered by Jeanine Lacore', '35.0908', '-120.5944', 'Farm', NULL, 'Yes'),
(391, 'Williams', 'Back Yard', NULL, 'apples', '1 tree', 'owner', NULL, NULL, NULL, NULL, '10', '3', '10-10', 'No', NULL, 'No', NULL, 'Brenda Williams', '8054710808', 'brenda@macsuper.com', NULL, NULL, NULL, NULL, NULL, NULL, '1363 Sydney St', 'San Luis Obispo', 'CA', '93401', '1363 Sydney St', 'San Luis Obispo', 'CA', '93401', NULL, 'Web search', NULL, '35.2706', '-120.6449', 'Backyard', NULL, 'Yes'),
(392, 'Urquhart', 'near the shed', NULL, 'avocados', '1500-2000#s', 'owner', NULL, NULL, NULL, NULL, '30', '2', '05-28', 'No', NULL, 'Yes', NULL, 'Jerry Urquhart', '805-772-3720', 'urquhartavocados@aol.com', NULL, NULL, NULL, NULL, NULL, NULL, 'same', 'Morro Bay ', 'CA', '93442', '1281 Little Morro Creek Road', 'Morro Bay ', 'CA', '93442', NULL, 'SLO Food Bank', 'Pull into the driveway, cross the culvert and park by the shed on the right. Fruit is small because well ran dry, but the flavor is excellent.', '35.3885', '-120.8305', 'Farm', NULL, 'Yes'),
(393, 'Old Mission School', 'backyard', NULL, 'avocados & figs', '3-4 trees', 'owner', NULL, NULL, NULL, NULL, '0', '0', '10-28', 'No', NULL, 'No', NULL, 'Old Mission School', '543-6019', 'czehnder@omsslo.com', NULL, '801-3534', NULL, NULL, NULL, NULL, '761 Broad St', 'San Luis Obispo', 'CA', '93401', '776 Palm Str', 'San Luis Obispo', 'CA', '93401', NULL, 'Friend', NULL, '35.2814', '-120.6648', 'Backyard', NULL, 'Yes'),
(394, 'Badasci Farms', NULL, NULL, 'pomegranates', NULL, 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '10-24', 'No', NULL, 'No', NULL, 'Badasci Farms', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '9724 8 3/4', 'Hanford', 'CA', '93230', 'Thursday Farmers Market', 'San Luis Obispo', 'CA', NULL, NULL, ' ', 'Entered by Jeanine Lacore.  This is a vendor at the Thursday night Farmers'' Market.', '36.3336', '-119.6179', 'Market', NULL, 'Yes'),
(395, 'SLO VEG', NULL, NULL, 'assorted', 'CSA', 'owner', NULL, 'Yes', 'Dan Melton SLO VEG', NULL, NULL, NULL, '11-26', 'No', NULL, 'No', NULL, 'Dan Melton SLO VEG', '805-709-3094', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '225 Tank Farm Road Suite A4', 'San Luis Obispo', 'CA', '93401', '225 Tank Farm Road Suite A4', 'San Luis Obispo', 'CA', '93401', NULL, ' ', 'This is a pick-up of left over produce from the SLO VEG CSA', '35.2674', '-120.6538', 'Pickup', NULL, 'Yes'),
(396, 'Hisasue', '3 orchards', NULL, 'pears', 'approx.40 trees', 'owner', NULL, 'No', NULL, NULL, '20', '5', '08-28', 'Yes', 'peach leaf curl', 'Yes', 'copper spray', 'Carole Hisasue', '805 528-7506', 'hisasuemail@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '2837 Clark Valley Road', 'Los Osos', 'CA', '93402', '2837 Clark Valley Road', 'Los Osos', 'CA', '93402', NULL, ' ', 'Carole Hisasue\r\n\r\nThe types of fruit we produce (in abundance) are: plums, peaches, nectarines, apples and pears.\r\nThey are available for harvest from mid or late June to the end of October.\r\nIn the past, the apple moth quarantine prevented county-wide donation. I have not detected any problems with our apples but I know it is an issue in the area. We DO get peach leaf curl some years and spray a copper solution during the dormant season. That is the only crop getting sprayed.\r\nBecause of the quarantine, for the past 2 years, I have been picking our harvest and delivering to the Los Osos Food Bank distribution site, but there are limits to what one person can pick and deliver.\r\nIF people from GleanSLO are coming to our property, you MUST contact us first. The ranch is hard to find by address alone.', '35.2883', '-120.8052', 'Backyard', NULL, 'Yes'),
(397, 'Bittleston', 'front and back yard', 'San Luis Obispo', 'persimmons and oranges', '3 trees', 'owner', NULL, 'No', NULL, NULL, '20', '6', '10-20', 'No', NULL, 'No', NULL, 'Diana & Kent Bittleston', '805-541-4994', 'dianabittleston@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '638 Woodbridge St', 'San Luis Obispo', 'CA', '93401', '638 Woodbridge St', 'San Luis Obispo', 'CA', '93401', NULL, 'Other', 'No dogs, friendly neighbors, fruit is almost ripe on the tree', '35.2676', '-120.6561', 'Backyard', NULL, 'Yes'),
(398, 'Harlow', NULL, NULL, 'persimmons', '1 tree', 'owner', NULL, 'Yes', 'Harlow Family Orchard', NULL, '12', '4', '10-30', 'No', NULL, 'No', NULL, 'Carol Harlow', '805-434-2522', 'seb92438@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '3575 Cloudy Meadow Rd', 'Templeton', 'CA', '93465', '3575 Cloudy Meadow Rd', 'Templeton', 'CA', '93465', NULL, 'Newspaper', 'Entered by Jeanine.  Carol has a small orchard of apple, persimmon and fig trees.  She owns 2 orchard ladders.\r\n\r\nCarol lives in Hidden Valley Ranch, off of 46-W.  Volunteers will need to call Carol on arrival and get a gate code to enter into the property.  She will meet volunteers to show them where the orchard and trees are located on her property.', '35.5344', '-120.7802', 'Backyard', NULL, 'Yes'),
(399, 'Ikeda Brothers', NULL, NULL, 'kale', NULL, 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '11-19', 'No', NULL, 'Yes', NULL, 'Tom Ikeda Brothers', '805-471-2526', 'maslin1@msn.com', NULL, NULL, NULL, NULL, NULL, NULL, 'P.O. Box 518', 'Oceano', 'CA', '93475', '~769 Branch Mill Rd.', 'Arroyo Grande', 'CA', '93420', NULL, ' ', NULL, '35.1210', '-120.5639', 'Farm', NULL, 'Yes'),
(400, 'Laughton', 'backyard', NULL, 'assorted   ', '4 trees', 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '12-02', 'No', NULL, 'Yes', NULL, 'Kristin Laughton', '805-709-8060', 'klaughton@charter.net', NULL, NULL, NULL, NULL, NULL, NULL, '213 Via Bandolero', 'Arroyo Grande', 'CA', '93420', '213 Via Bandolero', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'Update as of 4/11/14--Kristin and her family no longer live at this property.  She suggested to approach the new owners to see if they would like to continue their relationship with GleanSLO.\r\n\r\nJen entered: No fence, so just come scope out the tree to test for quality control and when to harvest. She has a granny smith, lemon, orange, and grapefruit tree. ', '36.7783', '-119.4179', 'Backyard', NULL, 'Yes'),
(401, 'Musolff', 'sides of driveways', NULL, 'oranges', '8', 'owner', NULL, 'No', NULL, NULL, '20', NULL, '12-04', 'No', NULL, 'No', 'uses organic fertilizer', 'Caroline Musolff', '805-995-2180', 'bluebend@wildblue.net', NULL, NULL, NULL, NULL, NULL, NULL, '12480 Santa Rita Road', 'Cayucos', 'CA', '93430', '12480 Santa Rita Road', 'Cayucos', 'CA', '93430', NULL, 'Other', 'Entered by Jeanine.  These are Valencia oranges\r\n\r\nThis property does NOT have cell service!  Caroline and her brother own the land.  Her brother operates a commercial farm called, Old Creek Ranch.  She has ~8 orange trees on her property that are not being harvested for commercial use.  She would like help from GleanSLO volunteers to pick and donate it to the Food Bank.', '35.4769', '-120.8451', 'Farm', NULL, 'Yes'),
(402, 'Talley Farms', NULL, NULL, 'brussel sprouts', NULL, 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '12-12', 'No', NULL, 'No', NULL, 'Brian & Johnine Talley Farms', '(805) 235-9508', 'brian@talleyvineyards.com', NULL, NULL, NULL, NULL, NULL, NULL, 'P.O Box 360', 'Arroyo Grande', 'CA', '93421', '3031 Lopez Drive', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'Entered by Jeanine.  Contact Robert Meyer, 471-1847 or robert@talleyfarms.com', '35.1186', '-120.5907', 'Farm', NULL, 'Yes'),
(403, 'Forage', 'peach/nectarine orch', NULL, 'persimmons', '~5', 'owner', NULL, NULL, NULL, NULL, '15', '4', '11-12', 'No', NULL, 'No', NULL, 'Dr. James Forage', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2142 Ponticello Drive ', 'Henderson', 'NV', '89052', '3355 See Canyon Road', NULL, NULL, NULL, NULL, 'SLO Food Bank', 'Entered by Jeanine.  ', '35.2354', '-120.7424', 'Backyard', NULL, 'Yes'),
(404, 'San Luis Berry Farm', 'front', NULL, 'strawberries', '10 acres', 'owner', NULL, 'Yes', 'San Luis Berry Farm', NULL, '2', '2', '05-10', 'No', NULL, 'No', NULL, 'John Rourke San Luis Berry Farm', '805-440-4973', 'john@rourkefamily.com', NULL, NULL, NULL, NULL, NULL, NULL, '370 Hill St', 'San Luis Obispo', 'CA', '93405', 'Los Osos Valley Road & Foothill Blvd', 'San Luis Obispo', 'CA', '93405', NULL, 'Neighbor', 'By Jen: The entrance to the farm is the first left on O''Connor, coming from Foothill. There is a large San Luis Berry Farm sign. Do not pull in, park along O''Connor Way and be careful walking to the farm. Children are welcome to glean at this property. Please warn children and parents not to pull the fruit off the plants, tilt the fruit up to snap the stem. Walk only in the furrows. ', '35.2825', '-120.7090', 'Farm', NULL, 'Yes'),
(405, 'Broadhurst', NULL, NULL, 'oranges', NULL, 'owner', NULL, 'Yes', 'Mike & Carol Broadhurst', NULL, '8', '1', '02-20', 'No', NULL, 'No', NULL, 'Mike & Carol Broadhurst', '805-924-1260', 'mdbroadhurst@att.net', NULL, NULL, NULL, NULL, NULL, NULL, '6115 Santa Rosa Creek Road', 'Cambria', 'CA', '93428', '6115 Santa Rosa Creek Road', 'Cambria', 'CA', '93428', NULL, 'GleanSLO volunteer', 'General directions from Google maps are included below. Please look up directions ahead of time as there is NO CELL PHONE COVERAGE at this site and spotty GPS coverage. \r\n<br/>\r\n<br/>\r\nHere are detailed direction to the Dragon Spring Ranch\r\n<br/>\r\n<br/>\r\nTake Hwy 1 north (if coming from the south) and get off on Main Street which is the first exit in Cambria. At the stop light follow Main St. to the right which winds down to valley floor approximately 1 mile. \r\n<br/>\r\nYou will cross a small bridge over Santa Rosa Creek and turn RIGHT onto Santa Rosa Creek Road, passing Coast Union High School in 1/2 mile. It is rural road that narrows as you travel with several blind curves and some single car passage ways.\r\n<br/>\r\n<br/>\r\nApproximately 4 1/2 miles down Santa Rosa Creek Road is Dragon Spring Ranch tucked on the right side of the road. We will have the GleanSLO sign at the driveway and place to turn in. The 1/2 mile driveway has a  metal bridge over the small creek and turns into a dirt road. Continue straight ahead going up through citrus trees to the second house.  \r\n<br/>\r\n<br/>\r\n\r\nPlease note there are no restrooms at this site. Please wear a long sleeved shirt as a layer, recommended by the farmers, and wear sturdy shoes. We will have harvest bags to use. Let me know if you have questions. Thank you so much!', '35.5786', '-121.0043', 'Farm', NULL, 'Yes'),
(406, 'Cornucopia Fresh Market', 'at gate entrance', NULL, 'assorted', NULL, 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '11-18', 'No', NULL, 'No', NULL, 'Jennifer Babb-zwerg Cornucopia Fresh Market', '805-441-7915', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Crestmont Drive', 'San Luis Obispo', NULL, NULL, 'Crestmont Drive', 'San Luis Obispo', NULL, NULL, NULL, 'SLO Food Bank', 'Entered by Jeanine.  Jennifer called the Food Bank to have them do a small pick up.  They passed it on to GleanSLO.  The donation is between 10-30 lbs and has been taken to Salvation Army.', '35.2256', '-120.6310', 'Pickup', NULL, 'Yes'),
(407, 'Ross', NULL, NULL, 'tangerines', '1 tree', 'owner', NULL, NULL, NULL, NULL, NULL, NULL, '12-02', 'No', NULL, 'No', NULL, 'Steve & Mary Lou Ross', '805-481-1131', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '211 Garden St.', 'Arroyo Grande', 'CA', '93420', '211 Garden St.', 'Arroyo Grande', 'CA', '93420', NULL, 'SLO Food Bank', 'Mary Lou contacted GleanSLO (Jeanine) to have a couple volunteers come out and harvest tangerines from their house.  They donated over 300 lbs of oranges in Feb 2013, which Chuck harvested. ', '35.1242', '-120.5708', 'Backyard', NULL, 'Yes'),
(413, 'Ruland', 'backyard', NULL, 'oranges', '1 tree', 'renter', 'Steve Ferrario - 805-215-3350', 'Yes', 'Brianna Ruland', NULL, '25', '4', '01-09', 'No', 'none that are known', 'No', 'unknown', 'Brianna Ruland', '760-803-7495', 'brijeanruland@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '25357 Poderio Dr', 'Ramona', 'Ca', '92065', '532 Cuesta Dr', 'San Luis Obispo', 'CA', '93405', NULL, 'GleanSLO volunteer', 'Contact Leah, current roommate, at 831-227-8699 to schedule a glean.\r\n\r\nThe crop can be reached through either one of the exterior side gates. Right now approx 150 oranges are ripe and too high for me to reach. However, it would be best if you came in 2-3 weeks because we have a couple hundred that should be ripe and ready by then. Thank you! ', '35.2968', '-120.6772', 'Backyard', NULL, 'Yes'),
(409, 'Rippner', 'Main orchard', NULL, 'persimmons', '1 tree', 'owner', NULL, 'No', NULL, 'Yes', '15', '1', '10-30', 'No', NULL, 'No', NULL, 'Sharon Rippner', '805-909-0405', 'Srippner@msn.com', NULL, '805-595-9629', NULL, NULL, NULL, NULL, '6448 Squire Court', 'San Luis Obispo', 'Ca', '93401', '6448 Squire Court', 'San Luis Obispo', 'CA', '93401', NULL, 'GleanSLO volunteer', 'Entered by Jen: Owner will be available to help if other than a Thursday morning or Wednesday afternoon. One or two volunteers with 2 ladders (8'' and 10'') and clippers. Owner estimated harvest size at 6 boxes. ', '35.1972', '-120.6847', 'Backyard', NULL, 'Yes'),
(410, 'Turnier', 'backyard', NULL, 'oranges   ', '1 tree', 'owner', NULL, NULL, NULL, NULL, '10', '3', '12-13', 'No', NULL, 'No', NULL, 'Lorna Turnier', '543-9393', 'turnier@tcsn.net', NULL, '550-6375', NULL, NULL, NULL, NULL, '244 Lincoln St.', 'San Luis Obispo', 'CA', '93405', '244 Lincoln St.', 'San Luis Obispo', 'CA', '93405', NULL, 'Friend', 'These are mandarin oranges.  I also have a persimmon tree that is loaded with fruit and should be picked', '35.2883', '-120.6666', 'Backyard', NULL, 'Yes');
INSERT INTO `sites-newtemplate` (`ID_site`, `farm`, `location`, `region`, `crops`, `size`, `property_rel`, `landlord`, `recog`, `recog_text`, `sign`, `height`, `lowest`, `when_ripe`, `disease`, `disease_text`, `spray`, `spray_text`, `contact1`, `phone1`, `email1`, `contact2`, `phone2`, `email2`, `contact3`, `phone3`, `email3`, `maddress`, `mcity`, `mstate`, `mzip`, `address`, `city`, `state`, `zip`, `website`, `howhear`, `otherinfo`, `latitude`, `longitude`, `venue`, `authdate`, `Active`) VALUES
(411, 'Turnier', 'backyard', NULL, 'persimmons', '1', 'owner', NULL, NULL, NULL, 'Yes', '15', '6', '12-13', 'No', NULL, 'No', NULL, 'Lorna Turnier', '805-543-9393', 'turnier@tcsn.net', NULL, '805-550-6375', NULL, NULL, NULL, NULL, '244 Lincoln St.', 'San Luis Obispo', 'CA', '93405', '244 Lincoln St.', 'San Luis Obispo', 'CA', '93405', NULL, 'Friend', 'Entered by Jeanine.  Lorna first contacted GleanSLO because she has a mandarin orange tree.  When Jeanine went to scout the property she saw the loaded Hachiya persimmon tree. Lorna wasn''t sure we would want this variety of persimmons.  \r\n\r\nLorna has two regular ladders (6 ft and 8 ft).  Gleaners will need an 8 ft and 10 ft ladders in addition to a bag pole-picker to reach all of the persimmons.', '35.2883', '-120.6666', 'Backyard', NULL, 'Yes'),
(412, 'Mcgovern', 'side yard', NULL, 'citrus', '3 trees', 'renter', NULL, 'Yes', 'Bridget Mcgovern', NULL, '6', '1', '03-08', 'No', NULL, 'No', NULL, 'Bridget Mcgovern', '805-602-2071', 'briamcgovern@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '3057 South Higuera St. 201', 'San Luis Obispo', NULL, '93401', '3057 South Higuera St. 201', 'San Luis Obispo', NULL, '93401', NULL, 'Other', 'Entered by Jeanine.  \r\n\r\nThe homeowner has raised beds that she''s offered for others to plant and grow.  \r\n\r\nShe has one lemon, one lime and one nectarine, plus 3 unidentified fruit trees.', '35.2579', '-120.6673', 'Backyard', NULL, 'Yes'),
(414, 'Krupp', 'front yard', NULL, 'lemons', '1 tree (60 lbs)', 'renter', NULL, 'Yes', 'Katie Krupp', 'Yes', '5', '1', '03-08', 'No', NULL, 'No', NULL, 'Katie Krupp', '547-9224', 'ckrupp@calpoly.edu', NULL, NULL, NULL, NULL, NULL, NULL, '654 Islay St', 'San Luis Obispo', 'CA', '93401', '654 Islay St', 'San Luis Obispo', 'CA', '93401', NULL, 'GleanSLO volunteer', NULL, '35.2748', '-120.6620', 'Backyard', NULL, 'Yes'),
(415, 'Dalebout', 'Back yard', NULL, 'citrus', '20 trees', 'owner', NULL, 'No', NULL, NULL, '6', '2', '01-01', 'No', NULL, 'No', NULL, 'Ken & Angela Dalebout', '714-308-3603', 'kdalebout@gmail.com', NULL, '949-246-1210', NULL, NULL, NULL, NULL, '2775 Coast View Dr ', 'Arroyo Grande', 'CA', '93420', '2775 Coast View Dr', 'Arroyo Grande', 'CA', '93420', NULL, 'SLO Food Bank', '1/27/14--Jeanine went and scouted the property.  She met Angela who said that her and her teenage kids could start picking the fruit to donate.  She wanted to make sure that the Food Bank wanted the lemons and oranges, even though they are small.  I reassured her we would be happy to accept the donation.  She is going to harvest them with her kids and contact us when they''re ready to be picked up.  If she finds the workload to be too much, she''ll get in contact to have GleanSLO volunteers come help.\r\n\r\nEnter off of Los Berros.  Gated community, code=1226\r\n\r\nThere are 21 orange, lemon and grapefruit trees.  They have not been consistently harvested.  The trees are along the hillside along Pleasant Lane n the backside of my property.  The trees are planted on a hillside so it is a little more difficult to glean.', '35.1090', '-120.5677', 'Backyard', NULL, 'Yes'),
(416, 'Anderson', 'backyard', NULL, 'oranges', '1 tree', 'owner', NULL, 'Yes', 'Adele Anderson', NULL, '9', '6', '03-08', 'No', NULL, 'No', NULL, 'Adele Anderson', '805 541-6474', 'anderson538@att.net', NULL, '805 471-0960', NULL, NULL, NULL, NULL, '538 Felton Way', 'San Luis Obispo', 'CA', '93405', '538 Felton Way', 'San Luis Obispo', 'CA', '93405', NULL, 'Newspaper', '2/4/14--Jeanine spoke with Adele and she will pick her own fruit and donate it at the drop site for the city-wide fruit drive on March 8th. \r\n\r\nLots of oranges ready to pick now!\r\nEast access', '35.2973', '-120.6763', 'Backyard', NULL, 'Yes'),
(417, 'Williams', 'sideyard', NULL, 'grapefruits', '1 tree', 'owner', NULL, 'Yes', 'Frankie Williams', NULL, '12', '6', '03-08', 'No', NULL, 'No', NULL, 'Frankie Williams', '805-543-4754', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '3057 South Higuera St. #186', 'San Luis Obispo', 'CA', '93401', '3057 South Higuera St. #186', 'San Luis Obispo', 'CA', '93401', NULL, 'Neighbor', 'Entered by Jeanine.  Bridget McGovern (GleanSLO donor) is neighbor''s with Frankie and introduced me to her when I was over picking lemons at Bridget''s home.  Frankie is okay with us picking the grapefruit whenever, but would like to be notified when we''re coming.  \r\n\r\nIt is a yellow grapefruit, medium size tree.  They don''t eat any of it...all ripe fruit can be harvested. Volunteer(s) will need 10 foot ladder and pole picker.  There is an estimated 100 lbs of grapefruits.', '35.2579', '-120.6673', 'Backyard', NULL, 'Yes'),
(418, 'CA Rare Fruit Growers Orchard', NULL, 'San Luis Obispo', NULL, NULL, 'other', NULL, 'Yes', 'Dr. Joe Sabol CA Rare Fruit Growers Orchard', NULL, NULL, NULL, '08-23', 'No', NULL, 'No', NULL, 'Dr. Joe Sabol CA Rare Fruit Growers Orchard', '805-544-1056', 'jsabol@calpoly.edu', NULL, NULL, NULL, NULL, NULL, NULL, 'Highland Drive and Mt. Bishop Road', NULL, 'CA', NULL, 'Highland Drive and Mt. Bishop Road', 'San Luis Obispo', 'CA', '93405', NULL, ' ', 'Entered by Jeanine.  This venue will be used as our space for the Neighborhood Harvest Leader Training on Feb. 22, 2014.  We spoke with Dr. Sabol to confirm the details.', '35.3024', '-120.6678', 'Backyard', NULL, 'Yes'),
(420, 'Diaz', 'side yard', NULL, 'grapefruits', '1 tree', 'owner', NULL, 'Yes', 'Paulette Diaz', 'Yes', '10', '2', '03-08', 'No', NULL, 'No', NULL, 'Paulette Diaz', '805-544-2670', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1446 Lizzie St.', 'San Luis Obispo', 'CA', '93401', '1446 Lizzie St.', 'San Luis Obispo', 'CA', '93401', NULL, ' ', 'Entered by jeanine--This is Paulette''s second year donating at our city-wide fruit drive.  ONLY PICK THE GRAPEFRUIT TREE. Please be careful of the sloped yard when setting up ladders.', '35.2797', '-120.6498', 'Backyard', NULL, 'Yes'),
(421, 'Thorpe', 'Behind home', NULL, 'lemons', '1 tree', 'owner', NULL, 'Yes', 'Shawn Thorpe', NULL, '15', '0', '03-08', 'No', NULL, 'No', NULL, 'Shawn Thorpe', '805-786-4337', 'shawn@phantompower.org', NULL, NULL, NULL, NULL, NULL, NULL, '1121 Orcutt Road space #8', 'San Luis Obispo', 'CA', '93401', '1121 Orcutt Road space #8', 'San Luis Obispo', 'CA', '93401', NULL, 'Newspaper', 'I live in a blue/white mobile home in the Oceanaire Village Mobile Home Park. Turn at entrance with the ''Oceanaire'' sign, 2nd one on the left.  The lemon tree right behind my unit has been very productive and I''ve been giving lemons away all over the place. There are some on the ground now and likely more on the tree. Not sure of the entire yield right now but I can usually get at least 10 at a time when it looks like this.', '35.2604', '-120.6418', 'Backyard', NULL, 'Yes'),
(422, 'Olmos', 'west sideyard', NULL, 'lemons', '1 tree', 'owner', NULL, 'Yes', 'Kristina Olmos', NULL, '15', '5', '03-08', 'No', NULL, 'No', NULL, 'Kristina Olmos', '805-234-5709', 'olmoskristina@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '916 West Street', 'San Luis Obispo', 'CA', '93405', '916 West Street', 'San Luis Obispo', 'CA', '93405', NULL, 'Friend', 'The homeowner knows volunteer, Ina-yoko Teutenberg, and would like her to come help pick.\r\n\r\nOur neighbors across the street have some interesting pomelo type fruit they''d like you to take. We will probably just pick them ourselves and leave a box near our tree for you to take. ', '35.2902', '-120.6683', 'Pickup', NULL, 'Yes'),
(423, 'Dolan', 'side yard', NULL, 'oranges', '3 trees', 'owner', NULL, 'Yes', 'Nora Dolan', NULL, '6', NULL, '03-08', 'No', NULL, 'No', NULL, 'Nora Dolan', '415-845-7465', 'nkabat@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '285 Chaplin Lane', 'San Luis Obispo', 'CA', '93405', NULL, 'Other', 'UPDATE 10/2014--OWNERS MOVED. \r\n\r\n4-5 brown bags. Take whatever citrus that ripes.\r\n\r\nPlease come get the oranges! They produce a lot and so much goes to waste.  Also, we can pick the trees and bring them somewhere if that is easier.  We are happy to do that!', '0.0000', '0.0000', 'Backyard', NULL, 'Yes'),
(424, 'Cohen', 'back yard', NULL, 'oranges', '1 tree', 'other', NULL, 'Yes', 'Beverly Cohen', NULL, '7', '5', '03-08', 'No', NULL, 'No', NULL, 'Beverly Cohen', '805-545-5868', 'beverly423@gmail.com', NULL, '818-636-3639', NULL, NULL, NULL, NULL, '993 Bluebell Way', 'San Luis Obispo', 'CA', '93401', '992 Bluebell Way', 'San Luis Obispo', 'CA', '93401', NULL, 'Neighbor', 'I live across the street and owners are in Arizona, but said I should have you do this when you can.\r\nThere are not a lot of oranges left, but definitely enough to make a trip worthwhile, I believe.', '35.2494', '-120.6367', 'Backyard', NULL, 'Yes'),
