(427, 'Woelper', 'rear yard', NULL, 'limes and  tangerines', 'loaded', 'owner', '1 large, tall tree each', 'Yes', 'Sally Woelper', NULL, '15', '3', '03-17', 'No', NULL, 'Yes', 'horticulture oil', 'Sally Woelper', '805-440-9894', 'swoelper@att.net', NULL, NULL, NULL, NULL, NULL, NULL, '2747 Northview Ave', 'Arroyo Grande', 'CA', '93420', '2747 Northview Ave', 'Arroyo Grande', 'CA', '93420', NULL, 'Newspaper', 'Fruit is at peak now, dropping.  Want some left on lower branches.  Thanks', '35.0729', '-120.5893', 'Backyard', NULL, 'Yes'),
(428, 'Ikeda Brothers', NULL, NULL, 'bok choy', NULL, 'owner', NULL, 'Yes', 'Tom Ikeda Brothers', NULL, NULL, NULL, '08-02', 'No', NULL, 'No', NULL, 'Tom Ikeda Brothers', '805-471-2526', 'maslin1@msn.com', NULL, NULL, NULL, NULL, NULL, NULL, 'P.O. Box 518', 'Oceano', 'CA', '93475', '1098 Huasna Rd', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'Entered by Jeanine.  Bok choy glean with Tom Ikeda and MCP.', '35.1269', '-120.5620', 'Farm', NULL, 'Yes'),
(430, 'Edwards', 'side yard', NULL, 'oranges', '3 trees', 'renter', NULL, 'Yes', 'Khrisana Edwards', NULL, '10', '5', '03-31', 'No', NULL, 'No', NULL, 'Khrisana Edwards', '512-680-5500', 'khrisana@icloud.com', NULL, NULL, NULL, NULL, NULL, NULL, '1801 Woodland Drive', 'San Luis Obispo', 'CA', '93401', '1801 Woodland Drive', 'San Luis Obispo', 'CA', '93401', NULL, 'Web search', 'Valencias? Two medium size and one smaller tree.  Renters will be moving by spring 2015.  Will pass along the information about GleanSLO to next renter.\r\n\r\nAs you drive up Woodland, veer to the right.  The house is located just past the "private road" gate.  3 friendly dogs, but will be kept inside.  No fence.\r\n\r\n3/21/13 Scout Notes from Kelly Munoz:\r\nHeights? Tree 1=12ft Tree 2=4ft\r\nTree 3=6ft\r\nTerrain? Sloped, some fencing against tree 1\r\nBuildings? None that will interfere with glean\r\nAnimals? Friendly dogs inside.\r\nOther? Come anytime. No notice necessary. Whenever is convenient. Asked to take all!\r\n', '35.2786', '-120.6452', 'Backyard', NULL, 'Yes'),
(431, 'Eister', 'front yard', NULL, 'avocados', '1 mature tree', 'owner', NULL, 'Yes', 'Mary & Gary Eister', 'Yes', '30', '8', '04-04', 'No', NULL, 'No', NULL, 'Mary & Gary Eister', '805-473-0672', 'meister@fix.net', NULL, NULL, NULL, NULL, NULL, NULL, '815 Willow Lane', 'Arroyo Grande', 'CA', '93420', '815 Willow Lane', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'The avocados are in various stages of development. I want only those which are big to be picked. At a later date, we could set up a pick date for matured avocados. Tree is easy access and plenty of parking. I would like to be present.\r\n\r\nNOTE: My address is Willow LANE, about 1/2 mile from the AG Community Hospital, not Willow Road on the Mesa. Cross street: Halcyon\r\n\r\nChuck''s scouting notes: \r\nMassive tree with lots of foliage makes seeing fruit difficult. Variety of sizes is hard to differinciate which to pick or leave. Owner says the tree will be cut way back sometime after harvest. Tree starts at 8ft on low side but most of tree starts at 10ftand goes as high as25-30ft. Owner has a poll picker we can borrow. I suggest 4 people w/10ft ladders and our three basket pickers and two extention poll pickers for back up. Bring 12 boxes. Have owner leave gate unlocked that morning.', '35.1083', '-120.5892', 'Backyard', NULL, 'Yes'),
(432, 'Gardner', 'Front yard/driveway', NULL, 'oranges', '2 trees ', 'landlord', 'California West - 805-543-9119', 'No', NULL, NULL, '0', '5', '02-01', 'No', NULL, 'No', 'Nothing is done', 'Kacy Gardner', '805-441-9548', 'mailkacy@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '865 Walnut Street #3', 'San Luis Obispo', 'CA', '93401', '865 Walnut Street #3', 'San Luis Obispo', 'CA', '93401', NULL, 'GleanSLO volunteer', 'There are only 2 trees, but at certain times of the year they produce enough oranges for 4-8 families. \r\nI marked Feb. however they produce almost year round. \r\nThere is also a persimmon tree next door, and in the 1st unit (triplex) they also have 1 orange tree and their''s is a little better than mine. I recommend asking if they are on board as I feel they would be willing. ', '35.2840', '-120.6654', 'Pickup', NULL, 'Yes'),
(433, 'Gulino', 'back yard', NULL, 'oranges and lemons', '2 trees', 'owner', NULL, 'Yes', 'Rick & Sara Gulino', 'Yes', '15', '10', '06-27', 'No', NULL, 'No', NULL, 'Rick & Sara Gulino', '(805) 540-9677', 'rickg@pshhc.org', NULL, NULL, NULL, NULL, NULL, NULL, '819 Turquoise Drive', 'Arroyo Grande', 'CA', '93420', '819 Turquoise Drive', 'Arroyo Grande', 'CA', '93420', NULL, 'Other', 'Ground is flat, ladders are needed.  Orange tree overhangs on neighbor''s yard, blocked by a shed.', '35.1044', '-120.5844', 'Backyard', NULL, 'Yes'),
(434, 'Zolisch', 'front yard', NULL, 'lemons', '1 tree', 'owner', NULL, 'Yes', 'Eunice Zolisch', NULL, '12', NULL, '11-24', 'No', NULL, 'No', NULL, 'Eunice Zolisch', '805-489-5694', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1460 Huntington Ave', 'Grover Beach', NULL, '93433', '1460 Huntington Ave', 'Grover Beach', NULL, '93433', NULL, ' ', 'Chuck''s scouting notes:\r\ntwo people, two 10ft ladders 12 boxes. Also bring the regular 8ft aluminum ladder to use over the fence,(dead space between properties) is flat. Eunice wants to be there and does want a receipt at some point.. Large healthy looking tree in planter by fence makes the fruit ladders be on two levels with so fruit over fence. Bring one 8ft ladder just in case it can be used underneath.', '35.1124', '-120.6138', 'Backyard', NULL, 'Yes'),
(435, 'Yarnell', 'side', NULL, 'lemons', '1', 'owner', NULL, 'Yes', 'Shaye Yarnell', NULL, '8', '4', '04-08', 'No', NULL, 'No', NULL, 'Shaye Yarnell', '805 489-9702', 'shayeyarnell@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '1940 Chesapeake Place', 'Arroyo Grande', 'CA', '93420', '1940 Chesapeake Place', 'Arroyo Grande', 'CA', '93420', NULL, 'Newspaper', 'I have only one lemon tree, but it bears a LOT of fruit.  We can only use a little bit and the rest falls to the ground and rots.  Please let me know if you are interested.', '35.0668', '-120.5572', 'Backyard', NULL, 'Yes'),
(436, 'Pigeon', 'Front Yard', NULL, 'lemons', '1 tree', 'owner', NULL, 'Yes', 'Scott & Susan Pigeon', NULL, '16', '4', '09-10', 'No', NULL, 'No', NULL, 'Scott & Susan Pigeon', '805-481-4843', 'louson@sbcglobal.net', NULL, NULL, NULL, NULL, NULL, NULL, '540 Newport Ave', 'Grover Beach', 'CA', '93433', '540 Newport Ave', 'Grover Beach', 'CA', '93433', NULL, 'Flyer', 'Leave about a dozen or two.  ', '35.1253', '-120.6244', NULL, NULL, 'Yes'),
(437, 'Master Gardeners Demo Garden', 'Demonstration garden', NULL, 'assorted', '> 1 acre', 'owner', NULL, 'Yes', 'Maria Murrietta Master Gardeners Demo Garden', NULL, '8', '1', '09-19', 'No', NULL, 'No', 'Copper fungicide on stone', 'Maria Murrietta Master Gardeners Demo Garden', '805-781-5946', 'mmurrietta@co.slo.ca.us', NULL, NULL, NULL, NULL, NULL, NULL, '2156 Sierra Way, Suite C', 'San Luis Obispo', 'CA', '93401', '2156 Sierra Way', 'San Luis Obispo', 'CA', '93401', NULL, ' ', 'This is the Master Gardener''s demo garden, which is a part of the UC Cooperative Extension.  Jeanine contacted Mary Bianchi, the County Director & Horticulture Advisor of San Luis Obispo and Santa Barbara Counties, in early March 2014.  A group of lead gardeners, Mary Bianchi, Maria Murrietta (Agricultural Technician & Master Gardener Coordinator), Harvest leader Deborah Berger and Jeanine met at the garden on 3/20 to discuss the details.  We decided that the lead Master gardeners will contact the GleanSLO coordinator who will then contact a harvest leader to go to the garden and harvest the fruits and/or veggies.  At the end of the year, we will send Mary and Maria the total poundage as well as the agencies who received the produce so they can report it to their higher-ups.  We also discussed using the fruits and veggies for the UC Cooperative Food preservation workshops led by Christine Nelson.', '35.2740', '-120.6472', 'Pickup', NULL, 'Yes'),
(438, 'Musselman', NULL, NULL, 'lemons', '~100 pounds', 'owner', NULL, 'Yes', 'Marty Musselman', NULL, NULL, NULL, '04-04', 'No', NULL, 'No', NULL, 'Marty Musselman', '860-989-7001', 'martym2021@yahoo.com', NULL, '805-202-8375', NULL, NULL, NULL, NULL, '609 Myrtle Street', 'Arroyo Grande', 'CA', '93420', '609 Myrtle Street', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Entered by Jeanine.  Marty is a GleanSLO volunteer who has her own lemon tree. She harvested the fruit and brought it to donate to the Food Bank.', '35.1236', '-120.5702', 'Pickup', NULL, 'Yes'),
(439, 'Baxter', 'back yard', NULL, 'lemons', '1 tree', 'owner', NULL, 'Yes', 'Rosemary Baxter', NULL, '14', '4', '04-11', 'No', NULL, 'No', NULL, 'Rosemary Baxter', '805-543-3566', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'same', 'San Luis Obispo', 'CA', '93405', '1768 Pereira Dr', 'San Luis Obispo', 'CA', '93405', NULL, 'Newspaper', 'The gate to the backyard is broken and propped from the inside so Rosemary will need to be home to let volunteers into the backyard.  She has one ladder that can be used. ', '35.2558', '-120.6879', 'Backyard', NULL, 'Yes'),
(440, 'Sinsheimer Elementary', NULL, NULL, 'citrus', NULL, 'other', NULL, NULL, NULL, NULL, NULL, NULL, '05-14', 'No', NULL, 'No', NULL, 'Sinsheimer Elementary', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2755 Augusta Street', 'San Luis Obispo', 'CA', '93401', '2755 Augusta Street', 'San Luis Obispo', 'CA', '93401', NULL, ' ', 'Jeanine began working with a group of Parks & Rec site specialist in the Spring of 2014.\r\n\r\nThe Parks & Rec Club Star program at Sinsheimer lead by site specialist, Andrea Anderson, will host a School Fruit Drive during their after-school hours. \r\n\r\nAndrea''s contact information:  aanderso@slocity.org and 805-540-9916', '35.2681', '-120.6441', 'Pickup', NULL, 'Yes'),
