(447, 'Schiebelhut', 'near garage/driveway', NULL, 'citrus', '1 tree', 'owner', NULL, 'Yes', 'Louise Schiebelhut', NULL, '12', '2', '11-20', 'No', NULL, 'No', NULL, 'Louise Schiebelhut', '(805)541-6465', 'schiebelhuta@yahoo.com', NULL, '805-440-3738', NULL, NULL, NULL, NULL, '3033 Biddleranch Rd', 'San Luis Obispo', 'CA', '93401', '3033 Biddleranch Rd', 'San Luis Obispo', 'CA', '93401', NULL, 'Friend', 'Entered by Jen: Once on the driveway, pass the mobile home and the tree is by garage along the driveway. There are other citrus trees, but for now, we''ll just pick pink grapefruit. Talk to Louise about other fruit if it''s available. She may want some grapefruit left on the tree. She has short 6'' ladders to lend. ', '35.2168', '-120.6015', 'Backyard', NULL, 'Yes'),
(448, 'Presley', 'back yard', NULL, 'lemons', '1 tree', 'renter', 'Renter at mobile home park', 'Yes', 'First name and first initial of last name: Betty P.', NULL, '10', '5', '11-25', 'No', NULL, 'No', NULL, 'Betty Presley', '805-489-5756', NULL, NULL, 'C 805-441-2104 ', NULL, NULL, NULL, NULL, '1241 Farroll Ave. #26', 'Arroyo Grande', 'CA', '93420', '1241 Farroll Ave. #26', 'Arroyo Grande', 'CA', '93420', NULL, 'Flyer', 'Entered by Jeanine.  Volunteers can pull into the driveway. The tree is located in on the back of the property. Pick all of the fruit on the top of the tree, but leave about 3-4 dozen for the homeowner.  There''s a cinder block step up on the back side of the tree. \r\n\r\n', '35.1094', '-120.6035', 'Backyard', NULL, 'Yes'),
(449, 'Mallard Lake Ranch', NULL, NULL, 'avocados', NULL, 'owner', NULL, 'Yes', 'Bob Criswell Mallard Lake Ranch', NULL, NULL, NULL, '04-17', 'No', NULL, 'No', NULL, 'Bob Criswell Mallard Lake Ranch', '805-705-7993', 'info@mallardlakeranch.com', NULL, NULL, NULL, NULL, NULL, NULL, 'P.O. Box 973', 'Nipomo', 'CA', '93444', '1188 Osage Road', 'Nipomo', 'CA', '93444', NULL, ' ', 'Entered by Jeanine.  Bob contacted Carolyn to let us know he has 30-40 boxes of Zutano avocados to donate.\r\nBob Criswell, wife Kristin (pronounced Kerstin), parents Jane and Don  home:(805) 689-3245\r\n\r\n', '35.0232', '-120.5120', 'Pickup', NULL, 'Yes'),
(450, 'Barnes', NULL, NULL, 'assorted', '22 trees', 'owner', NULL, 'Yes', 'Pam & Terry Barnes', NULL, '9', '3', '05-24', 'No', NULL, 'No', NULL, 'Pam & Terry Barnes', '310-963-5600', 'npbarnes@gmail.com', NULL, '310-739-9777', NULL, NULL, NULL, NULL, '615 Camino Vina', 'Paso Robles', 'CA', '93446', '615 Camino Vina', 'Paso Robles', 'CA', '93446', NULL, 'SLO Food Bank', 'Entered by Jeanine.  Scouted by Heather Morrow and Erin Younger. On the east of Paso behind Cass Winery.  Pam and Terry have 22 fruit trees and 4 raised beds.  1 Apricot tree\r\n4-5 Plum trees (Both ready first around June)\r\n3 Apple trees\r\n3 Quince trees\r\n1 Doughnut peach tree\r\n4 Raspberry bushes\r\n4 pomegranate bushes\r\n1 almond tree\r\na few table grapes\r\n1 fig\r\nand 4 raised beds, 2 with herbs and tomatoes growing now (Pam mentioned she''d be willing to plant anything we requested in the other boxes)\r\n\r\nSince things will be ripening sporadically I think we would just need 2-4 gleaners. \r\nProbably 3-4 small harvest sessions\r\n1-2 small ladders or step stools needed. Fruit will not be very high, 7'' at max. Ground is pretty flat and stable all around\r\nThere is plenty of parking, \r\nNothing has been sprayed\r\n\r\nThey will call us and let us know a week or so before things are ready to be gleaned.', '35.6198', '-120.5657', 'Backyard', NULL, 'Yes'),
(451, 'Plakias', 'front yard', NULL, 'oranges', '1 tree', 'owner', NULL, 'Yes', 'The Plakias Family', NULL, '10', '5', '05-01', 'Yes', 'black dust on some leaves', 'Yes', NULL, 'Vanessa Plakias', '805-550-7215', 'vplakias88@hotmail.com', NULL, '805-434-7069', NULL, NULL, NULL, NULL, '466 Sandercock St.', 'San Luis Obispo', 'CA', '93401', '466 Sandercock St.', 'San Luis Obispo', 'CA', '93401', NULL, 'GleanSLO volunteer', 'Careful for the garden underneath the tree.  i.e., succulents, strawberries, grass...and please leave a third of the fruit on the tree for our family :)', '35.2714', '-120.6620', 'Backyard', NULL, 'Yes'),
(452, 'CAPSLO Kitchen', NULL, NULL, NULL, NULL, 'other', NULL, 'No', NULL, NULL, NULL, NULL, '01-01', 'No', NULL, 'No', NULL, 'Chef Dave Schmidt CAPSLO Kitchen', '952-250-3022', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1030 Southwood Drive', 'San Luis Obispo', 'CA', '93401', '230 Leeward Avenue', 'Pismo Beach', 'CA', '93449', NULL, 'SLO Food Bank', 'Entered by Jeanine.  4/30/14--Jeanine spoke with Chef Dave to arrange for a donation of gleaned strawberries to be processed into sauce/jam at the commercial kitchen in Shell Beach.  CAPSLO serves meals 7 Days/week. 6 AM breakfast & 4:30 PM to 5:30 PM dinner at Prado Day Center\r\n', '35.1546', '-120.6696', NULL, NULL, 'Yes'),
(453, 'Escartin', 'back & side yard', NULL, 'oranges and lemons', '3 trees', 'renter', NULL, 'Yes', 'Chumash Village Mobil Home Park', 'Yes', '6', '0', '05-15', 'Yes', 'black fungus on lemon tre', 'No', NULL, 'Christine Escartin', '805-786-4531', 'chrisescartin@yahoo.com', NULL, '805-48-2711', NULL, NULL, NULL, NULL, '3057 S. Higuera St, #47', 'San Luis Obispo', 'CA', '93401', '3057 S. Higuera St, #47', 'San Luis Obispo', 'CA', '93401', NULL, 'Newspaper', 'The tress are easy to get to.  The lemon tree is in space 47 and the 2 orange trees are next door to me at space 48.  My neighbor in 48 gives me permission to have her trees picked, too.  There are no dogs at either property.  The ground is level with gravel.  You can park in front of either mobil home.', '35.2579', '-120.6673', 'Backyard', NULL, 'Yes'),
(454, 'Talley Farms', 'near the main ranch', NULL, 'beets', NULL, 'owner', NULL, 'Yes', 'Talley Farms', NULL, '1', NULL, '05-24', 'No', NULL, 'No', NULL, 'Brian & Johnine Talley Farms', '(805) 235-9508', 'brian@talleyvineyards.com', NULL, NULL, NULL, NULL, NULL, NULL, '3031 Lopez Drive', 'Arroyo Grande', 'CA', '93420', '2900 Lopez Drive', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'Park at the Main Ranch on Talley Farm Rd. The Main Ranch is where crops for the CSA are grown. From Lopez Rd, turn RIGHT on Talley Farm Rd, about 200ft past Orcutt Rd. Follow Talley Farm Rd to the main ranch. Crop is very close to the main ranch building. ', '35.1810', '-120.5265', 'Farm', NULL, 'Yes'),
(455, 'SLO High School FFA Group', NULL, NULL, 'assorted', NULL, 'other', NULL, 'Yes', 'Jodi Evans SLO High School FFA Group', NULL, NULL, NULL, '05-20', 'No', NULL, 'No', NULL, 'Jodi Evans SLO High School FFA Group', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1499 San Luis Drive', 'San Luis Obispo', 'CA', '93401', '1499 San Luis Drive', 'San Luis Obispo', 'CA', '93401', NULL, ' ', 'Caitlin Stanton, high school student involved in FFA, has been the main contact to coordinate a Fruit Drive within the SLO High School FFA department.  She first contacted GleanSLO in the fall 2013. Her number is 805-440-6841, email is caitlinastanton@gmail.com.  Jodi Evans is the FFA advisor and has been involved on the periphery.  ', '35.2829', '-120.6517', 'Drive', NULL, 'Yes'),
(456, 'Sansom', 'front, by driveway', NULL, 'oranges', '1 tree', 'owner', NULL, 'No', NULL, NULL, '10', '5', '04-01', 'No', NULL, 'Yes', 'non toxic spray', 'Mary Sansom', '805 235-6122', 'msansom@mac.com', NULL, '805 542-9608', NULL, NULL, NULL, NULL, '289 Marlene Drive', 'San Luis Obispo', 'CA', '93405', '289 Marlene Drive', 'San Luis Obispo', 'CA', '93405', NULL, 'Other', NULL, '35.3005', '-120.6813', 'Pickup', NULL, 'Yes'),
(457, 'Parsons', 'Backyard', NULL, 'loquats', '2 trees', 'owner', NULL, 'Yes', 'Rosalyn Parsons', NULL, '20', '3', '07-07', 'No', NULL, 'No', NULL, 'Rosalyn Parsons', '805-481-8264', 'enrparsons@sbcglobal.net', NULL, NULL, NULL, NULL, NULL, NULL, 'P O Box 997', 'Grover Beach', 'CA', '93483', '131 Grandview Dr.', 'Grover Beach', 'CA', '93483', NULL, 'Newspaper', 'Have to go through a gate to get to the backyard.', '35.1298', '-120.6221', 'Backyard', NULL, 'Yes'),
(458, 'Bellevue-santa Fe Charter School', NULL, NULL, 'assorted', NULL, 'other', NULL, 'Yes', ' Bellevue-Santa Fe Charter School', NULL, NULL, NULL, '05-23', 'No', NULL, 'No', NULL, 'Bellevue-santa Fe Charter School', '(805) 595-7169', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1401 San Luis Bay Drive', 'San Luis Obispo', 'CA', '93405', '1401 San Luis Bay Drive', 'San Luis Obispo', 'CA', '93405', NULL, ' ', 'Lauri Rainwater-Quinn, a parent at Bellevue-Santa Fe, contacted Jeanine in the spring of 2014 to host a Fruit Drive.  She set up a time for Jeanine to come to the school and give a quick presentation at their morning announcements.  She helped facilitate the conversation with several teachers and the principal to have a daily reminder about the Fruit Drive, sent out in the weekly newsletter and social media.  \r\n\r\nHer contact information is: 805-710-1317 or 805-773-3302 and rainwaterquinn@gmail.com', '35.1929', '-120.7144', 'Drive', NULL, 'Yes'),
(459, 'Walker', 'backyard', NULL, 'apricots', '1 tree', 'owner', NULL, 'No', NULL, NULL, '20', '1', '06-11', 'No', NULL, 'No', NULL, 'Ty Walker', '805-286-8858', 'tywalker1264@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Grover Beach', 'CA', '93451', '185 South 7th Street', 'Shandon', 'CA', '93461', NULL, 'Other', 'UPDATE 10/2014--OWNERS MOVED TO GROVER BEACH.  Loaded with fruit...one of the branches broke due to the weight.  Volunteers can harvest everything.  Owner does not need to be home.  Gate on the right hand side of the house.  No dogs, ground is even.', '35.6544', '-120.3699', 'Backyard', NULL, 'Yes'),
(460, 'Stanier', 'Front yard', NULL, 'tangerines', '1 tree', 'owner', NULL, 'Yes', 'Stanier Family', 'Yes', '14', '1', '06-05', 'No', NULL, 'No', NULL, 'Kimberly & John Stanier', '805-245-4442', 'Contessasslo@aol.com', NULL, '805-234-3119', NULL, NULL, NULL, NULL, '4740 Davenport Creek Road', 'San Luis Obispo', 'Ca', '93401', '4740 Davenport Creek Road', 'San Luis Obispo', 'CA', '93401', NULL, ' ', 'Veer to the left side of the house down the gravel drive.', '35.2320', '-120.6484', NULL, NULL, 'Yes'),
(461, 'Mckee', 'Backyard', NULL, 'oranges and grapefruits', NULL, 'owner', NULL, 'Yes', 'Girl Scout troop 40667', NULL, '14', '4', '06-14', 'No', NULL, 'No', NULL, 'Bettina Mckee', '805 788 0313', 'Bettina_mckee@yahoo.com', NULL, '805 903 2232', NULL, NULL, NULL, NULL, '1367 Fernwood drive', 'San Luis Obispo ', 'Ca', '93401', '1367 Fernwood Drive', 'San Luis Obispo ', 'CA', '93401', NULL, ' ', NULL, '35.2642', '-120.6379', NULL, NULL, 'Yes'),
(462, 'Woelper', 'backyard ', NULL, 'oranges and lemons', NULL, 'owner', NULL, 'Yes', 'Sally Woelper', 'Yes', '12', '2', '06-12', 'No', NULL, 'No', NULL, 'Sally Woelper', '805-440-9894', 'swoelper@att.net', NULL, '805-481-4956 ', NULL, NULL, NULL, NULL, '2747 Northview Ave', 'Arroyo Grande', 'CA', '93420', '2747 Northview Ave', 'Arroyo Grande', 'CA', '93420', NULL, 'Newspaper', 'There are two navel orange trees and one Eureka lemon tree near woodpile and asparagus.', '35.0729', '-120.5893', 'Backyard', NULL, 'Yes'),
(463, 'Stanier', 'front yard', NULL, 'apricots', '1 tree', 'owner', NULL, 'Yes', 'Stanier Family', 'Yes', '15', NULL, '06-11', 'No', NULL, 'No', NULL, 'Kimberly & John Stanier', '805-245-4442', 'Contessasslo@aol.com', NULL, '805-234-3119', NULL, NULL, NULL, NULL, '4740 Davenport Creek Road', 'San Luis Obispo', 'CA', '93401', '4740 Davenport Creek Road', 'San Luis Obispo', 'CA', '93401', NULL, ' ', 'Veer to the left side of the house down the gravel drive.', '35.2320', '-120.6484', 'Backyard', NULL, 'Yes'),
(464, 'Cantrell', 'Backyard', NULL, 'oranges and tangerines', '3 trees', 'owner', NULL, 'No', NULL, NULL, '15', '2', '07-29', 'No', NULL, 'No', NULL, 'Robinette Cantrell', '805-473-1946', 'robcan@pacbell.net', NULL, NULL, NULL, NULL, NULL, NULL, '519 Gaynfair Terr.', 'Arroyo Grande ', 'CA', '93420', '519 Gaynfair Terr.', 'Arroyo Grande ', 'CA', '93420', NULL, 'Web search', 'There is one orange and two tangerine trees.  My husband and I cannot harvest all the fruit on our trees.  I have pawned off to neighbors as much as I can.  There is still a good amount of fruit.  NEVER sprayed.  I have contacted my gardener to trim the trees as to get them healthier and closer to something I can manage.  He hasn''t given me a date yet for the trimming so, sooner than later would be a good time to harvest.  Our trees are abundant producers--the change in our climate makes it almost year around. I would like to be able to set something up on a re-occurring basis.  I hope we are not to small to be acknowledged by your group.  If we are, could you please point me in another direction.\r\nThank- you,\r\nRobinette', '35.1100', '-120.5943', 'Backyard', NULL, 'Yes'),
(465, 'Madansky', 'bakyard', NULL, 'plums and apriots', '2 trees', 'owner', NULL, 'Yes', 'madansky family', 'Yes', '25', '4', '07-02', 'No', NULL, 'No', NULL, 'Cayya Madansky', '8054813077', 'cayya@charter.net', NULL, '341-0707', NULL, NULL, NULL, NULL, '670 Verde Place', 'Arroyo Grande', 'Ca', '93420', '670 Verde Place', 'Arroyo Grande', 'CA', '93420', NULL, 'Other', 'dog will need to be brought inside while piking', '35.1068', '-120.5992', 'Backyard', NULL, 'Yes'),
(466, 'Muller', 'Back yard', NULL, 'pineapple guavas', '5 Bushes', 'owner', NULL, 'No', NULL, NULL, '18', '6', '10-29', 'No', NULL, 'No', NULL, 'John Muller', '544-6877', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1567 Cucaracha Court', 'San Luis Obispo', 'CA', '93405', '1567 Cucaracha Court', 'San Luis Obispo', 'CA', '93405', NULL, 'Friend', 'My neighbor is willing to have the guavas harvested from his back yard as well.  The bushes are planted at the back fence and hang over onto his property.  The fruit ripening dates vary.\r\n\r\nTo confirm, please contact:  Solomon Stein, 1534 Royal Way, San Luis Obispo, CA 93405\r\n(805)545-7767\r\n', '35.2575', '-120.6946', NULL, NULL, 'Yes'),
(467, 'Golub', 'backyard', NULL, 'red onions', '20-30 onions', 'renter', NULL, 'Yes', 'Amy Golub and Chris Johnson', NULL, '1', '1', '06-10', 'No', NULL, 'No', NULL, 'Amy Golub', '415-533-7372', 'amy.golub@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '875 Calle Del Caminos', 'San Luis Obispo', 'CA', '93401', '875 Calle Del Caminos', 'San Luis Obispo', 'CA', '93401', NULL, 'GleanSLO volunteer', '6/12/14 Jeanine spoke with Amy and she is going to harvest the onions herself and take them to AIDS support network or Salvation Army. \r\n\r\nWe do have a dog, but she can put in a room in the house. Access is through the house. I am also very happy to harvest the crops myself and have someone pick them up rather than have you organize a harvest. ', '35.2456', '-120.6412', 'Pickup', NULL, 'Yes'),
(468, 'Sanchez Gomez', 'field', NULL, 'zucchini', '4 acres', 'renter', NULL, 'Yes', 'Adan Sanchez Gomez', NULL, '1', '1', '10-28', 'No', NULL, 'Yes', NULL, 'Adan Sanchez Gomez', '805-878-8622', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Los Osos Valley Rd/Hwy 101', 'San Luis Obispo', 'CA', '93401', 'Los Osos Valley Rd/Hwy 101', 'San Luis Obispo', 'CA', '93401', NULL, 'Neighbor', 'Contact person is Mariam Damion. Adan is the owner but does not speak English. Mariam is his assistant. Field is located at across the street from the strawberry stand at the overpass of Hwy 101 and LOVR. Address unknown. \r\nHarvesting through June 28, then replanting and crops will be ready to pick up again around July 22. Harvesting takes place M, W, Fri (sometimes Sat) from 6:30am-2pm. Pick up boxes of damaged zucchini at 2pm on harvesting days. ', '35.2828', '-120.6596', 'Farm', NULL, 'Yes'),
(469, 'Pechmann', 'front yard', NULL, 'plums', '1 tree', 'owner', NULL, 'Yes', 'Pechmann family', NULL, '7', '3', '06-23', 'No', NULL, 'No', NULL, 'Gisela Pechmann', '805-709-1957', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2370 Clarkie Way', 'Arroyo Grande', 'cA', '93420', '2370 Clarkie Way', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'Entered by Jen: fruit trees are located on the left hand side of the driveway. She has several apricots (not much fruit left) and the plum tree is loaded. Gisela has a pole picker we can borrow, doesn''t think we''ll need a ladder. Flat, sandy soil, lots of gopher holes. She is home all day and would like to meet the pickers to show them which trees. No dogs. ', '35.0872', '-120.5622', 'Backyard', NULL, 'Yes'),
(470, 'Schmaeman', 'back yard', NULL, 'peaches', '1 tree', 'owner', NULL, 'Yes', 'Vicki Schmaeman', NULL, '10', '3', '06-27', 'No', NULL, 'No', NULL, 'Vicki Schmaeman', '805-473-4967', 'tisame@eaarthlink.net', NULL, '805-236-9093', NULL, NULL, NULL, NULL, '548 Seabright Ave', 'Grover Beach', 'CA', '93433', '548 Seabright Ave', 'Grover Beach', 'CA', '93433', NULL, 'Web search', '6/14--The tree was half dead when the homeowners moved in last year and are doing the best to revive it.  Vicki is going to get the tree pruned this year.  ', '35.1172', '-120.6249', 'Backyard', NULL, 'Yes'),
(471, 'Hubbard', 'side yard', NULL, 'plums', '1 tree', 'owner', NULL, 'No', NULL, NULL, '15', '5', '06-26', 'No', NULL, 'No', NULL, 'Henry Hubbard', '805-503-9912', 'henrylhubbard@gmail.com', NULL, '805-541-3185 H', NULL, NULL, NULL, NULL, '505 High St.', 'San Luis Obispo', 'CA', '93401', '505 High St.', 'San Luis Obispo', 'CA', '93401', NULL, 'Flyer', 'Entered by Jeanine.  Henry heard of GleanSLO through a Fruit Drive flyer hosted by Hawethorne Elementary. ', '35.2719', '-120.6610', 'Backyard', NULL, 'Yes'),
(473, 'Walker', NULL, NULL, 'plums', '1 tree', 'owner', NULL, 'No', NULL, NULL, '10', NULL, '07-07', 'No', NULL, 'No', NULL, 'Ty Walker', '805-268-8858', 'tywalker1264@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, 'PO Box 113', 'San Miguel', 'CA', '93451', '185 South 7th Street', 'Shandon', 'CA', '93461', NULL, 'Other', 'UPDATE 10/2014--OWNERS MOVED TO GROVER BEACH\r\nEntered by Jeanine.  Loaded with fruit...branches are bending and breaking.  I suggested that next spring he thin out his fruit and gave him a couple resource links.', '35.6544', '-120.3699', 'Backyard', NULL, 'Yes'),
(477, 'Casa Milagro', NULL, 'Morro Bay', 'avocados', '850 trees', 'owner', NULL, 'Yes', 'Casa Milagro', NULL, '16', '7', '07-22', 'No', NULL, 'No', NULL, 'Rick Sauerwein Casa Milagro', '805-766-4352', 'rsauerwein@synergsolu.com', NULL, '805-610-2008', NULL, NULL, NULL, NULL, '1301 Little Morro Creek Road', 'Morro Bay', 'CA', '93442', '1301 Little Morro Creek Road', 'Morro Bay', 'CA', '93442', NULL, 'Neighbor', 'Entered by Jeanine.  Rick has 7 acres of Haas avocados that are too small to be marketable.  His next door neighbor is Jerry Urqhart.  Rick, with the help of his son (in-law?) Dave are going to be "stumping" a portion of his trees to save them from the drought.  We are hoping to coordinate the glean so our volunteers can harvest the branches that have already been cut down making it easier and more efficient.  \r\n\r\nVolunteers can park in the wide section of the driveway on the left near the mailboxes and right side near the orchard before you cross over the creek.  ', '35.3867', '-120.8290', 'Farm', NULL, 'Yes'),
(478, 'Reynolds', 'side of property', NULL, 'apricots', '1 tree', 'owner', NULL, 'Yes', 'Brenda Reynolds', NULL, '25', '4', '07-03', 'No', NULL, 'No', NULL, 'Brenda Reynolds', '714-264-0030', 'brenda.reynolds0612@yahoo.com', NULL, '805-365-7015', NULL, NULL, NULL, NULL, '15500 Powerline Road', 'Atascadero', 'CA', '93422', '15500 Powerline Road', 'Atascadero', 'CA', '93422', NULL, ' ', 'OK TOCOME IN THE EVENING WHEN IT IS COOL TO PICK.  WE PLAN ON PRUNING THIS TREE WAY BACK SO UPPER BRANCHES CAN BE CUT OFF.  WE WILL BE HERE TO ASSIST.', '35.4185', '-120.6279', NULL, NULL, 'Yes'),
(479, 'Woelper', NULL, NULL, 'avocados', '4 trees', 'owner', NULL, 'Yes', 'Sally Woelper', NULL, '20', NULL, '07-17', 'No', NULL, 'No', NULL, 'Sally Woelper', '805-440-9894', 'swoelper@att.net', NULL, NULL, NULL, NULL, NULL, NULL, '2747 Northview Ave', 'Arroyo Grande', 'CA', '93420', '2747 Northview Ave', 'Arroyo Grande', 'CA', '93420', NULL, 'Newspaper', 'Entered by Jeanine.  Sally has 2 Zutano, one Fuerte and one Haas trees that she would to donate.  Chuck has been to the property and has a better idea of how much fruit is available to pick.', '35.0729', '-120.5893', 'Backyard', NULL, 'Yes'),
(483, 'Alcon', 'inside the gates', NULL, 'lemons', '2 trees', 'owner', NULL, 'No', NULL, NULL, '15', '6', '08-06', 'Yes', 'spiders, aphids', 'No', NULL, 'Sylvia Alcon', '805 595-9239', 'sjalcon@att.net', NULL, NULL, NULL, NULL, NULL, NULL, 'PO Box 442', 'Avila Beach', 'CA', '93424', '220 San Miguel St', 'Avila Beach', 'CA', '93424', NULL, 'SLO Food Bank', 'there''s fruit all year, not just one week.\r\n\r\nHas a dog, but is friendly.', '35.1819', '-120.7326', 'Backyard', NULL, 'Yes'),
(484, 'Firstfruits Farm', NULL, NULL, 'gardening work day', NULL, 'other', NULL, 'Yes', 'Firstfruits Farm', NULL, NULL, NULL, '11-01', 'No', NULL, 'No', NULL, 'Darin Laity Firstfruits Farm', '805-234-7686', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '835 Serpa Ranch Rd', 'San Luis Obispo', 'CA', '93401', '835 Serpa Ranch Rd', 'San Luis Obispo', 'CA', '93401', NULL, ' ', NULL, '35.2267', '-120.6417', 'Farm', NULL, 'Yes'),
(485, 'Horton', 'Back yard', NULL, 'pluots and plums', '2 - 3 trees', 'owner', NULL, 'No', NULL, NULL, '8', '2', '08-03', 'No', NULL, 'No', NULL, 'Pamela Horton', '805-423-5230', 'jburtonfan@charter.net', NULL, NULL, NULL, NULL, NULL, NULL, '922 Sycamore Canyon Rd.', 'Paso Robles', 'CA', '93446', '922 Sycamore Canyon Rd.', 'Paso Robles', 'CA', '93446', NULL, 'Web search', 'I have dogs in the backyard.  Work in SLO during the day.  Need to know if volunteers can come on a weekend, preferably on a Sunday.', '35.6038', '-120.6467', 'Backyard', NULL, 'Yes'),
(486, 'Halcyon', 'back yard', NULL, 'oranges and lemons', '2 trees', 'owner', NULL, 'Yes', 'Anita Halcyon', NULL, '12', '4', '08-14', 'No', NULL, 'No', NULL, 'Anita Halcyon', '805-234-1449', 'ahalcyon@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '3057 S. Higuera St. #229', 'San Luis Obispo', 'CA', '93401', '3057 S. Higuera St. #229', 'San Luis Obispo', 'CA', '93401', NULL, 'Neighbor', 'Lot of lemons.  Please make an appointment with me.  I need to be present for folks to be in the back yard.\r\n\r\nThe lemons are ripe, beautiful, and disease free.\r\nI would suggest an 8 ft ladder, a picker and clippers.\r\nOne person could do it, but two could get it done in less than an hour.\r\nThey added sulfer at the base of the tree so the grass below died and roots are exposed. The owner asked if a cover (perhaps burlap or tarp) could be used to cover the exposed area (5x4ish).\r\nHeight range of fruit is approx 4ft - 12ft\r\nOwner asks that 80% of the top portion of the tree be harvested and to leave low hanging fruit for their use.\r\nThere is a deck platform that can be used to glean the tree. Gleaners are allowed to move the furniture on it.\r\nI would guess about 75lbs of fruit.\r\nCars may be parked out front, but not in front of the mailbox.\r\nLast, but not least, the owner would like a receipt.', '35.2579', '-120.6673', 'Backyard', NULL, 'Yes'),
(487, 'Lewicki', 'by house', NULL, 'assorted', NULL, 'owner', NULL, 'Yes', 'Jenniffer Lewicki', 'Yes', '9', '2', '11-17', 'No', NULL, 'No', NULL, 'Jenniffer Lewicki', '408-307-0253', 'JennifferL@comcast.net', NULL, NULL, NULL, NULL, NULL, NULL, '4915 East Highway 41', 'Paso Robles', 'CA', '95032', '4915 East Highway 41', 'Paso Robles', 'CA', '95032', NULL, 'GleanSLO web site', '~100 young trees=40 pomegranate trees, apples, peaches, plums, etc.  Would like to start donating regularly.\r\n\r\nAlternative contact: Colleen (sister) @ 602-571-9509, if Jenniffer and her husband are out of town.\r\n\r\nThe driveway is a little less than 1 mile from the 229S intersection on the RIGHT hand side of the road.  The driveway is hard to see and the house is not visible from the road.  Gate code: 2112', '35.5369', '-120.5032', 'Backyard', NULL, 'Yes'),
(488, 'Ikeda Brothers', NULL, NULL, 'zucchini', NULL, 'owner', NULL, 'Yes', 'Ikeda Brothers', NULL, NULL, NULL, '08-02', 'No', NULL, 'No', NULL, 'Tom Ikeda Brothers', '805-471-2526', 'maslin1@msn.com', NULL, '805-489-2526', NULL, NULL, NULL, NULL, 'P.O. Box 518', 'Oceano', 'CA', '93475', NULL, NULL, NULL, NULL, NULL, ' ', NULL, NULL, NULL, 'Farm', NULL, 'Yes'),
(490, 'Horwitz', 'back yard', NULL, 'stone fruit', '2 trees', 'owner', NULL, 'Yes', 'Horwitz Family', NULL, '10', '5', '08-08', 'No', NULL, 'No', NULL, 'Janie Horwitz', '805-461-5264', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '10005 Escondido Road', 'Atascadero', 'CA', '93422', '10005 Escondido Road', 'Atascadero', 'CA', '93422', NULL, 'SLO Food Bank', 'Entered by Jeanine.  Will need ladder. There are two varieties of pears grafted on one tree: Bosc and Bartlett, apples (which we think are for baking), peaches and nectarines.\r\n\r\nNotes from Katy Budge: Very nice older couple and he is recovering from a heart attack, obviously not a good idea for him to be on a ladder picking fruit, so it was nice to help them out. I lopped off a couple branches that had split from the weight and Wendy raked up the fallen fruit so it was up next to the trees and out of the way. \r\n', '35.4737', '-120.6892', 'Backyard', NULL, 'Yes'),
(491, 'Samuel', 'in the orchard', NULL, 'grapes, figs, pears', '5-7 trees', 'owner', NULL, 'Yes', 'David & Carol Samuel', NULL, '12', '2', '09-02', 'No', NULL, 'No', NULL, 'David & Carol Samuel', '805-423-0811 C', 'davidasamuel@yahoo.com', NULL, '805-423-2422 D', NULL, NULL, NULL, NULL, '6380 Vista De Robles Place', 'Paso Robles', 'CA', '93447', '6380 Vista De Robles Place', 'Paso Robles', 'CA', '93447', NULL, 'SLO Food Bank', 'Entered by Jeanine.  David & Carol at one point sold fruit under the name "Orchard Hill Ranch" but are now retired and would like to start donating the fruit to the Food Bank.  They have pears, apples, figs, pomegranates, walnuts, persimmons, grapes, peaches, nectarines and apricots.  Most of the fruit will be ripe starting in the summer until late fall.', '35.6154', '-120.5814', 'Backyard', NULL, 'Yes'),
(492, 'Domenighini', 'back yard', NULL, 'oranges', '2 trees', 'owner', NULL, 'No', NULL, NULL, '12', '6', '08-13', 'No', NULL, 'No', NULL, 'Janice Domenighini', '805-489-8809', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '816 Willow Lane', 'Arroyo Grande', 'CA', '93420', '816 Willow Lane', 'Arroyo Grande', 'CA', '93420', NULL, 'Neighbor', 'Entered by Jeanine.  \r\nChuck''s notes: Two well cared for trees about 10-11ft high. No dead branches visually beautiful fruit, lots of fruit but we are only working from 5-10 feet. I almost feel like I could do it myself but because it is heavily fruited one other person would be good. Call ahead to have dog put inside.\r\n', '35.1087', '-120.5893', 'Backyard', NULL, 'Yes');
