(493, 'Chechopoulos', 'back field', NULL, 'tomatoes', '200 ft row', 'owner', NULL, 'Yes', 'Chechopoulos family', NULL, '2', '1', '09-12', 'No', NULL, 'No', NULL, 'Kathy & Evan Chechopoulos', '805-544-7869', 'evankathy@gmail.com', NULL, '80-550-6756', NULL, NULL, NULL, NULL, 'same', 'San Luis Obispo', 'CA', '93401', '755 Evans Rd', 'San Luis Obispo', 'CA', '93401', NULL, 'Facebook', 'Entered by Jen: volunteers can park in the driveway and walk back to the field with the harvest leader. They''ll walk down the side of the house, past the backyard, past the solar panels, and it will open up to a 200'' row of cherry tomatoes. Bring berry baskets. The volunteer who will be delivering tomatoes can drive their vehicle back to the tomatoes for loading. Gates can stay open. NO BOX TRUCK accessibility, low power lines. No dogs. Estimates 3-5 volunteers for 2hrs could finish the job. Weekly harvests through Sept. Preferred days are Thurs, Fri,or Sat.', '35.2295', '-120.6421', 'Backyard', NULL, 'Yes'),
(495, 'Callaway', NULL, NULL, 'assorted', NULL, 'renter', NULL, 'Yes', 'Brookshire Farm', NULL, NULL, NULL, '08-20', 'No', NULL, 'No', NULL, 'Gretchen & Shawn Callaway', '805-801-3511', '549tree@gmail.com', NULL, '805-440-0491', NULL, NULL, NULL, NULL, 'P.O. Box 5234', 'San Luis Obispo', 'Ca', '93401', '4747 Los Osos Valley Road', 'San Luis Obispo', 'CA', '93405', NULL, 'GleanSLO volunteer', 'Main contact will be Shawn (husband).  Prefers texts or calls.  \r\nEntered by Jeanine:\r\nShawn and Gretchen run La Familia Farms.  It is more of a "entertainment" farm and less of a production farm.  They grow a couple types of corn, ~10 types of winter squash/pumpkins, and an acre plot of assorted vegetables, all of which they sell at their small farm stand. They also have a small, newly planted orchard.  For the growing season, Shawn will most likely have some produce harvested and waiting to pick up.  But there will be times when he would like help harvesting some of the crops.  Ideally we would have a NHL that can lead these small harvests with 2-3 other volunteers and drop the produce off at a local agency.  ', '35.2953', '-120.7679', 'Pickup', NULL, 'Yes'),
(496, 'Beltz', 'along the fence ', NULL, 'grapes', '300 pounds', 'owner', NULL, 'Yes', 'Felix Vallis', NULL, '2', '4', '08-14', 'No', NULL, 'No', NULL, 'Jenelle Beltz', '805-458-6876', 'jenellbeltz@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, 'same', 'Atascadero', 'ca', '93422', '6260 Palma Ave', 'Atascadero', 'CA', '93422', NULL, 'SLO Food Bank', 'Pull in the driveway, pass the front house. Grapes are located along the fence toward the back house. Homeowner''s name is Felix Vallis. His care taker (Jenelle) is the one who has called on his behalf. ', '35.4901', '-120.6689', 'Backyard', NULL, 'Yes'),
(497, 'Dale', 'South side ', NULL, 'lemons', '20-25', 'owner', 'Andy M-25angano ', 'Yes', 'Adam Dale', NULL, '8', '2', '08-18', 'No', NULL, 'No', 'Organic neem ', 'Adam Dale', '805-423-2996', 'adamdale1@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '5665 Edna Ranch Circle ', 'San Luis Obispo ', 'CA', '93405', '5665 Edna Ranch Circle', 'San Luis obispo ', 'CA', '93405', NULL, ' ', NULL, '35.2073', '-120.5581', NULL, NULL, 'Yes'),
(498, 'Pepper Creek Family Farm', 'greenhouse', NULL, 'basil', '20 lbs', 'owner', NULL, 'Yes', 'Peppercreek Family Farm', NULL, '3', '3', '08-18', 'No', NULL, 'No', NULL, 'Eric Boyd Pepper Creek Family Farm', '(805) 878-8910', 'emboyd913@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '1477 Marloma', 'Arroyo Grande', 'CA', '93420', '1477 Marloma', 'Arroyo Grande', 'CA', '93420', NULL, ' ', NULL, '35.1344', '-120.5241', 'Farm', NULL, 'Yes'),
(499, 'Trabia Farms', 'Fenced garden area', 'Paso Robles', 'assorted', '1 acre', 'owner', NULL, 'Yes', 'Trabia Farms', NULL, '2', '0', '10-09', 'No', NULL, 'No', NULL, 'Ben Polando Trabia Farms', '510-453-1761', 'bpolando@sbcglobal.net', NULL, NULL, NULL, NULL, NULL, NULL, 'Attn: Donna Fernandez, 38505 Cherry Street Suite C', 'Newark', 'CA', '94560', '2430 Township Rd.', 'Paso Robles', 'CA', NULL, NULL, 'SLO Food Bank', 'Entered by Jen, 8-18-14: Harvest Leader must meet volunteers at the gate on the road and caravan up together. Owner is very sensitive about sharing gate code with non-authorized users. All volunteers must park as directed by harvest leader and walk together to the garden, being mindful of construction equipment. If Ben is not present, check in with Eduardo, the foreman. Vehicle that will be delivering produce can pull down to the garden for easy access, all other vehicles park in the lot. No bathrooms currently. \r\n***Send harvest calendar with name/phone of harvest leader who will be using gate code to Donna Fernandez: dfernandez@innovpak.com, 510 853-4117. ***\r\nGATE CODE IS 0354# (push hard on the keypad)', '35.5822', '-120.7447', 'Farm', NULL, 'Yes'),
(500, 'Block', NULL, NULL, 'figs', '1 tree ', 'owner', NULL, 'Yes', 'Richard Block', NULL, NULL, NULL, '09-07', 'No', NULL, 'No', NULL, 'Richard Block', '805-438-3748', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '14740 Morningside Dr.', 'Atascadero', 'CA', '93422', '14740 Morningside Dr.', 'Atascadero', 'CA', '93422', NULL, 'SLO Food Bank', NULL, '35.4233', '-120.6194', 'Pickup', NULL, 'Yes'),
(501, 'Paine', 'back yard', NULL, 'oranges', '2 trees', 'renter', NULL, 'Yes', 'First Page Profiles Online LLC', NULL, '15', '8', '12-05', 'No', NULL, 'No', NULL, 'Brent Paine', '805-602-1443', 'painebrent@gmail.com', NULL, '805-441-1396', NULL, NULL, NULL, NULL, '383 Lincoln St', 'San Luis Obispo', 'CA', '93405', '383 Lincoln St', 'San Luis Obispo', 'CA', '93405', NULL, 'Friend', 'The trees are navel oranges and should be harvested at the end of winter/beginning of spring.  They are VERY tall...need a 10 foot ladder AND pole pickers to reach most of the fruit.', '35.2865', '-120.6672', 'Backyard', NULL, 'Yes'),
(502, 'Jonas', 'backyard', NULL, 'apples', '2 trees', 'owner', NULL, 'Yes', 'Susan Jonas', NULL, '6', '2', '09-02', 'No', NULL, 'No', NULL, 'Susan Jonas', '(805) 534-9849', 'jonart@charter.net', NULL, '(805) 534-9849', NULL, NULL, NULL, NULL, '611 Lilac dr.', 'Los osos', 'CA', '93402', '611 Lilac dr.', 'Los osos', 'CA', '93402', NULL, 'Newspaper', 'Access trees through gates at the top of each driveway on sides of house.   Parking in front.  No dog. ', '35.3100', '-120.8426', 'Backyard', NULL, 'Yes'),
(503, 'Tabuenca', 'back yard', NULL, 'oranges', '1 tree', 'owner', NULL, 'Yes', 'Art and Lana Tabuenca', NULL, '10', '4', '08-29', 'No', NULL, 'Yes', 'for asian citrus bug', 'Lana & Art Tabuenca', '805 748-1492', 'lanatabuenca@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '265 Lincoln St.', 'SLO', 'CA', '93405', '265 Lincoln St.', 'SLO', 'CA', '93405', NULL, 'Neighbor', 'Check with us first so we can put up our dog-thanks!\r\n\r\nThese are navel oranges.  They should be harvested sometime at the end of winter/beginning of spring.', '35.2878', '-120.6672', 'Backyard', NULL, 'Yes'),
(504, 'Paine', 'back yard', NULL, 'apples', '1 tree', 'renter', NULL, 'Yes', 'First Page Profiles Online LLC', 'Yes', '6', '15', '08-29', 'Yes', 'coddling moth', 'No', NULL, 'Brent Paine', '805-602-1443', 'painebrent@gmail.com', NULL, '805-441-1396', NULL, NULL, NULL, NULL, '383 Lincoln St.', 'San Luis Obispo', 'CA', '93405', '383 Lincoln St.', 'San Luis Obispo', 'CA', '93405', NULL, 'Friend', 'The quality of this fruit is mixed: very tasty and sweet, but much of the fruit has holes from apple coddling moth/worms.  Still worthwhile to pick.', '35.2865', '-120.6672', 'Backyard', NULL, 'Yes'),
(505, 'Carscaden', '1-front, 2-back', NULL, 'citrus', '3 trees', 'owner', NULL, 'No', NULL, 'Yes', '12', '6', '10-15', 'No', NULL, 'Yes', NULL, 'Gordan Carscaden', '805-801-8787', 'carscaden@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '382 Lincoln St. ', 'San Luis Obispo', 'CA', '93405', '382 Lincoln St.', 'San Luis Obispo', 'CA', '93405', NULL, 'Neighbor', 'Entered by Jeanine.  There are two orange and one tangerine trees.  The fruit is not ripe until the winter.  Gordan will contact me a couple weeks before the fruit is ripe to schedule a harvest.', '35.2865', '-120.6666', 'Backyard', NULL, 'Yes'),
(506, 'Bejo Seeds', NULL, NULL, 'tomatoes', '3 acres', 'owner', NULL, 'Yes', 'Bejo Seeds', NULL, NULL, NULL, '10-03', 'No', NULL, 'Yes', NULL, 'Bejo Seeds', '805-980-1523', 'j.diani@bejoseeds.com', NULL, NULL, NULL, NULL, NULL, NULL, '1872 Silver Spur Place', 'Oceano', 'CA', '93445', '2900 California 135', 'Los Alamos', 'CA', '93440', NULL, 'GleanSLO volunteer', 'Entered by Jeanine.  Nell Wade was approached by Julie Diani who offered to have GleanSLO harvest the tomato field.  Since the property is in Santa Barbara County we reached out to Santa Ynez Fruit & Veggie Rescue and the Backyard Bounty program of the SB Food Bank.  We offered up the field to them, but they were not able to handle such a large quantity.  We decided to have a joint glean and take whatever we harvest back to our respective agencies.\r\n\r\nArt Alvarado is the productions manager and was at the field to give us an introduction.  Jeanine has coordinated all the follow-up details with Art.  His email is: a.alvarado@bejoseeds.com\r\nHis contact information: \r\nmobile: 805-431-2479\r\noffice: 805-473-2199\r\nemail: a.alvarado@bejoseeds.com', '34.7537', '-120.3375', 'Farm', NULL, 'Yes'),
(507, 'Lindbery', NULL, 'Paso Robles', 'grapes', '65 vines', 'owner', NULL, 'Yes', 'Kim Lindbery', NULL, '2', '6', '09-16', 'No', NULL, 'No', NULL, 'Kim Lindbery', '805-453-5086', 'krlindbery@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '1960 Niderer', 'Paso Robles', 'CA', '93446', '1960 Niderer', 'Paso Robles', 'CA', '93446', NULL, 'SLO Food Bank', 'Kim, the homeowner has an orchard ladder so we don''t need to bring one. Some areas are sloped. Grapes grow along fence around the orchard, some areas will require ladder work to reach tall vines. Kim estimated 2-3 volunteers and 40 boxes should be sufficient for the ~65 vines. **Directions are different than google map**, must use easement driveways on dirt roads. Kim will send specific instructions for volunteers - don''t link to google maps. ', '35.5901', '-120.7641', 'Farm', NULL, 'Yes'),
(510, 'Plakias', 'front yard', NULL, 'pineapple guavas', '1 tree', 'owner', NULL, 'Yes', 'The Plakias Family', NULL, '8', '4', '09-23', 'No', NULL, 'No', NULL, 'Vanessa Plakias', '805-550-7215', 'vplakias88@hotmail.com', NULL, '805-434-7069', NULL, NULL, NULL, NULL, '466 Sandercock St.', 'San Luis Obispo', 'CA', '93401', '466 Sandercock St.', 'San Luis Obispo', 'CA', '93401', NULL, 'GleanSLO volunteer', 'Entered by Jeanine.', '35.2714', '-120.6620', 'Backyard', NULL, 'Yes'),
(511, 'Pepper Creek Family Farm', NULL, NULL, 'tatsoi', NULL, 'owner', NULL, 'Yes', 'Peppercreek Family Farm', NULL, NULL, NULL, '11-24', 'No', NULL, 'No', NULL, 'Eric Boyd Pepper Creek Family Farm', '(805) 878-8910', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1477 Marloma', 'Arroyo Grande', 'CA', '93420', '1477 Marloma', 'Arroyo Grande', 'CA', '93420', NULL, ' ', NULL, '35.1344', '-120.5241', 'Farm', NULL, 'Yes'),
(512, 'Black', 'Front porch', NULL, 'lemons', '1bag', 'owner', NULL, 'Yes', 'Chris Black', NULL, NULL, NULL, '01-01', 'No', NULL, 'No', NULL, 'Chris Black', '805-440-8308', 'cblackride@aol.com', NULL, NULL, NULL, NULL, NULL, NULL, '315 Cerro Rimauldo Avenue', 'San Luis Obispo', 'CA', '93405', '315 Cerro Rimauldo Avenue', 'San Luis Obispo', 'CA', '93405', NULL, ' ', 'I have just picked the lemons from my trees an left the bag on the front porch for pickup.', '35.2828', '-120.6596', NULL, NULL, 'Yes'),
(513, 'Tarlton', 'rear yard', NULL, 'apples ', '2 trees', 'landlord', NULL, 'No', NULL, NULL, '10', '5', '09-19', 'No', NULL, 'No', NULL, 'Dave Tarlton', '650-740-1197', 'DLTarlton@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, 'PO Box 3459', 'San Luis Obispo', 'CA', '93403', '755 Skyline Dr', 'San Luis Obispo', 'CA', '93405', NULL, 'Other', 'easy access through unlocked gate to the left of the garage. large tree=golden delicious.  smaller=red delicious.  small fig tree.', '35.3044', '-120.6806', 'Backyard', NULL, 'Yes'),
(514, 'Wissler & Meiborg', 'Backyard', NULL, 'citrus', '3 trees', 'owner', NULL, 'No', NULL, NULL, '12', '5', '09-29', 'No', NULL, 'No', NULL, 'Paul & Barbara Wissler & Meiborg', '805-543-8584 H', 'honyb50@hotmail.com', NULL, '805-503-0953 C', NULL, NULL, NULL, NULL, '855 Mirada Dr', 'San Luis Obispo', 'CA', '93405', '855 Mirada Dr', 'San Luis Obispo', 'CA', '93405', NULL, 'Web search', 'There are 3 trees: lemon (8 ft) orange (12ft) grapefruit (9ft). Enter backyard through the gate on the left side of the house.\r\n\r\nThere is an apple tree (8 ft )as well, but not sure how much we will get from it. It is coming out later this year.\r\n There are two indoor dogs-they are pathologically friendly.\r\n\r\nOn the first glean we used 10ft ladders and pole pickers. 4 boxes of oranges, 1.3 boxes of grpt, 1.5 boxes of apples, and .3 boxes of lemons', '35.2655', '-120.7030', 'Backyard', NULL, 'Yes'),
(515, 'Moses', 'in the garden', NULL, 'tomatoes', '10 tomato plant', 'renter', NULL, 'Yes', 'Moses Family', NULL, '3', '0', '09-25', 'No', NULL, 'No', NULL, 'Jacquelyn Moses', '6613052243', 'musicmomie@gmail.com', NULL, '6613052243', NULL, NULL, NULL, NULL, '395 tally ho road', 'arroyo grande', 'Ca', '93420', '395 tally ho road', 'arroyo grande', 'CA', '93420', NULL, 'SLO Food Bank', 'We have a gaurd dog but If I know what day you will be here I can have him shut up.  He doesn''t bite, just don''t try and pet him while he is barking his head off.', '35.1343', '-120.5712', 'Backyard', NULL, 'Yes'),
(517, 'Harway', 'back yard', NULL, 'grapes', '300-400 lbs', 'owner', NULL, 'No', NULL, NULL, '5', '2', '10-06', 'No', NULL, 'No', NULL, 'Olga Harway', '805-541-3505', 'rharway@charter.net', NULL, NULL, NULL, NULL, NULL, NULL, '635 Evans Road', 'San Luis Obispo', 'CA', '93401', '635 Evans Road', 'San Luis Obispo', 'CA', '93401', NULL, 'Newspaper', 'Entered by Jeanine.  Pull into 635 1/2 Evans Road driveway, the vines will be on the right side.  ', '35.2294', '-120.6471', 'Backyard', NULL, 'Yes'),
(518, 'Andreen', 'back yard', NULL, 'persimmons', '1 tree', 'owner', NULL, 'Yes', 'Andreen Family', 'Yes', '25', '6', '10-28', 'No', NULL, 'No', NULL, 'Patty Andreen', '(805) 550-1890', 'andreenfam@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '116 Chorro St.', 'San Luis Obispo', 'CA', '93405', '116 Chorro St.', 'San Luis Obispo', 'CA', '93405', NULL, 'Other', 'Entered Jeanine.  Fuyu variety.  Gate on the driveway.  Small dogs mostly inside.', '35.2903', '-120.6694', 'Backyard', NULL, 'Yes'),
(519, 'Andreen', 'front yard', NULL, 'lemons', '1 tree', 'owner', NULL, 'Yes', 'Andreen Family', NULL, '10', '4', '01-01', 'No', NULL, 'Yes', NULL, 'Patty Andreen', '(805) 550-1890', 'andreenfam@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '116 Chorro St.', 'San Luis Obispo', 'CA', '93401', '116 Chorro St.', 'San Luis Obispo', 'CA', '93401', NULL, 'Other', 'Entered by Jeanine.  Leave 5-10 lemons for the homeowner.  Fruit should be washed before using because of the spray.  ', '35.2903', '-120.6694', 'Backyard', NULL, 'Yes'),
(520, 'SLO Natural Foods Co-Op', NULL, NULL, 'Produce/Grocery', NULL, 'renter', NULL, 'Yes', 'SLO Natural Foods Co-Op', NULL, NULL, NULL, '11-04', 'No', NULL, 'No', NULL, 'Zach Ledbetter SLO Natural Foods Co-Op', '805-544-7928', 'grocery@slonaturalfoods.com', NULL, NULL, NULL, NULL, NULL, NULL, '2494 Victoria Ave. ', 'SLO', 'CA', '93401', '2494 Victoria Ave.', 'SLO', 'CA', '93401', NULL, 'Facebook', 'Jeanine was approached by Zach, an employee of the co-op, to see about starting a weekly pick up from the grocery.  There will be some shelf stable items, some frozen and some produce seconds...totaling about 2 crates/week.  We decided to schedule pick ups on Tuesdays, anytime during store hours, and brought to a local agency by a NHL or other volunteer.  We will need to weigh the various kinds of donations separately: salvaged (canned/shelf stable items), bread, and produce.  These will be reported to Mildred/entered into FCS categorized by the kind of donation it is.\r\n\r\nZach also suggested that the co-op be a central drop site for other farmers who have excess produce.  We''ll give it a try and see how much response we get.  If there''s too much food for a local site to handle, we''ll have the Food Bank come pick up and take it back to Oceano.', '35.2673', '-120.6525', NULL, NULL, 'Yes'),
(521, 'Talley Farms', NULL, NULL, 'green beens', '(8) 250 ft rows', 'owner', NULL, 'Yes', 'Talley Farms', NULL, '3', '0', '10-13', 'No', NULL, 'No', NULL, 'Brian & Johnine Talley Farms', '805-540-4271', 'brian@talleyvineyards.com', NULL, NULL, NULL, NULL, NULL, NULL, '3031 Lopez Drive', 'Arroyo Grande', 'CA', '93420', '2900 Lopez Drive', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'Entered by Jeanine.  Adam Stevens, fresh produce manager, contacted me to find out if we would like to glean the seconds of a couple rows of green beans.  The field is located just over the bridge on the left hand side near the power line pole.  ', '35.1714', '-120.5243', 'Farm', NULL, 'Yes'),
(522, 'Talley Farms', NULL, NULL, 'onions', NULL, 'owner', NULL, 'Yes', 'Talley Farms', NULL, '0', '0', '11-21', 'No', NULL, 'No', NULL, 'Brian & Johnine Talley Farms', '805-540-4271', 'brian@talleyvineyards.com', NULL, NULL, NULL, NULL, NULL, NULL, '3031 Lopez Drive', 'Arroyo Grande', 'CA', '93420', '~300 Talley Farms Road', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'Entered by Jeanine. Adam Stevens, fresh produce manager, contacted me to find out if we would like to glean the seconds of a couple rows of red onions at the same time we pick green beans. The field is located just over the bridge on the left hand side near the power line pole.', '35.1714', '-120.5243', 'Farm', NULL, 'Yes'),
(523, 'Junge', 'side yard', NULL, 'pomegranates', '5 bushes', 'owner', NULL, 'Yes', 'Bill & Sally Junge', NULL, '8', '1', '10-17', 'No', NULL, 'No', NULL, 'Bill & Sally Junge', '(805) 237-9000', 'wgsajunge@aol.com', NULL, NULL, NULL, NULL, NULL, NULL, 'same', 'Paso Robles', 'CA', '93446', '250 Encinal St.', 'Paso Robles', 'CA', '93446', NULL, 'Flyer', 'If volunteers, park in the driveway the cars should not leak oil.', '35.6118', '-120.6949', 'Backyard', NULL, 'Yes'),
(524, 'Dukes', 'Atrium of house', NULL, 'lemons', '20-25 lemons', 'owner', NULL, 'No', NULL, NULL, NULL, NULL, '01-01', 'No', NULL, 'No', NULL, 'John Dukes', '805-534-9011', 'dukesjeanne@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '2819 Rodman Drive', 'Los Osos', 'CA', '93402', '2819 Rodman Drive', 'Los Osos', 'CA', '93402', NULL, 'Newspaper', 'Are you interested in 20-25 lemons?  We can take them to wherever would be helpful.', '35.3011', '-120.8512', 'Backyard', NULL, 'Yes'),
(526, 'Cal Poly Hort/crop Science', 'cooler on the RIGHT', NULL, 'grapes', '100 lbs', 'owner', NULL, 'Yes', 'Cal Poly Horticulture & Crops Science Unit', NULL, NULL, NULL, '10-13', 'No', NULL, 'No', NULL, 'Alleen Cal Poly Hort/crop Science', '(805) 975-3228', 'alleentex@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '1 Grand Avenue, Bldg 17, Crops Unit', 'San Luis Obispo', 'CA', '93407', 'Crops Unit, Bldg 17, Highland & Mt. Bishop St.', 'San Luis Obispo', 'CA', '93407', NULL, ' ', 'Entered by Jeanine', NULL, NULL, 'Pickup', NULL, 'Yes'),
(527, 'Branch Mill Organics', 'front field  along  ', NULL, 'pumpkins', '1/4 acre', 'owner', NULL, 'Yes', 'Branch Mill Organic  Farm  and Retreat  Center ', NULL, '1', '1', '10-20', 'Yes', 'some are starting to soft', 'No', NULL, 'Ella Caldwell Branch Mill Organics', '303-887-7372 ', 'ellacaldwell@hotmail.com ', NULL, NULL, NULL, NULL, NULL, NULL, '2815 Branch Mill rd', 'Arroyo Grande', 'CA', '93420', '2815 Branch Mill Rd', 'Arroyo Grande ', 'CA', '93420', NULL, 'SLO Food Bank', 'Ella is an employee at Branch Mill Organics. They have Cinderella pumpkins ready to be harvested.  Come have rest as soon as possible.  Please call to figure out a time. Farm stand at entrance, driveway past a few buildings, gravel parking spot, next to framed green houses.  Ella will be there between 9:30 am-2:30 pm.', '35.1506', '-120.5306', 'Farm', NULL, 'Yes'),
(528, 'Fisher', 'backyard', NULL, 'citrus', '6 trees', 'owner', NULL, 'No', NULL, NULL, '35', '6', '11-20', 'No', NULL, 'No', NULL, 'Miryam Fisher', '805-259-8083', 'famfisher@sbcglobal.com', NULL, '805-298-2881', NULL, NULL, NULL, NULL, '1638 Crestview Circle', 'San Luis Obispo ', 'CA', '93401', '1638 Crestview Circle', 'San Luis Obispo ', 'CA', '93401', NULL, 'Friend', 'We have year-round oranges, grapefruit, tangerines.  Two small inside dogs.', '35.2635', '-120.6330', 'Backyard', NULL, 'Yes'),
(529, 'Talley Farms', NULL, NULL, 'carrots', '4 rows', 'owner', NULL, 'Yes', 'Talley Farms', NULL, '0', '0', '10-31', 'No', NULL, 'Yes', NULL, 'Brian & Johnine Talley Farms', '805-540-4271', 'brian@talleyvineyards.com', NULL, NULL, NULL, NULL, NULL, NULL, '3031 Lopez Drive', 'Arroyo Grande', 'CA', '93420', '~300 Talley Farms Road', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'Entered by Jeanine. Adam Stevens, Fresh Market Produce manager, contacted me to find out if we would like to glean the seconds of whatever produce is leftover from their fresh produce fields. The field is located on the left hand side of Talley Farms Road as you drive toward the cooling and packing plant.  Volunteers can make an immediate left after the bridge and park along the tree line.', '35.1713', '-120.5264', 'Farm', NULL, 'Yes'),
(530, 'Lee', 'front and back yard', NULL, 'persimmons', '2 trees', 'owner', NULL, 'Yes', 'Dana and Logan', 'Yes', '15', '6', '11-05', 'No', NULL, 'No', NULL, 'Dana Lee', '949-275-7355', 'danalee1021@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '428 Orchard Ave', 'Arroyo Grande', 'CA', '93420', '428 Orchard Ave', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'PLEASE TAKE AS MANY PERSIMMONS AS YOU CAN, WE DO NOT EAT THEM.\r\n\r\nTwo tall trees will need 10 foot ladders and pole pickers.  CAREFUL: Utilities lines run through the trees. ', '35.1178', '-120.5780', NULL, NULL, 'Yes'),
(531, 'Gott', 'backyard', NULL, 'lemons', '2 trees', 'owner', NULL, 'Yes', 'Yael Gott', NULL, '5', '0', '11-23', 'No', NULL, 'No', NULL, 'Yael Gott', '805-450-7571', 'yaelgott18@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '519 W. Taylor St.', 'Santa Maria', 'Ca', '93458', '519 W. Taylor St.', 'Santa Maria', 'CA', '93458', NULL, 'GleanSLO volunteer', 'The home is located in a mobile home park.  The gate code is *2468.  Take your first left, drive all the way to the end and take a right, it is a white house about 3 blocks down. The homeowner would like to donate ALL of the fruit. The trees are located behind the carport, which you can access through the driveway. Volunteers are welcome to pick and take lemons at any time, whether or not owner is present.\r\n', '34.9811', '-120.4435', 'Backyard', NULL, 'Yes'),
(532, 'Talley Farms', NULL, NULL, 'radishes', NULL, 'owner', NULL, 'Yes', 'Talley Farms', NULL, NULL, NULL, '10-31', 'No', NULL, 'No', NULL, 'Brian & Johnine Talley Farms', '805-540-4271', 'brian@talleyvineyards.com', NULL, NULL, NULL, NULL, NULL, NULL, '3031 Lopez Drive', 'Arroyo Grande', 'CA', '93420', '~300 Talley Farms Road', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'Entered by Jeanine. Adam Stevens, Fresh Market Produce manager, contacted me to find out if we would like to glean the seconds of whatever produce is leftover from their fresh produce fields. The field is located on the left hand side of Talley Farms Road as you drive toward the cooling and packing plant.  Volunteers can make an immediate left after the bridge and park along the tree line.', '35.1713', '-120.5264', 'Farm', NULL, 'Yes'),
(533, 'Stanier', NULL, NULL, 'persimmons and pomegranates', NULL, 'owner', NULL, 'Yes', 'Stanier Family', NULL, NULL, NULL, '11-21', 'No', NULL, 'No', NULL, 'Kimberly & John Stanier', '805-245-4442', 'Contessasslo@aol.com', NULL, '805-234-3119', NULL, NULL, NULL, NULL, '4740 Davenport Creek Road', 'San Luis Obispo', 'CA', '93401', '4740 Davenport Creek Road', 'San Luis Obispo', 'CA', '93401', NULL, ' ', 'Entered by Jeanine.  Veer to the left side of the house down the gravel drive.', '35.2320', '-120.6484', 'Backyard', NULL, 'Yes'),
(534, 'Robbins', 'front corner', NULL, 'oranges', '90 pounds', 'renter', NULL, 'No', NULL, NULL, '25', '6', '11-12', 'No', NULL, 'No', NULL, 'Greta Robbins', '(805) 550-3615', 'gretarobbins@hotmail.com', NULL, '8053080152', NULL, NULL, NULL, NULL, '231 S Mason St', 'Arroyo Grande', 'CA', '93420', '231 S Mason St', 'Arroyo Grande', 'CA', '93420', NULL, 'GleanSLO volunteer', 'Please do not strip the tree. You are NOT gleaning. You are taking only most of what is ripe. That is approximately 60% of the hanging, orange fruit at this time.\r\nThere are power lines 3 feet from one side of the tree on the street.', '35.1221', '-120.5744', 'Backyard', NULL, 'Yes'),
(535, 'Harlow', NULL, NULL, 'tomatoes', '30 lbs', 'owner', NULL, 'Yes', 'Harlow Family Orchard', NULL, NULL, NULL, '11-14', 'No', NULL, 'No', NULL, 'Carol Harlow', '805-434-2522', 'seb92438@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, '3575 Cloudy Meadow Rd', 'Templeton', 'CA', '93465', '3575 Cloudy Meadow Rd', 'Templeton', 'CA', '93465', NULL, 'Newspaper', 'Entered by Jeanine.  Carol has a small orchard of apple, persimmon and fig trees.  She owns 2 orchard ladders.\r\n\r\nCarol lives in Hidden Valley Ranch, off of 46-W.  Volunteers will need to call Carol on arrival and get a gate code to enter into the property.  She will meet volunteers to show them where the orchard and trees are located on her property.', '35.5344', '-120.7802', 'Backyard', NULL, 'Yes'),
(536, 'Cormany', 'Side of property', NULL, 'persimmons', '1 tree', 'owner', NULL, 'No', NULL, NULL, '15', '5', '11-11', 'No', NULL, 'No', NULL, 'Burt Cormany', '805-929-4662', 'burtoc@charter.net', NULL, NULL, NULL, NULL, NULL, NULL, '455 Mesa Road', 'Nipomo', 'CA', '93444', '455 Mesa Road', 'Nipomo', 'CA', '93444', NULL, 'GleanSLO web site', 'Hachiya variety.  Also has a lime tree and has offered for us to take whatever we can. \r\n\r\nThe home is located on a 4 acre parcel with a white fence and brick gate at the entrance to the driveway.  The homeowners need to know in advance when we''re coming to open it.  Volunteers can park near the house. ', '35.0270', '-120.5067', 'Backyard', NULL, 'Yes'),
(537, 'Ross', 'front yard', NULL, 'persimmons', '1 tree', 'renter', NULL, 'No', NULL, NULL, '20', '8', '11-19', 'No', NULL, 'No', NULL, 'Darcy Ross', '805-541-8377', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1801 1/2 Nipomo St.', 'San Luis Obispo', 'CA', '93401', '1801 1/2 Nipomo St.', 'San Luis Obispo', 'CA', '93401', NULL, 'Friend', 'Landlord''s name: Llolaine Ross for tax donation receipt.  Leave ~20 cut pieces of fruit for the homeowner.', '35.2726', '-120.6609', 'Backyard', NULL, 'Yes'),
(538, 'Cole', 'side yard', NULL, 'persimmons', '1 tree', 'owner', NULL, 'No', NULL, NULL, '12', '7', '11-12', 'No', NULL, 'No', NULL, 'Pammy Cole', '805-302-8482', 'pamela@christmasconcepts.com', NULL, NULL, NULL, NULL, NULL, NULL, '3960 S Higuera St. #8', 'San Luis Obispo', 'CA', '93401', '3960 S Higuera St. #8', 'San Luis Obispo', 'CA', '93401', NULL, ' ', 'Entered by Jeanine.  Entrance is through the wooden gate on the "back" side of the mobile home.  The tree overhangs the fence and raised garden beds.  Will be difficult to place a ladder.  Need a pole picker to reach most of the fruit.', '35.2476', '-120.6757', 'Backyard', NULL, 'Yes'),
(539, 'Ikeda Brothers', NULL, NULL, 'spinach', NULL, 'owner', NULL, 'Yes', 'Ikeda Brothers', NULL, '0', '0', '11-22', 'No', NULL, 'Yes', NULL, 'Tom Ikeda Brothers', '(805) 471-2526', 'maslin1@msn.com', NULL, NULL, NULL, NULL, NULL, NULL, 'P.O. Box 518', 'Oceano', 'CA', '93445', '2599 Produce Place', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'Entered by Jeanine', '35.0890', '-120.6004', 'Farm', NULL, 'Yes'),
(540, 'Talley Farms', 'Fresh Harvest Field', 'Arroyo Grande', 'leeks', '4 rows', 'owner', NULL, 'Yes', 'Talley Farms', NULL, '500', NULL, '11-28', 'No', NULL, 'No', NULL, 'Brian & Johnine Talley Farms', '805-540-4271', 'brian@talleyvineyards.com', NULL, NULL, NULL, NULL, NULL, NULL, '3031 Lopez Drive', 'Arroyo Grande', 'CA', '93420', '~300 Talley Farms Road', 'Arroyo Grande', 'CA', '93420', NULL, ' ', 'Entered by Jeanine.', '35.1713', '-120.5264', 'Farm', NULL, 'Yes'),
(541, 'Miller', 'Backyard', 'Atascadero', 'Fuyu Persimmons', '1 tree', 'owner', NULL, 'No', NULL, NULL, '18', '1', '12-01', 'No', NULL, 'No', NULL, 'Cheryl Miller', '805 703 3285', 'thxcptn@yahoo.com', NULL, NULL, NULL, NULL, NULL, NULL, '7670 Cortez Ave', 'Atascadero', 'CA', '93420', '7670 Cortez Ave', 'Atascadero', 'CA', '93420', NULL, 'SLO Food Bank', 'Use gate on right.  There are 2 dachshunds in the backyard, but they are mellow ... and old.  They might not even hear you come in.  There is only 1 tree but it is loaded and I am the only one in the family that likes them.  If you don''t want to come get them please let me know.  I posted it on craigslist 2 years ago and the tree was stripped clean in 3 days.  ', '35.4857', '-120.6468', 'Backyard', NULL, 'Yes');
