(3, 'Stone', 'Jessica', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'owner', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '01-01', 'no', NULL, 'no', NULL, ' ', NULL, NULL, NULL, '2014-03-31', 'Yes', ' '),
(4, 'Munoz', 'Annette', '253-905-7747', NULL, 'Queenanne9@yahoo.com', '3344 N Shirley St', 'Tacoma', 'WA', 98407, '3344 N Shirley St', 'Tacoma', 'WA', 98407, NULL, NULL, 'owner', NULL, 'Pears', '1 tree', 'Backyard', 10, 5, NULL, '08-24', 'yes', 'It has dark spots', 'no', NULL, 'Newspaper', 'The pears may not be pretty, but they make great pear sauce (like apple sauce).  Tree is in the back part of the backyard (west) by the wood fence.  Enter at chainlink fence, gate to left of garage; driveway is on Shirley St. \r\n\r\nI also will have 6 nice lettuce plants and 6 Tuscan kale plants (organic grown) to harvest from the rsised bed, by June 15!', 47.2795, -122.5109, '2014-05-29', 'Yes', 'Backyard'),
