(7, 'Appleseed', 'Johnny', '253-253-2532', NULL, 'jonny.appleseed@gmail.com', '123 Cherry Lane', 'Tacoma', 'WA', 98405, '123 Cherry Lane', 'Tacoma', 'WA', 98405, NULL, 'South Tacoma', 'owner', NULL, 'Apple Tree', '2', 'Backyard', 15, 10, NULL, '07-28', 'no', NULL, 'no', NULL, 'Friend', 'Dogs on property', 0.0000, 0.0000, '2014-06-24', 'Yes', 'Backyard'),
(8, 'Calchina', 'Darcy', '541-561-5928', NULL, 'calchina01@gmail.com', '10524 40th Avenue East', 'Tacoma', 'WA', 98446, '10524 40th Avenue East', 'Tacoma', 'WA', 98446, NULL, NULL, 'owner', NULL, 'Cherries', '3 trees', 'Backyard ', 40, 8, 'Fair', '07-6', 'no', NULL, 'no', NULL, 'Friend', '3 tall trees, bring as many 8ft ladders as there are people. A little under-ripe, but good quality Rainier and pie cherries. Not a ton this year, would like updates on Fruit Tree Stewards. ', 47.1600, -122.3764, '2014-06-25', 'Yes', 'Backyard'),
(10, 'Garnett', 'Julia', '253.753.6394', NULL, 'julia.garnett@comcast.net', '2618 N Puget Sound Ave', 'Tacoma', 'WA', 98407, '2618 N Puget Sound Ave', 'Tacoma', 'WA', 98407, NULL, 'North End Tacoma', 'owner', NULL, 'Cherries', '1 tree', 'back yard ', 30, 8, 'excellent', '06-27', 'no', 'none', 'no', NULL, 'Other', 'Very abundant tree, 3-4 people a good number to harvest. Small backyard with slightly challenging ladder placement. Bring 3 of the tallest orchard ladders. Fruit was a little overripe, but ripe date is now updated.', 47.2717, -122.4830, '2014-06-30', 'Yes', 'Backyard'),
(9, 'Eugenio', 'Anne', '2535073461', '2535073461', 'eugenio_anne@yahoo.com', '10923 130th St Ct E', 'Puyallup', 'WA', 98374, '10923 130th St Ct E', 'Puyallup', 'WA', 98374, NULL, NULL, 'owner', NULL, 'Cherries ', '1 big tree', 'backyard', 8, 2, NULL, '07-03', 'no', NULL, 'no', NULL, 'Other', 'We have dogs, so keep the gates closed!', 47.1379, -122.2826, '2014-06-26', 'Yes', 'Backyard'),
(11, 'Sullivan-barrett', 'Matthew', '2539886944', '2535921282', 'jjspackle@yahoo.com', '4410 N. 30th St.', 'Tacoma', 'WA', 98407, '4410 N. 30th St.', 'Tacoma', 'Wa', 98407, NULL, 'North Tacoma', 'owner', NULL, 'Apple', '1 Tree', 'Back yard', 25, 5, NULL, '07-15', 'no', NULL, 'no', NULL, 'Web search', 'Back yard accessible from south alley. Power lines in alley and near tree. OK to trim tree as needed!\r\nDog in house, but call ahead to ensure back door is open if we are home.\r\nWe don''t need to keep any portion of the harvest.', 47.2746, -122.4969, '2014-06-30', 'Yes', 'Backyard'),
