(23, 'Neyman', 'Linnae', '2537782212', '2535175095', 'aklinnae@yahoo.com', '3301 SW 333rd St', 'Federal Way', 'WA', 98023, '3301 SW 333rd St', 'Federal Way', 'WA', 98023, NULL, NULL, 'owner', NULL, 'Apples', '1 tree', 'near Front sidewalk', 10, 3, NULL, '07-17', 'no', NULL, 'no', NULL, 'Web search', 'I can pick the surplus ripe apples and take them to you. Its only one tree but its doing so well this year, I hate to waste the apples.', 47.3039, -122.3737, '2014-07-13', 'Yes', 'Backyard'),
(24, 'D''andrea', 'Heidi', '253-502-8279', NULL, NULL, '5009 N. 10th Street', 'Tacoma', 'WA', 98406, '5009 N. 10th Street', 'Tacoma', 'WA', 98406, NULL, 'North Tacoma', 'owner', NULL, 'Transparent Apple', '1 tree', 'Backyard', NULL, NULL, NULL, '07-22', 'no', NULL, 'yes', '6x a year', 'Other', 'You can come in through the alley. I don''t have any dogs', 47.2592, -122.5045, '2014-07-16', 'Yes', 'Backyard'),
