(26, 'Vervalin', 'Kathy', '(253) 222-5103', NULL, NULL, '13707 Bingham Avenue East', 'Tacoma', 'WA', 98446, '13707 Bingham Avenue East', 'Tacoma', 'WA', 98446, NULL, NULL, 'owner', NULL, 'Transparent Apple', '1 tree', NULL, 12, NULL, NULL, '07-29', 'no', NULL, 'no', NULL, 'Other', 'Tree is on a slope and ladders can''t really be used. Fruit poles will get most of the fruit!', 47.1316, -122.3666, '2014-07-17', 'Yes', 'Backyard'),
(27, 'Miller', 'Katherine', '2532736393', '4253138298', 'katmillertacoma@comcast.net', '9702 40th avenue east', 'tacoma', 'WA', 98446, '9702 40th avenue east', 'tacoma', 'wa', 98446, NULL, 'East Tacoma', 'owner', NULL, 'Transparent Apple', '2 trees', 'side yard ', 30, 5, NULL, '07-29', 'no', NULL, 'no', NULL, 'Friend', 'Facing house the trees are on the left side of the house visible from the street. Transparent is ripe now judging by the number on the ground. The other tree is a different variety but I think it is ripe now too.  Transparent tree is probably 16 20 feet tall and the other tree is double that size.   ', 47.1688, -122.3764, '2014-07-17', 'Yes', 'Backyard'),
(28, 'Elling', 'Nancy', '(253) 752-8745', '(253) 752-0718', NULL, '1101 S. Orchard', 'Tacoma', 'WA', 98465, '1101 S. Orchard', 'Tacoma', 'WA', 98465, NULL, 'Central/Hilltop Tacoma', 'owner', NULL, 'Yellow Plum', '1 tree', 'Backyard', 0, NULL, NULL, '07-29', 'no', NULL, 'no', NULL, 'Other', 'Just go to the backyard if she is not home. ', 47.2510, -122.5046, '2014-07-22', 'Yes', 'Backyard'),
(29, 'Yurovchak', 'Anita', '253-381-6714', '253-537-2878', 'anita.yurovchak@pse.com', '7508 Canyon Rd E', 'PUYALLUP', 'WA', 98371, '7508 Canyon Rd E', 'PUYALLUP', 'WA', 98371, NULL, 'Puyallup', 'owner', NULL, 'YELLOW PLUMS', '150-200# 1 tree', 'front yard', 15, 2, NULL, '07-31', 'no', NULL, 'no', NULL, 'Flyer', 'Tree is on north side of property. Plenty of room to park in driveway. Access across yard. The tree is 100 years old tree and is very wide. Hard to get fruit at top of tree. we don''t want anyone to climb in the tree.', 47.1889, -122.3584, '2014-07-23', 'Yes', 'Backyard'),
(30, NULL, 'Nina', '253-761-7606', NULL, NULL, '4408 N 9th Street', 'Tacoma', 'WA', 98406, '4408 N 9th Street', 'Tacoma', 'WA', 98406, NULL, NULL, 'owner', NULL, 'Apple', '1 tree', NULL, 0, NULL, NULL, '07-28', 'no', NULL, 'no', NULL, 'Other', 'I would like some apples for myself', 47.2578, -122.4965, '2014-07-24', 'Yes', 'Backyard'),
(31, 'Matthaei', 'Quinn', '235-737-9145', '253-737-9146', 'Qmatt24@yahoo.com', '2709 n Starr st', 'Tacoma', 'WA', 98403, '2709 n Starr st ', 'Tacoma', 'Wa', 98403, NULL, 'North Tacoma', 'owner', NULL, 'Asian pear apple', '100-150 pounds', 'Backyard', 15, 5, NULL, '08-13', 'no', NULL, 'no', NULL, ' ', 'Please call and schedule time', 47.2723, -122.4633, '2014-07-25', 'Yes', NULL),
(32, 'Doane', 'Bethany', '253-549-2967', '253-414-4830', 'bethany.doane@comcast.net', '500 N Shore Blvd', 'Fox Island', 'WA', 98333, '500 N Shore Blvd', 'Fox Island', 'wa', 98333, NULL, NULL, 'owner', NULL, 'apples', '1 large tree', 'hillside behind hous', 20, 4, NULL, '08-03', 'no', NULL, 'no', NULL, 'Other', 'I am not a gardener, so you probably want to send a "scout" to check for ripeness before you send people to pick :-).  If gravel parking is full, can park along the street (N. Shore Blvd)', 47.2633, -122.6429, '2014-07-25', 'Yes', 'Backyard'),
(33, 'Cress', 'Keila', '2537379650', NULL, 'Keilamarie86@hotmail.com', '1003 Maine Street', 'Milton', 'WA', 98354, '1003 Maine Street', 'Milton', 'WA', 98354, NULL, NULL, 'owner', NULL, 'Apples', '1 large old tre', 'Backyard', 30, 7, NULL, '01-01', 'no', NULL, 'no', NULL, ' ', 'We have dogs but they can be contained, our house is on a hill, can open back gate for easy access, not sure exactly when ripe - late august? Dont think there is fungus but sometimes they get bugs', 47.2479, -122.3216, '2014-07-26', 'Yes', ' '),
(34, 'Johnson', 'Raleigh', '253-355-2616', NULL, NULL, '4220 Gay Rd E', 'Tacoma', 'WA', 98405, '4220 Gay Rd E', 'Tacoma', 'WA', 98405, NULL, 'Tacoma', 'owner', NULL, 'Greens', '300lbs', NULL, NULL, NULL, NULL, '07-31', 'no', NULL, 'no', NULL, 'Other', 'Please park next to the red barn', 47.2244, -122.3717, '2014-07-29', 'Yes', 'Farm'),
