(71, 'Allred', 'Barrett', '253-905-4229', '253-973-8349', 'dallred@wamail.net', '613 S. Meyers St.', 'Tacoma', 'WA', 98465, '613 S. Meyers St.', 'Tacoma', 'WA', 98465, NULL, 'Central/Hilltop Tacoma', 'owner', NULL, 'D''Anjou pears', '1 tree', 'Backyard garden', 18, 8, NULL, '09-04', 'no', 'Organic, so some damage', 'no', NULL, 'Newspaper', 'We have three dogs. The pear tree is in the upper, fenced garden portion of the backyard--in the NE corner of our lot. The tree is behind the fenced dog runs attached to the garage. The dogs could be loose in the lower backyard, in the house or in their kennels and dog runs. I don''t always get around to cleaning up after them in the lower backyard, but there is a gravel path along the south side of the garage that leads from the deck to the garden area. They are generally kept out of the garden, so it should be "landmine" free for the most part. :-)\r\n\r\nDawn, my wife, is a nurse and sleeps days when she''s on duty. Call me to see if it''s OK to come on the property. I can let you know if my wife is home and whether to call her about the dogs. If I can''t answer, call my wife at the alternate number. If she doesn''t answer during the day, she''s probably sleeping and the dogs are in their kennels in the garage and have access to their dog runs. The dog runs are fenced, but they abut the garden. So, expect barking.\r\n\r\nThe volunteers are welcome to park in the long driveway leading up to the garage. They can enter the backyard through the gate leading onto the deck. If they park on the street, there is a front gate that will lead them into the side yard.', 47.2549, -122.5336, '2014-08-19', 'Yes', NULL),
